(1253, 0, NULL, NULL, NULL, 'Sobirova Gulshirin', '62-41-66-144', '2022-01-10', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 438, 'Sharaf ko\'chasi 7-uy', '', NULL, 0, NULL, 'Yangibozor tumani 64 OP binosi eski tamirlab berishingizni so\'raymiz deb yo\'llagan taklifi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-15', '2022-01-27 04:27:38', '2022-01-27 04:29:23', 1, '4146', '2022-01-10', NULL, 20, 'M.Q.Xalbayev', '1643239763.0239.pdf', 'xat', 'Вog\'olon mahallasida joylashgan 64-son oilaviy poliklinikasi binosini qayta qurish yuzasidan 2020-2021 yillar davomida mazkur binoni qayta qurish yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga tibbiyot birlashma raxbariyati tomonidan takliflar loyihasi kiritilgan. Yuqoridagilarga asoslanib,  Viloyat Sog\'liqni saqlash boshqarmasi tomonidan O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligiga manzilli ro\'yxatga kiritish taklifi berilgan. Tibbiyot birlashma tizimidagi 64-son oilaviy poliklinikasi binosi 2022 yilning III-IV –choragida qayta qurish – ta\'mirlash  ishlari belgilanganligi to\'g\'risida tushuntiriladi.', 1, '36', '2022-01-14', 301),
(1254, 0, NULL, NULL, NULL, 'Yuldasheva Muyassar Qodirberganovna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 425, 'Ezgulik ko\'chasi 12-uy', '', NULL, 0, NULL, '“Oilaviy poliklinika va punktlarda tibbiyot oliygox va tibbiyot bilim yurtlarida o\'qiyotgan talabalar uchun o\'quv amaliyot xonalari jixozlari, ya\'ni mulyajlari bilan tashkil qilishni taklifi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-15', '2022-01-27 04:33:55', '2022-01-27 04:38:35', 1, '4346', '2022-01-10', NULL, 20, 'M.Q.Xalbayev', '1643240315.0523.pdf', 'xat', 'O\'zbekiston Respublikasi Prezidentining 2019 yil 7 iyun kungi “O\'zbekiston Respublikasi aholisiga axborot-kutubxona xizmati ko\'rsatishni yanada takomillashtirish to\'g\'risida”gi PQ-4354-sonli Qarori amaliyotga joriy qilinganligi va bu borada tuman Xokimligida 2021 yilda markaziy kutubxona tashkil qilinib, o\'z ish faoliyayatini yuritayotganligini, shu bilan birga tibbiyot muassasalar internet tarmog\'iga ulangan kompyuter texnikalari bilan to\'liq jihozlanganligi, O\'zbekiston Respublikasi Prezidentining 2021 yil 26 martdagi  “Ma\'naviy-ma\'rifiy ishlar tizimini tubdan takomillashtirish chora-tadbirlari to\'g\'risida”gi PQ-5040-sonli qarori asosida tuman tibbiyot birlashmaning ma\'naviy uslubiy o\'quv xonasiga ham 15 turdan ortiq kitib va qo\'llanmalar homiylar ko\'magi aosisda olib keltirildi. O\'z bilimlaringizni mustahkamlashingiz hamda oliy va o\'rta ta\'lim muassasalarining amaliyotchi mutaxassislariga ham ustoz-shogird an-analariga sodiq qolgan xolda o\'qitish va amaliyotda o\'rganitish uchun barcha sharoitlar yaratilganligini bildiramiz.', 1, '38', '2022-01-14', 301),
(1255, 0, NULL, NULL, NULL, 'Tajimov Odilbek', '', NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, 12, 10, 417, 'Na\'muna ko\'chasi 58-uy', '', NULL, 0, NULL, 'PSA apparatini tumanda tashkil qilishning imkoni bormi?', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-15', '2022-01-27 11:20:12', '2022-01-27 11:22:53', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643264573.725.pdf', 'xat', 'tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '37', '2022-01-14', 301),
