(1347, 0, NULL, NULL, NULL, 'Avazmetova Mehribon', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 414, 'Kitobxon ko\'chasi 13 uy', '', NULL, 0, NULL, 'Glyukometr va alkotestr apparatlairi bilan jihozlash to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-15', '2022-02-04 05:57:35', '2022-02-04 06:02:20', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643936540.8594.pdf', 'xat', 'O\'zbekiston Respublikasi Prezidentining PQ-3494-sonli qarori va SSVning 80-sonli buyruqlari asosida Birlashma rahbariyati tomonidan yuqori turuvchi tashkilotlarga zarur tibbiy uskunalar bilan ta\'miblash to\'g\'risida so\'rovnoma berilganligi va shu asosda ta\\minlanishi to\'g\'risida tushuntirilda', 1, '35', '2022-01-14', 301),
(1348, 0, NULL, NULL, NULL, 'Tajimva Marhabo', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 430, 'Mash\'al ko\'chasi', '', NULL, 0, NULL, 'Operatsion bloklarni apparatura bilan ta\'minlash to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-20', '2022-02-04 06:09:11', '2022-02-04 06:10:46', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643937046.3288.pdf', 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '48', '2022-01-17', 301),
(1349, 0, NULL, NULL, NULL, 'Shomuratova Gulbahor Fayzullayevna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 416, 'Mash\'l ko\'chasi 1-uy', '', NULL, 0, NULL, 'Yangibozor tuman tibbiyot birlashmasida sterilizatsiya zaralantirish xamshiralari shtatlarini qaytadan ko\'rib chiqishni taklifi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-20', '2022-02-04 06:16:36', '2022-02-04 06:17:24', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643937444.0614.pdf', 'xat', 'O\'zbekiston Respublikasi Sog’liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog’iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shatat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan oilaviy shifokorlik punktlarida  faoliyat yurituvchi xodimlarning shtatlar jadvali tasdiqlangan. Mazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir oilaviy poliklinika va oilaviy shifokorlik punktlari uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan 2022 yil                    1 yanvardan boshlab, OSHP mudiri, vrach stomatolog va hamshirasi, muolaja hamshirasi shtatlaridan tashqari shtatlar ajratilishi belgilanmaganligi to\'g\'risida tushuntirildi.', 1, '47', '2022-01-17', 301),
