(1353, 0, NULL, NULL, NULL, 'Yorliqobova Shoira Omonbayevna ', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 437, 'tosh ko\'chasi 12 uy', '', NULL, 0, NULL, 'Jarrohlik bo\'limini yangi asbob-uskunalar va yangi turdagi aparaturalar bilan taminlashni so\'raganligi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-26', '2022-02-04 06:53:12', '2022-02-04 06:55:03', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643939703.3518.pdf', 'xat', 'Sizning yuqoridagi murojaatingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  tibbiyot birlashma tarkibidagi jarrohlik bo’limlarini yangi zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach tibbiyot birlashma tarkibidagi jarrohlik bo’limlari yangi tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '57', '2022-01-17', 301),
(1354, 0, NULL, NULL, NULL, 'Ro\'zmetova Malohat', '62-41-92-175', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 416, 'G\'ofur G\'ulom ko\'chasi 34-uy', '', NULL, 0, NULL, 'Yangibozor tuman tibiyot birlashmasi qabulxonaga qarashli laboratoriya xonasini yangi zamonaviy apparaturalar bilan jihozlanishi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-21', '2022-02-04 10:45:03', '2022-02-04 12:49:09', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643960949.3525.pdf', 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '66', '2022-01-19', 301),
(1355, 0, NULL, NULL, NULL, 'Matyakubova Zulxumor', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 434, 'Anhor bo\'yi ko\'chasi ', '', NULL, 0, NULL, '“Tug’ruq kompleksiga UTT apparati bilan jihozlash  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-26', '2022-02-04 12:54:00', '2022-02-04 12:55:41', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643961341.0121.pdf', 'xat', 'Yangibozor tuman tibbiyot birlashmasi Sizning mazkur taklifingizga asosan quyidagilarni ma\'lum qiladi. Tibbiyot birlashma mas\'ullari tomonidan Sizga mazkur taklifingiz yuzasidan 2022 yilning I-II- choragida tibbiyot birlashma binolarida shu jumladan, Tug’ruq kompleksi manzilli davlat dasturi asosida rekonstruktsiya ishlari olib borilishi rejalashtirilgan. \r\nQurilish-ta\'mirlash jarayonida birlashmaga qarashli tug\'ruq kompleksi  binosiga qo\'shimcha 100 shifo o\'rinli bino qurilishi va tug\'ruq kompleksi maqomi “Perinatal  markaz” maqomiga o\'zgartirilib, ishga tushirilishi rejalashtirilgan. Shu bilan birga qurilish – ta\'mirlash ishlari  jarayonida perinatal markazga yangi zamonaviy tibbiy asbob-uskunalar shu jumladan, UTT apparati ham o\'rnatilishi belgilanganligi to\'g\'risida tushuntirildi.\r\n', 1, '41', '2022-01-14', 301),
(1356, 0, NULL, NULL, NULL, 'Yusupjva Sabohat Shermatovna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 440, 'Qibla ko\'chasi', '', NULL, 0, NULL, 'Yangibozor tuman tibbiyot birlashmasi tizimidagi 64-son oilaviy poliklinikani tabiiy gazga ulash to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-26', '2022-02-04 12:59:13', '2022-02-04 13:01:08', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643961668.5251.pdf', 'xat', 'Mazkur xolat yuzasidan tuman tiibbiyot birlashmasi tuman Xokimligiga va xududiy gazta\'minot tashkilotiga bir necha bor Bog\'olon mahallasida joylashgaan 64-son oilaviy poliklinikasini tabbiy gazga ulash yuzasidan takliflar bilan murojaat qilinganligi va O\'zbekiston Respublikasi Prezidentining             2020 yil 24 sentyabr kungi “Tabbiy gaz nazorati va xisobini avtomatlashtirgan tizimini joriy etish to\'g\'risida”gi PQ-4840-sonli qarori va O\'zbekiston Respublikasi Vazirlar Mahkamasining 2018 yil 12 yanvardagi “Tabiiy gazdan foydalanish to\'g\'risida”gi 22-sonli Qaroriga muvofiq 2021-2026 yillarda tabiiy gazdan uzilgan xududlarni qayta gazlashtirish rejalashtirilganligi to\'g\'risida batafsil tushuntirildi.', 1, '70', '2022-01-19', 301),
(1357, 0, NULL, NULL, NULL, 'Yusupova Mehribon Yangibayevna', '62-41-92-158', '1989-01-01', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 437, 'A.Jomiy ko\'chasi 25-uy', '', NULL, 0, NULL, 'Emlash xamshira va ro’yxatxona xodimi  kerakligi to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-28', '2022-02-04 13:07:45', '2022-02-04 13:08:34', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643962114.4804.pdf', 'xat', 'O\'zbekiston Respublikasi Sog\'liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog\'iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan tibbiyot birlashma, ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shtat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan Tez tibbiy yordam bshlimida faoliyat ko’rsatuvchi dispetcherlarning shtatlar jadvali tasdiqlangan. \r\nMazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir Tez tibbiy yordam bo’limi uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan mazkur me\'yoriy xujjatda ko\'rsatilgan va belgilangan shtatlar jadvalidan tashqari shtat ajratish tibbiyot birlashma vakolatiga kirmasligi va mazkur shtatlar ajratish vakolatli tashkilot hamda Sog\'liqni saqlash vazirligi tomonidan ajratilganda ichki buyrug\'i asosida joriy qilinishi to\'g\'risida tushuntirildi.\r\n', 1, '50', '2022-01-17', 301),
(1358, 0, NULL, NULL, NULL, 'Xolmanova Shoira Qadambayevna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 429, 'Kitobxon ko\'chasi', '', NULL, 0, NULL, 'Yangibozor tuman tibiyot birlashmasi Shoshilinch tibbiy yordam bo’limining yangi zamonaviy apparaturalar bilan jihozlanishi  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-04 15:38:41', '2022-02-04 15:40:58', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1643971258.1233.pdf', 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga Shoshilinch tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '65', '2022-01-19', 301),
