(1404, 0, NULL, NULL, NULL, 'Raximova Dildora Jumaniyazovna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 427, 'Az-Zamaxshariy ko\'chasi', '', NULL, 0, NULL, 'Yangibozor tuman tibiyot birlashmasi Bolalar bo’limidagi o’rta tibbiyot va kichik tibbiy xodimlar shtatlarini ko’rib chiqish  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-07 13:01:01', '2022-02-07 13:03:03', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644220983.014.pdf', 'xat', 'O\'zbekiston Respublikasi Sog\'liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog\'iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan tibbiyot birlashma, ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shtat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga tibbiyot va boshqa xodimlarning shtatlar jadvali tasdiqlangan. \r\nMazkur me\'yoriy xujjatda belgilanishi bo\'yicha zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan mazkur me\'yoriy xujjatda ko\'rsatilgan va belgilangan shtatlar jadvalidan tashqari shtat ajratish tibbiyot birlashma vakolatiga kirmasligi va mazkur shtatlar ajratish vakolatli tashkilot hamda Sog\'liqni saqlash vazirligi tomonidan ajratilganda ichki buyrug\'i asosida joriy qilinishi to\'g\'risida tushuntirildi.\r\n', 1, '63', '2022-01-19', 301),
(1405, 0, NULL, NULL, NULL, 'Полвонова Шоира Отаназаровна', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 200, NULL, 'А.Икрамов кўчаси 2-уй', '', NULL, 0, NULL, 'Аукцион орқали ютиб олган ер масаласи', '1644220995.5947.pdf', 69, NULL, 'pdf', 1, 1, 1, 1, 3, 0, '2022-02-22', '2022-02-07 13:03:15', '2022-02-07 13:03:15', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1),
(1407, 0, NULL, NULL, NULL, 'Ibadullayeva Shoxista Farxod qizi', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 418, 'Paxlavon Maxmud ko\'chasi', '', NULL, 0, NULL, 'Yangibozor tuman tibbiyot birlashmasidagi fizioterapiya xonasini zamonaviy apparatlar bilan ta\'minlab berish  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-07 13:06:05', '2022-02-07 13:07:52', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644221272.4976.pdf', 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', 1, '62', '2022-01-19', 301),
(1408, 0, NULL, NULL, NULL, 'Ўразова Наргиза', '+99890-078-48-80', '1983-09-21', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 1, 477, 'Мафтун кўчаси 192-уй', '', NULL, 0, NULL, 'Яшаш жойини газга улаб беришни сўрайди', '1644221215.0468.pdf', 108, NULL, 'pdf', 1, 1, 1, 1, 2, 0, '2022-02-22', '2022-02-07 13:06:55', '2022-02-07 13:06:55', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1),
(1409, 0, NULL, NULL, NULL, 'Alimova Marhabo Ravshanbek qizi', '', '1995-01-01', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 431, 'Tinchlik ko\'chasi 82-uy', '', NULL, 0, NULL, 'Yangibozor tuman tibiyot birlashmasi Rajali jarrohlik bo’limining operatsin blokiga yangi apparaturalar berilishi va jihozlanishi  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-07 13:10:53', '2022-02-07 13:12:57', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', NULL, 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\nShu bilan birga mazkur taklifingizda ko\'rsatilgan tibbiy asbob-uskunalar “Salomatlik-4” loyihasi yoki boshqa grand mablag\'lari xisobidan ta\'minlanishi natijasida Yangibozor tumanida tashkil qilish mumkinligini bildiramiz. \r\n', 1, '60', '2022-01-19', 301),
(1410, 0, NULL, NULL, NULL, 'Quchqarova Gavhar Tursunbayevna', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 439, 'Beklar ko\'chasi 9-uy', '', NULL, 0, NULL, 'Oilaviy poliklinikalardagi avtoklav bikslarini yangilash to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-07 13:29:17', '2022-02-07 13:32:48', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644222768.6969.pdf', 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan birlashmada va tizimdagi BTSYoMlarida yuqumli va yuqumsiz kasalliklarning oldini olsh va profilaktik ko’riklar shu jumladan, jarroxlik amaliyotlari, tibbiy muolajalarning sifatli o’tkazilishi yuzasidan tizimda mavjud tibbiy bikslarni yangilash yuzasidan Viloyat Sog’liqni saqlash boshqarmasiga manzilli yo’l xaritasi ishlab berilganligi, bundan tashqari Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari joriy yilda rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\nShu bilan birga mazkur taklifingizda ko\'rsatilgan tibbiy asbob-uskunalar shu jumladan tibbiy bikslar “Salomatlik-4” loyihasi yoki boshqa grand mablag\'lari xisobidan ta\'minlanishi natijasida Yangibozor tumanida tashkil qilish mumkinligini bildiramiz.\r\n', 1, '67', '2022-01-17', 301),
(1411, 0, NULL, NULL, NULL, 'Ro\'zimova Shaxlo', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 561, 'Kitobxon ko\'chasi', '', NULL, 0, NULL, 'Yangibozor tuman tibbiyot birlashmasi tizimidagi patronaj hamshiralarni plonshet bilan ta’minlash  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-29', '2022-02-07 13:35:41', '2022-02-07 13:38:03', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644223083.9015.pdf', 'xat', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi mas\'ullari tomonidan o\'rganilib, Sizga quyidagilar tushuntiriladi. Ya\'ni, O\'zbekiston Respublikasi Prezidentining          2020 yil 12 noyabrdagi  “Birlamchi tibbiy sanitariya yordami muassasalari faoliyatiga mutloqo yangi mexanizmlarini joriy qilish va sog\'liqni saqlash tizimida olib borilayotgan islohatlar samaradorligini yanada oshirish chora-tadbirlari to\'g\'risida”gi PF-5952-sonli Farmoniga asosan xududlarda tashkil qilingan tibbiy brigadalarni tibbiy asbob-uskunalar shu jumladan, plonshetlar bilan ta\'minlash tuman Xokimliklari zimmasiga yuklatilgan edi. Mazkur xolat yuzasidan tibbiyot birlashma rahbariyati tumandagi 106 nafar patronaj 30 ta tibbiy brigadalarni plonshetlar va tibbiy buyumlar bilan ta\'minlash yuzasidan tuman Xokimligiga maxsus xat orqali murojaat qilganligi, tuman Xkimligidan Byudjet parametrlari to\'g\'risidagi Qonunga muvofiq mahalliy byudjet mablag\'lari xisobidan 2021-2023 yillarda barcha tibbiy brigadar plonshet va tibbiy vositalar bilan ta\'minlanishi to\'g\'risida yozma ma\'lumot berilganligi to\'g\'risida batafsil tushuntirildi.', 1, '71', '2022-01-17', 301),
(1412, 0, NULL, NULL, NULL, 'Ражабов Собуржон Хажиевич', '+99897-458-82', '1966-03-18', NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, 12, 11, 1, 'Махтумқули кўчаси 43-уй', '', NULL, 0, NULL, 'Банкдан қарздор бўлганлиги учун гаровга қўйилган биноси сотувга қўйилганлигидан норози', '1644229948.6645.pdf', 14, NULL, 'pdf', 1, 3, 1, 1, 1, 0, '2022-02-22', '2022-02-07 15:32:28', '2022-02-07 15:32:28', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1),
