(1427, 0, NULL, NULL, NULL, 'Sodiqova Diyora Rashid qizi', '62-41-66-144', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 439, 'Jiydali ko\'chasi', '', NULL, 0, NULL, 'Mahallalarda va oilaviy poliklinikalarda aholini sog’lomlashtirish uchun trinajor zallar tashkil qilish to\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-01-30', '2022-02-08 23:37:36', '2022-02-08 23:39:38', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644345578.8056.pdf', 'xat', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi mas\'ullari tomonidan o\'rganildi va Sizga quyidagilar tushuntirildi. O\'zbekiston Respublikasi Prezidentining PF-6099-sonli Farmoni va 12.11.2020 yildagi PQ-6110-sonli Qarori asosida Viloyat Sog\'liqni saqlash boshqarmasi, Viloyat Xokimligi va Tuman Xokimligi va boshqa hamkor tashkilotlar hamkorligida aholi salomatligini mustahkamlash yuzasidan bir qator islohatlar amalga oshirilib, manzilli yo\'l xaritalar tasdiqlangan va ijroga kiritilgan. Shu bilan birga mazkur Farmon va Qaror ijrosini ta\'minlash yuzasidan mahallalarda “Salomatlik uchun 5000 qadam” shiori ostida sog\'lomlashtirish marafon (kun)lari o\'tkazilib kelinmoqda. Shu bilan birga mahalalalar xududlarida joylashgaan maktablar binolarining va tibbiyot birlashmaning fizioterapiya zallarida maxsus moslamalar (trenajor texnikalar) o\'rnatilganligi, aholi va tibbiyot xodimlari foydalanishi uchun doimiy mazkur muassasalar zallari ochiqligi to\'g\'risida tushuntirildi.', 1, '68', '2022-01-17', 301),
(1428, 0, NULL, NULL, NULL, 'Masharipova Salomat', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 421, 'Muxandislar ko\'chasi', '', NULL, 0, NULL, 'Qish mavsumida patronaj hamshiralarni bir xil forma bilan ta’minlash to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-02-02', '2022-02-08 23:44:13', '2022-02-08 23:46:10', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644345970.5395.pdf', 'xat', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi raaxbariyati tomonidan o\'rganildi va Sizga quyidagilar tushuntirildi.\r\nBugungi kunda O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligi tomonidan joriy qilingan buyruqlar va ishlab chiqilgaan Nizomlarda tibbiyot va farmatsevtika xodimlarini ish formasi bilan ta\'minlaash to\'g\'risida belgilab berilmaganligi, ammo Mehnatni muhofaza qilish to\'g\'risidagi Qonunning tegishli moddalarida mazkur taklifingizda ko\'rsatib o\'tilgan vajlar \r\nya\'ni, tibbiyot va boshqa xodimlarni maxsus kiyim bosh bilan ta\'minlash belgilangan. Ammo mahalliy byutdet tomonidan tibbiyot birlashmaning smeta xarajatlarida tibbiyot va boshqa xodimlarning ish formalari uchun qo\'shimcha mablag\'lar ajratilmaganligi va smeta xarajatlarida nazarda tutilmaganlgi sababli mazkur taklifingizda ko\'rsatilgan xolatlarni bartaraf qilib, ijobiy hal qilishning imkoni yo\'q. Shu bilan birga tibbiyot birlashmaning joriy yil smeta xarajatlarida mahalliy byudjet (tuman Xokimligi va Moliya bo\'limi) tomonidan qo\'shimcha mablag\'lar ajratilsa birlashmaning ichki imkoniyatlari xisobga olingan xolda barcha tibbiyot xodimlari shu jumladan, patronaj hamshiraalar ham qishki va yosh mavsumi uchun to\'liq ish formasi bilan byudjet xisobidan ta\'minlanishi rejalashtirilganligi tushuntirildi.\r\n', 1, '69', '2022-01-19', 301),
(1429, 0, NULL, NULL, NULL, 'Vapayev O\'sarbek', '', NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, 12, 10, 427, 'Nihoya ko\'chasi 2-uy', '', NULL, 0, NULL, 'PQda 13000  aholiga 1  ta tez tibbiy yordam mashina xizmat ko\'rsatadi deb belgilangan. Shuni 10000 aholiga tushirib berish  to\'g\'risida', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-02-01', '2022-02-09 02:12:00', '2022-02-09 02:13:40', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1644354820.2949.pdf', 'xat', 'Sizning mazkur taklifingiz yuzasidan tibbiyot birlashma mutaxassislari quyidagilarni tushuntirishdi. Ya\'ni, O\'zbekiston Respublikasi Prezidentining            2018 yil 25 yanvardagi “Shoshilinch tibbiy yordam tizimini jadal takomillashtirish chora-tadbirlari to\'g\'risida”gi PQ-3494-sonli qarori hamda O\'zbekiston Respublikasi Prezidentining 2018 yil 16 oktyabrdagi “O\'zbekiston Respublikasida tez tibbiy yordam xizmatini takomillashtirish chora-tadbirlari to\'g\'risida”gi              PQ-3973 yuzasidan O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligining              105-sonli buyrug\'i ishlab chiqilganligi va shu asosida hududlar aholisiga Tez tibbiy yordam bo\'limlari tomonidan tibbiy xizmat ko\'rsatish belgilangan. Shu bilan birga tumanning “Bog\'olon” va “Yangiobod” mahallalarida Tez tibbiy yordam shahobchalari tashkil qilinib, faoliyati yo\'lga qo\'yilganligi to\'g\'risida  tushuntirildi.', 1, '51', '2022-01-17', 301),
