(1661, 0, NULL, NULL, NULL, 'Baltayev Arslon Xabullayevich', '(97 )792 30 33', NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, 12, 1, 479, 'Sayqal ko\'chasi 72', '', NULL, 0, NULL, 'Тез тиббий ёрдамда ишлатиладиган   дори воситалари ва   асбоб ускуналар ,замонавий медицинага  мос танланмаган. Ушбу масалани    тез ёрдамда куп йиллик стажга эга, кучли  мутахасис врач ёрдамида кайта куриб чикиш максадга мувофик. Масалан:  суяклардаги синишишларда куйиладиган  шиналар,  буйин шиналари ,иммоблизаторлар иммбилизацион носилкалар, фиксаторлар,  катеторлар,  дорилар: пентанол , аналгетик спрей, инсулин, глюкаметр......ва хаказолар  етишмовчилиги дойим мавжуд', NULL, 135, NULL, NULL, 2, 6, 1, 1, 1, 2, '2022-03-02', '2022-02-18 23:55:15', '2022-02-18 23:57:00', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1645210620.3461.pdf', 'xat', 'O\'rganish natijasida Sizning mazkur taklifingizda ko\'rsatib o\'tilgan xolatlar to\'liq ko\'rib chiqildi natijada haqiqatdan ham bugungi kunda tez tibbiy yordam bo’limida mavjud tibbiy jihozlar va tibbiy asbob-uskunalarning ayrimlari yangilashga va zamonaviy tibbiy asbob-uskunalarga ehtiyoj mavjudligi aniqlandi. Shu bilan birga Sizga bo’limda yetishmaydigan dori-darmonlar RSHTYoIM Xorazm filialidan Sizning bo’lim tomonidan berilgan talabnoma asosida yetkazib berilayotganliga va o’z vaqtida  RSHTYoIM Xorazm filiali tomonidan berilgan ehtiyojga asosan to’iq ta’minlab berilayotganligi to’g’risida tushuntirildi.\r\nSizning yuqoridagi tibbiy uskunalarni yzngilash yuzasidan bergan taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\n', 1, '157', '2022-02-17', 301),
(1662, 0, NULL, NULL, NULL, 'Xolmuratova Muqaddas', '882997478', '1980-09-11', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 431, 'A.Qodiriy ko\'chasi 12-uy', '', NULL, 0, NULL, '1-masala/ SPID kasalligiga chalinganligi sfbabli davolanishda amaliy yordam so\'ragan', '1645211518.4106.docx', 133, NULL, 'docx', 1, 9, 1, 1, 1, 2, '2022-02-17', '2022-02-19 00:11:58', '2022-02-19 00:13:16', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1645211596.3819.pdf', 'xat', 'O\'rganish natijasida Siz tuman ko\'p tarmoqli markaziy poliklinikasi infektsionist shifokori xonasida “B-20” kasalligi bilan dispanser xisobda turishingiz, doimiy shifokor nazoratida Sizga amabulator sharoitda tibbiy xizmat ko\'rsatib kelingan.\r\nShu bilan birga tibbiyot birlashmasida o\'tkazilgan tibbiy ko\'rik natijasida Sizga “Virusli popilloma” tashxisi qo\'yilib, Viloyat ko\'p tarmoqli tibbiyot markazining Septik xirurgiya bo\'limiga statsionar sharoitda davolanish uchun order berilishi ta\'minlanib, mazkur murojaatingiz qanoatlantirildi. \r\n', 1, '139', '2022-02-16', 301),
(1663, 0, NULL, NULL, NULL, 'Ablullayeva Zaynab Zaripbayevna', '991951230', '1990-11-17', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 415, 'Shabnam ko\'chsi 10-uy', '', NULL, 0, NULL, 'Qizingizning mazasi yo\'qligi, tibbiyot birlashmada davolatayotganligingiz, boquvchingiz yo\'qligi va qizingizni davolatish uchun moddiy yordam so\'rab” qilgan murojaati', NULL, 134, NULL, NULL, 1, 6, 1, 1, 1, 0, '2022-03-05', '2022-02-19 00:56:19', '2022-02-19 00:56:19', 1, '133438/22', '2022-02-17', NULL, 6, NULL, NULL, NULL, NULL, 0, NULL, NULL, 301),
(1664, 0, NULL, NULL, NULL, 'Yuldasheva Shoira Murodboy ', '', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 12, 10, 429, 'Sofdil ko\'chasi 17-uy', '', NULL, 0, NULL, 'Mutahassisligi bo\'yicha ishga joylashish yuzasidan ta\'lim muassasam tomonidan berilgan uch tomonlama shartnomani imzolashda amaliy yordam so\'rab” yuzasidan qilgan og\'zaki murojaati', NULL, 135, NULL, NULL, 1, 3, 1, 1, 1, 2, '2022-03-05', '2022-02-19 01:07:24', '2022-02-19 01:09:39', 0, NULL, NULL, NULL, NULL, 'M.Q.Xalbayev', '1645214979.954.pdf', 'xat', 'O\'rganish natijasida Siz Toshkent Tibbiyot Akademiyasi Urganch filialining Pediatriya fakulteti Oliy hamshiralik yo\'nalishi bo\'yicha 3-kursda o\'qiyotganliginigiz va shu yili oliy ta\'lim muassasasini tugatishingiz aniqlandi.\r\n	Sizga hozirda Yangibozor tuman tibbiyot birlashmasida mavjud shatat birligi 450,5 shtatni tashkil qilib, ushbu shtat birligida  jami 565 nafar  xamshira ishlab kelmoqda. Shu sababli hozirgi kunda tuman Tibbiyot birlashmasida hamshiralik (Oliy yoki o\'rta) ishi bo\'yicha bo\'sh ish o\'rni mavjud emasligi sababli vazkur murojaatingiz rad qilindi.\r\n', 1, '146', '2022-02-18', 301),
