(30, 291, 293, NULL, 'Фермер хўжалиги ер майдонларини ўз аризасига ёқи суд орқали туман заҳирасига қайтарилиши белгиланган. Бундан ташқари Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги \r\nПФ-6243 сонли Фармонига асосан вақтинчалик тўхтатиб қўйилганлиги билдирамиз', NULL, '2021-10-29', NULL, '2021-10-29', 700, 0, NULL, '1635511777.9713.pdf', 2, 0, '2021-10-29 17:49:37', '2021-10-29 17:50:08'),
(31, 291, 293, NULL, 'Фермер хўжалиги ер майдонларини ўз аризасига ёқи суд орқали туман заҳирасига қайтарилиши белгиланган. Бундан ташқари Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги \r\nПФ-6243 сонли Фармонига асосан вақтинчалик тўхтатиб қўйилганлиги билдирамиз\r\nФермер хўжалиги ер майдонларини ўз аризасига ёқи суд орқали туман заҳирасига қайтарилиши белгиланган. Бундан ташқари Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги \r\nПФ-6243 сонли Фармонига асосан вақтинчалик тўхтатиб қўйилганлиги билдирамиз\r\nФермер хўжалиги ер майдонларини ўз аризасига ёқи суд орқали туман заҳирасига қайтарилиши белгиланган. Бундан ташқари Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги \r\nПФ-6243 сонли Фармонига асосан вақтинчалик тўхтатиб қўйилганлиги билдирамиз\r\nФермер хўжалиги ер майдонларини ўз аризасига ёқи суд орқали туман заҳирасига қайтарилиши белгиланган. Бундан ташқари Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги \r\nПФ-6243 сонли Фармонига асосан вақтинчалик тўхтатиб қўйилганлиги билдирамиз\r\n', NULL, '2021-10-29', NULL, '2021-10-29', 700, 0, NULL, '1635520383.0664.pdf', 3, 0, '2021-10-29 20:13:03', '2021-10-29 20:15:52'),
