(48, 290, 292, NULL, 'Сизнинг туман ҳокими Х.Матрасуловга Ж-215-сонли йўллаган мурожаатингиз туман ҳокимлигида белгиланган тартибда кўриб чиқилди.\r\nМоддий ёрдам масаласи бўйича Ал-Хоразмий маҳалла фуқаролар йиғини бўйича муҳтож оилаларга бир марта бериладиган моддий ёрдам пулини 2021 йил октябр ойида 700 000 сўм пул маблағи берилганлиги, эндиликда ҳомийлар томонидан моддий ёрдам ажратилиши режалаштирилганда, моддий ёрдам берилишини билдирамиз.\r\nУшбу жавобдан норози бўлсангиз юқори турувчи ташкилотларга мурожаат қилишингиз мумкин.\r\n\r\n', NULL, '2021-11-06', NULL, '2021-11-06', 702, 0, NULL, NULL, 2, 0, '2021-11-06 10:36:17', '2021-11-06 10:54:47'),
(49, 405, 407, NULL, 'Сизнинг туман ҳокими Х.Матрасуловга 2021 йил 5 ноябр куни уй-жой сўраб мурожаатингиз туман Маҳалла ва оилани қўллаб-қувватлаш бўлими мутахассислари томонидан белгиланган тартибда кўриб чиқилди.\r\nМурожаатингиз юзасидан ўрганишларимиз натижасида ўзингизга тегишли бўлган уй-жойингизни укангиз номига ўз ихтиёрингиз билан берганлигингиз, Бўстон маҳалласидаги кўп қаватли уй-жойга акангиз рўйхатга қўйганлиги, ва шу ерда яшаб келаётганингиз, эндиликда шу уйдан ҳам чиқиб кетишингиз тўғрисида огоҳлантириш берганликларини билдириб, туман ҳокимлиги томонидан бепул уй-жой билан таъминлашлари тўғрисида билдирганлигингиз аниқланди.\r\nТуман ҳокимлиги тасарруфида ҳозирда бепул жой йўқлиги, агарда ҳоҳласангиз 2021 йил учун Шомохулум маҳалласида Вазирлар Маҳкамасининг 2018 йил 9 февралдаги 103-сонли уй-жой шароитларини яхшилашга муҳтож, ногирони бўлган ёҳуд сурункали касалликнинг оғир турлари билан оғридиган фуқаролар учун арзон уй-жойлардан бошланғич тўловини амалга ошириб, уй-жойга эга бўлишингиз, агарда бошланғич тўловни амалга ошириш имконингиз бўлмаса Вазирлар Маҳкамасининг    2020 йил 25 мартдаги “Уй-жой сотиб олиш учун фуқароларга субсидия тўлаш тартиби тўғрисида”ги 182-сонли қарорга асосан туман Давлат хизматлари марказига ҳужжатларингизни тақдим қилишингизни билдирамиз. Ҳозирда рўйхатда турган уй-жойингиздан Сизни ихтиёрингизга зид равишда хеч ким чиқара олмаслигини билдирамиз.\r\n	Ушбу жавобдан норози бўлсангиз юқори турувчи ташкилотларга мурожаат қилишингиз мумкин.\r\n \r\n', NULL, '2021-11-08', NULL, '2021-11-08', 702, 0, NULL, '1636375926.681.pdf', 2, 0, '2021-11-08 17:52:06', '2021-11-08 17:59:47'),
(51, 290, 292, NULL, 'Сизнинг туман ҳокими Х.Матрасуловга Ж-215-сонли йўллаган мурожаатингиз туман ҳокимлигида белгиланган тартибда кўриб чиқилди.\r\nМоддий ёрдам масаласи бўйича Ал-Хоразмий маҳалла фуқаролар йиғини бўйича муҳтож оилаларга бир марта бериладиган моддий ёрдам пулини 2021 йил октябр ойида 700 000 сўм пул маблағи берилганлиги, эндиликда ҳомийлар томонидан моддий ёрдам ажратилиши режалаштирилганда, моддий ёрдам берилишини билдирамиз.\r\nУшбу жавобдан норози бўлсангиз юқори турувчи ташкилотларга мурожаат қилишингиз мумкин.\r\n', NULL, '2021-11-08', NULL, '2021-11-08', 702, 0, NULL, '1636376707.0649.pdf', 1, 0, '2021-11-08 18:05:07', '2021-11-08 18:05:07'),
