(56, 404, 406, NULL, 'Сизнинг туман ҳокими Х.Матрасуловга оилавий келишмовчиликларни бартараф қилишга ва ўзингизга тегишли бўлган буюмларингизни қайтариб оилш учун амалий ёрдам сўраб қилган мурожаатингиз туман Маҳалла ва оилани қўллаб-қувватлаш бўлимининг тегишли мутахассислари томонидан ўрганилди. \r\n	Сизга оилангиздаги келишмовчиликлар ва ўзингизга тегишли бўлган буюмларингизни олишда амалий ёрдам сўраб қилган мурожаатингизга асосан, судга ариза билан мурожаат қилишингиз, суд қарорига мувофиқ ўзингизга тегишли буюмларингизни қайтариб олишингиз мумкинлигини билдирамиз.\r\n	Ушбу жавобдан норози бўлсангиз юқори турувчи ташкилотларга мурожаат қилишингиз мумкин.\r\n', NULL, '2021-11-16', NULL, '2021-11-16', 702, 0, NULL, '1637067564.3745.pdf', 1, 0, '2021-11-16 17:59:24', '2021-11-16 17:59:24'),
