(735, 9, 1337, '25.09.2021 yildagi А-717-sonli xatiga', 'Urganch shahar hokimining 2021 yil 5 apreldagi 444q-sonli qaror bekor\r\nqilinganligidan norozi bo‘lib, qaromi haqiqiy emas deb topish haqida viloyat\r\nma’muriy sudiga“Zarina Xamrobek Servi^’MChJ 11.05.2021 yilda Urganch shahar\r\nhokimining 2021 yil 5 apreldagi 444q-sonli qarori haqiqiy emas deb topish\r\nttfgrisidagi arizasiga asosan 3-294-21-sonli apellyatsiya ishi koVib chiqilib, shahar\r\nhokimining 2021 yil 5 apreldagi 444q-sonli qarori haqiqiy emas deb topilgan va\r\nbugungi kunda Urganch shahar hokimining 22.11.2018 yildagi\r\n2919q-sonli qarori o‘zkuchida qolgan.\r\nUshbu 3-294-21-sonli apellyatsiya ishi koYib chiqilgan qarordan norozi\r\nbo\'lsangiz sud organiga murojaat qilishingiz maqsadga muvofiqligi tushuntiriladi.', '№10 4 4', '2021-09-30', NULL, '2022-02-02', 346, 1, 'Ш.Аметов', '1643800565.8972.pdf', 2, 2, '2022-02-02 16:16:05', '2022-04-05 17:24:13'),
(736, 12, 1339, '25.09.2021 vildagi С-1710-sonli xatiga', '0 ‘zbekiston Respublikasi Vazirlar mahkamasining\r\n27.08.2021 yil 543-sonli “Yer uchastkalarini davlat va jamoat ehtiyojlari uchun\r\ndoimiy foydalanishga ajratishning ma’muriy reglamentini tasdiqlash to‘g‘risida”gi\r\nqarori hamda 0 ‘zbekiston Respublikasi Shaharsozlik Kodeksining 22-moddasida\r\ntumanlar (shaharlar) ijro etuvchi hokimiyat organlarining shaharsozlik faoliyati\r\nsohasidagi vakolatlari belgilangan bo’lib, tumanlar (shaharlar) ijro etuvchi\r\nhokimiyat organ lari o‘z vakolatlari doirasida tumanlar (shaharlar) hududlarining\r\nijtimoiy-iqtisodiy rivojlanish ko‘rsatkichlari va istiqboldagi urbanizatsiya\r\njarayonlari asosida aholini oqilona joylashtirish, muhandislik, transportga oid va\r\nijtimoiy infratuzilmalarni rivojlantirish masalalarini hal qilishi belgilanganligini\r\ninobatga olib Urganch tumani hokimligi huzurida doimiy ishlovchi komissiya\r\ntomonidan ko‘rib chiqish uchun Urganch tumani hokimligiga 1263-sonli xat\r\nberilganligini bildiramiz.', '1075', '2021-10-14', NULL, '2022-02-02', 346, 1, 'Ш.Аметов', '1643800781.228.pdf', 2, 2, '2022-02-02 16:19:41', '2022-04-05 17:24:13'),
(750, 1358, 1376, 'xat', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga Shoshilinch tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '65', '2022-01-19', NULL, '2022-02-04', 390, 1, 'M.Q.Xalbayev', '1643971294.8068.pdf', 2, 2, '2022-02-04 15:41:34', '2022-02-04 15:41:34'),
(758, 1266, 1308, 'Собиров Жасурнинг мурожаати юзасидан тўпланган хужжатлар Ф-2-292', 'Фуқаро Ж.Собировнинг мурожаати юзасидан терговга қадар текширув ишлари олиб борилиб, Ўзбекистон Республикаси ЖПКнинг 83-моддаси 2-банди билан жиноят иши қўзғатишни рад қилиш тўғрисида қарор қабул қилинганлиги тушунтирилди', '603', '2022-02-08', NULL, '2022-02-08', 720, 1, 'туман ИИБ ХПБ ПИ С.Машарипов', '1644306306.4555.pdf', 2, 2, '2022-02-08 12:45:06', '2022-04-05 17:24:13'),
(762, 1276, 1341, 'фуқаро Худаёров Холмуроднинг мурожаати юзасидан', 'Урганиш жараёнида аникланишича, Кушкупир тумани, Хонобод кишлоги, Дурдона\r\nмахалласи, Тоза сув кучаси 13-уйда яшовчи фукаро Худаяров Холмуродга Узбекистон\r\nРеспубликаси Президентининг 20.04.2018 йилдаги “Тадбиркорлик ва шахарсозлик\r\nфаолиятини амалга ошириш учун ер участкаларини доимий фойдаланишга бериш\r\nтартибини тубдан такомиллаштириш чора-тадбирлари тугрисида”ги ПК-3677-сонли\r\nКарори хамда Узбекистон Республикаси Вазирлар Махкамасининг\r\n2019 йил 20 декабрдаги “Тадбиркорлик ва шахарсозлик фаолиятини амалга ошириш учун\r\nер участкаларини электрон онлайн-аукцион оркали бериш тартиби тугрисида”ги 1023-\r\nсонли карорига асосан тадбиркорлик фаолияти билан шугулланиш максадида ер\r\nучасткаларини “E-IJRO AUKSION” ягона электрон савдо майдончасида электрон онлайн\r\nаукционда катнашиб олишлиги тугрисида бир неча бор тушунтирилган.', '83', '2022-02-03', NULL, '2022-02-09', 346, 0, 'Д.Бекчанов', '1644404575.1396.pdf', 2, 2, '2022-02-09 16:02:55', '2022-04-05 17:24:13'),
(763, 1257, 1340, 'фуқаро Сафаев Файзуллонинг мурожаати юзасидан', 'Вилоят курилиш бош бошкармаси юкорида курсатиб утилган урганишлар\r\nнатижасида аникланган конун бузилиш холатларни белгиланган тартибда бартараф\r\nкилиш максадида Хива тумани хокими томонидан кабул килинган 11.05.2018\r\nйилдаги 1187-сонли ва 11.06.2019 йилдаги 6400-сонли карорларни туман\r\nхокимлиги кошида ташкил килинган ер участкаларини бериш ва реализация килиш\r\nкомиссияси иштирокида кайта куриб чикилишини сураб Хива туман хокими\r\nномига 14.07.2021 йилда 905-сонли “Такдимнома” киритганлигини билдиради', '90', '2022-02-07', NULL, '2022-02-09', 346, 0, 'Х.Рўзимов', '1644405065.8549.pdf', 2, 2, '2022-02-09 16:11:05', '2022-04-05 17:24:13'),
(764, 1290, 1344, 'фуқаро У.ЖУманиёзовнинг мурожаати юзасидан', 'Юкоридагилардан келиб чикиб, Сиз Урганч тумани хокимининг 30.09.2019\r\nйилдаги 6043к-сонли кароридан норози булган такдирда Узбекистан Республикаси\r\n“Ер кодекси”нинг 89-моддаси тартибида ер хусусидаги низоларни суд томонидан\r\nконун хужжатларида белгиланган тартибда хал этиш максадга мувофиклигини\r\nмаълум киламиз.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум киламиз, ушбу\r\nжавобдан норози булган такдирда юкори турувчи органларга мурожаат\r\nкилишингиз мумкинлигини билдирамиз.', '103', '2022-02-09', NULL, '2022-02-09', 346, 0, 'Қ.Аллаберганов', '1644405796.4717.pdf', 2, 2, '2022-02-09 16:23:16', '2022-04-05 17:24:13'),
(765, 1291, 1345, 'фуқаро А.Аллабергановнинг мурожаати юзасидан', 'Мазкур масала вилоят кадастр агентлиги ходимлари билан жойида\r\nурганилди ва фукаро А.Аллабергановга “Нонвойхона” курилмасини кшнлок;\r\nхужалигида фойдаланилмайдиган ер майдонига кучирилиши максадга\r\nмувофиклиги тушунтирилди хамда ер майдони курсатиб берилгунга кадар\r\nфойдаланиши мумкинлиги билдирилиб холат юзасидан далолатнома тузилди\r\nва мурожаатгуйнинг ёзма тушунчаси олинди.\r\nУшбуларни Сизга маълумот тарикасида билдирамиз.', '92', '2022-02-07', NULL, '2022-02-09', 346, 1, 'Х.Рўзимов', '1644406134.5453.pdf', 2, 2, '2022-02-09 16:28:54', '2022-04-05 17:24:13'),
(766, 1285, 1310, '', 'Фуқаронинг мурожаати юзасидан текширув ишлари олиб борилиб, хозирги кунда норози бўлган ходимлари Янгибозор туман ИИБда ишламаётганлиги сабабли, Хоразм вилоят ИИБга мурожат қилиши тўғрисида фуқаро Х.Бабаниёзовга тушунтирилиб, жавоб хати юборилди.', '402', '2022-02-12', NULL, '2022-02-12', 729, 1, 'Янгибозор тумани ИИБ КГ катта инспектори З.Юсупов', '1644662780.2201.pdf', 2, 2, '2022-02-12 15:46:20', '2022-04-05 17:24:13'),
