(818, 1562, 1764, 'Javob xati va unga ilova qilingan xujjatlar.', 'O‘zb.Res.VM-666-sonli qaroriga asosan qo‘llanilgan ta’sirchan soliq mexanizmi bo‘yicha hisoblangan mol-mulk va yer soliqlari shaxsiy kartochkangizdan chiqarildi va noturar ob’ektning 2022 yil 22 fevral holatiga mol-mulk va yer soliqlaridan qarzdorlik mavjud emasligini bildiramiz', '19/10-06602 - son', '2022-02-22', NULL, '2022-02-24', 746, 1, 'Ijrochi: S.Xo\'jayev', '1645681893.1627.zip', 2, 2, '2022-02-24 10:51:33', '2022-04-05 17:24:13'),
(819, 1475, 1666, 'хат ', 'Аризагўй Раманова Санобарнинг \"Кўча йўлини таъмирлаш\" тўғрисида қилган мурожаатига асосан Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганиш ишлари олиб борилди. Ўрганишда, маҳаллий аҳамиятига эга 4Н 1937 \"Урганч-Гурлан-Юқоридўрман-Урганч-Чолиш\" автомобил йўли таъмирталаб ҳолатда эканлиги аниқланди. Ушбу автомобиль йўлида, пудратчи корхона Урганч туман йўллардан фойдаланиш унитар корхонаси  томонидан 2022 йилнинг 2-ярим йиллигида таъмирлаш ишлари амалга ошириш режалаштирилганлиги тўғрисида аризагўй Раманова Санобарга тушунтирилди.   ', '11/182', '2022-02-23', NULL, '2022-02-24', 305, 1, 'У.Суванов ', '1645701231.1028.pdf', 2, 2, '2022-02-24 16:13:51', '2022-04-05 17:24:13'),
(820, 1444, 1620, 'Сухбат баёни', 'Мурожаат килувчи Г.Муродовага Мухтарам Президентимизнинг ПК 3863 сонли карорига асосан имтиёзли равишда намунали жой кредит ажратиб берилганлиги хамда банк ва мижоз уртасидаги муносабатлар шартномалар асосида амалга оширилиши тушунтирилди', '1', '2022-02-22', NULL, '2022-02-24', 535, 1, 'Узмиллийбанк АЖ Янгиарик филиали', '1645701430.8618.pdf', 2, 2, '2022-02-24 16:17:10', '2022-04-05 17:24:13'),
(821, 1557, 1669, 'Сухбат баёни', 'Мурожаат килувчи Ю.Джумабоева бугунги кунда доимий иш ва даромадга эга эмаслиги ва турар жойни куришда ёрдам масаласи буйича мурожаат килувчига банк томонидан 11.03.2021й даги ПФ 6186 карор хамда ушбу карор талаблари жумладан доимий даромадга эга булиши ва кредитни уз муддатида сундириб бориши лозимлиги тушунтирилди', '2', '2022-02-23', NULL, '2022-02-24', 535, 1, 'Узмиллийбанк АЖ Шовот филиали', '1645702009.9205.pdf', 2, 2, '2022-02-24 16:26:49', '2022-04-05 17:24:13'),
(822, 1546, 1667, 'хат ', 'Аризагўй фуқаро Саидова Жумагулнинг \"кўча йўлини таъмирлаш ва тунги ёритгичлар ўрнатишда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганишда, мурожаатда кўрсатилган  йўл  Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармасига қарашли ички хўжалик йўли эканлиги аниқланди. Ушбу мурожаатда келтирилган \"Янгиобод\" маҳалласидаги ички хўжалик йўллари  Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантирилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч туман ҳокимлиги, туман Ободонлаштириш бошқармаси ва \"Янгиобод\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Саидова Жумагулга тушунтирилди.      	', '11/185', '2022-02-23', NULL, '2022-02-24', 305, 1, 'У.Суванов ', '1645702350.9474.pdf', 2, 2, '2022-02-24 16:32:30', '2022-04-05 17:24:13'),
(823, 1549, 1668, 'хат ', 'Аризагўй Жуманова Дилафрузнинг \"маҳалласидаги йўлларни таъмирлаб беришда амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганиш ишлари олиб борилди.  Ушбу мурожаатда келтирилган Х.Олимжон маҳалласи ички хўжалик йўли туман ҳокимлиги балансида бўлиб,  уларни таъмирлаш учун ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантирилади. Агарда, Урганч тумани Ҳокими томонидан Х.Олимжон маҳалласи \"Манзилли дастурга\" киритиш бўйича таклиф берилиб, молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, белгиланган пудратчилар томонидан 2022-2023 йилларда босқичма-босқич таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Жуманова Дилафрузга тушунтирилди.       ', '11/191', '2022-02-23', NULL, '2022-02-24', 305, 1, 'У.Суванов ', '1645703126.5295.pdf', 2, 2, '2022-02-24 16:45:26', '2022-04-05 17:24:13'),
