(846, 1757, 1865, 'фуқаро Адамбоев Улуғбекнинг мурожаати юзасидан', 'Вилоят курилиш бош бошкармаси томонидан Урганч шахар, Жамбул махалласи,\r\nМустакиллик кучаси 3-йулак, 85-уйда яшовчи фукаро Адамбаев Улугбекнинг Куча\r\nкисмини асфаът килиш, нотурар курилишига тускинлик килаётган бекатни йикитишни\r\nсураган.\r\nФукаро Адамбаев Улугбекнинг мурожаатида курсатиб утилган холатларни\r\nУзбекистон Республикасининг “Жисмоний ва юридик шахсларнинг мурожаатлари\r\nтугрисида”ги Конунининг 25-моддасига биноан тегишлилиги буйича ваколат доирасида\r\nкуриб чикиб, муаллифга жавоб бериш учун юбормокда.', '168', '2022-03-01', NULL, '2022-03-02', 346, 1, 'Д.Бекчанов', '1646199500.5825.pdf', 2, 2, '2022-03-02 10:38:20', '2022-04-05 17:24:13'),
