(855, 1757, 2111, NULL, '           Урганч шахар Жамбул маҳалласи Мустақиллик кўчаси 3пр 85д-уй  яшовчи Адамбаев Улуғбек 2022 йил 28 феврал   куни Хоразм вилояти хокимининг Сайёр қабулида қилган  мурожаати  Урганч йўллардан мунтазам фойдаланиш унитар корхонаси ходимлари томонидан   масала ўрганиб чиқилди.        \r\n          Ўрганиш жараёнида  мурожаатда кўрсатилган  Урганч шахар Жамбул маҳалласи Мустақиллик кўчаси  3-йўлак  худуди шаҳар аҳоли пункти кўчалари тоифасига кириши,  мазкур худуддан ўтган ички хўжалик йўлининг узунлиги 600 метр эканлиги, йўлнинг  асфальт қопламаси йўқолиб кетиб, таъмир талаб аҳволга   келиб қолганлигиги, бу эса ўз навбатида шу худудда яшовчи аҳолининг қириб чиқишида қийинчиликларни келтириб чиқараётганлиги аниқланди ва   1 масала юзасидан    Ўзбекистон Республикасининг 2007 йил 2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунининг 7,10,13 моддадаларида  шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб қуйилганлиги, йўлларни таъмирлаш ишлари босқичма босқич  давлат дастурларига киритилиб  амалга оширилаётганлиги, ички хўжалик йўлини таъмирлаш масаласи Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармаси томонидан ҳал қилиниши тўғрисида, 2 масаладаги  нотурар қурилиши билан боғлиқ қўшнилар орасидаги тушунмовчиликларни ўрганиш корхона ваколатига кирмаслиги, ушбу масала тегишли ташкилотлар ўрганилиши тўғрисида фуқарога тушунтиришлар берилди.\r\n            Шунингдек 3 масалада кўрсатиб ўтилган   худуд 4Р161 “Урганч ш.-Чолиш п-Беруний шаҳри” автомобил йўли билан боғлиқ эканлиги сабабли,    ушбу масалага дахлдор бўлган яьни йўлда таъмирлаш ишларини олиб бораётган Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси ходими жалб қилинди ва бекат жойини  ўзгартириш масаласи буюртмачи ташкилот  томонидан кўриб чиқилиши,  фуқаронинг муаммосини ҳал қилиш мақсадида Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси томонидан буюртмачи ташкилотга мурожаат қилиниши ва унинг натижалари бўйича  қўшимча маълумот берилиши тўғрисида фуқарога тушунтиришлар берилди.  \r\n', NULL, '2022-03-10', NULL, '2022-03-10', 315, 0, NULL, '1646904015.8977.pdf', 2, 0, '2022-03-10 14:20:15', '2022-04-05 17:24:13'),
(856, 1926, 2057, 'фуваро Дустжанова Фароғатнинг мурожаати юзасидан', 'Урганиш жараёнида, куйидагилар анщланди, Урганч шахар, Олимпия махалласи,\r\nФаязов кучаси 29/16-уйнинг ён томонида тегишли ташкилотларнинг рухсатини олмасдан\r\nфукаро Садуллаев Мухаммад томонидан узбошимчалик билан 30,0 кв.метр ер маыдонки\r\nэгаллаб олиб енгил конструкцияли акфадан дукон урнатиб куйилганлиги аникланди.\r\nУшбу аникланган холат буйича, Узбекистон Республикаси Президентининг 2021\r\nйил 8 юндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга булган\r\nхукукларни ишончли химоя килиш ва уларни бозор активига анлантнрнш чора\r\nтадбирлари тугрисида”ги ПФ-6243-сонли фармоннинг 10-банди 2-хатбошисига асосан\r\nДавлат солик кумитаси хузуридаги Кадастр агентлиги органларига ер участкаларидан\r\nмаксадсиз фойдаланиш холатлари аникланганда Узбекистон Республикаси Ер\r\nкодексининг 36-моддасига мувофик ушбу ер участкаларига булган хукукини бекор\r\nкилиш, узбошимчалик билан эгаллаиган ер майдонида ноконуний курилган иморатларнн\r\nбартараф этиш юзасидан тугрида-т^гри судга мурожаат килиш хукуки берилганлигнни\r\nмаълум киламиз.\r\nШулардан келиб чикиб, Давлат солик кумигаси хузуридаги Кадастр агентлиги\r\nУрганч шахар булими томонидан 2022 йил 4 мартда Фукаролик ишлари буйича Урганч\r\nтуманлараро судига 78-сонли даъво аризаси киртилганлигини маълум киламиз.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум киламиз, жавобдаи иорози\r\nбулган такдирида юкори турувчи органга мурожаат килишингиз мумкннлигини билдирамиз.', '196', '2022-03-10', NULL, '2022-03-10', 346, 1, 'Д.Бекчанов', '1646909068.7416.pdf', 2, 2, '2022-03-10 15:44:28', '2022-04-05 17:24:13'),
(857, 1950, 2060, 'фуқаро Аллаберганов Адамнинг мурожаати юзасидан', 'Фукаро А.Лллаберганов уз мурожаатида, Хива тумани хокими\r\nфармоиишига асосан Хива тумани, “Гандимён” махалласи худудидан\r\nвактипча фойдаланиш учун ажратилган ер майдонида курилган енгил типдаги\r\nНонвоихона” биносига табий газ уланишида ва кадастр хужжати\r\nрасмийлаштирилишида амалий ёрдам сураган.\r\nХолат юзасидан урганиш жараёнида фукаро А.Аллабергановга, Хива\r\nтумани хокимининг 16.03.2019 йилдаги 58ф-сонли фармойншига асосан енгнл\r\nтипдаги ‘Нонвойхона” курилмаси жойлаштириб вактинча фойдаланнш учун\r\n40 кв метр ер майдони ажратилганлиги ва хозирги кунда “Нонвоихона”\r\nбиносини куриб битказганлиги аникланди.\r\nЭндиликда мазкур “Нонвойхона” курилмасида тадбиркорлик фаолняти\r\nюритиши мумкинлиги ва табий газга уланиш учун хужжатлари билан туман\r\nгаз идорасига мурожаат килиши хамда кадастр хужжатлари расмнйлаштириш\r\nучун туман кадастр булимига мурожаат кнлишн мурожаатфЧга\r\nтушунтирилди.\r\nУшбуларни фукаро А.Аллабергановнинг мурожаатига жавоб тарикасида\r\nмаълум киламиз, агарда жавобдан норози б^лган такдирида юкори турувчи\r\nорганга мурожаат килиши мумкинлигиии билдирамиз.', '200', '2022-03-10', NULL, '2022-03-10', 346, 1, 'Х.Рўзимов', '1646916040.1089.pdf', 2, 2, '2022-03-10 17:40:40', '2022-04-05 17:24:13'),
(858, 1871, 2056, 'фуқаро Қучқаров Хушнуднинг мурожаати юзасидан', 'Фукаро ХДучкаров ушбу мурожаатлари оркали тадбиркорлик фаолияти билан\r\nшугулланиши учун вактинча фойдаланишга енгил типдаги савдо шахобчаси (Контейнер)\r\nурнатишга ер майдони ажратилишини сураган.\r\nХозирги кунда Узбекистон Республикаси Президентининг “Кучма савдо\r\nфаолиятига замонавий ахборот технологияларни янада кенг жорий этиш хамда савдо\r\nавтомати чакана савдо фаолиятини тартибга солиш чора тадбирлари тугрисида” 04.06.2021-\r\nйилдаги ПК-513 6-сон карори билан 2021-йил 1-декабрдан бошлаб Кучма савдо фаолияти\r\n(Контейнер) тадбиркорлик субъектлари томонидан кучма савдо объектларини электрон\r\nтарзда “K-SAVDO” ААТ автоматлаштирилган ахборот тизимида руйхатдан утказиш йули\r\nбилан амалга ошириш хамда (Контейнер) жойи жойлаштириш схемалари буйича “К-\r\nSAVDO” ААТ оркали электрон аукционда сотиб олиш тартиби белгиланганлигини маълум\r\nкиламиз.\r\nМазкур масала юзасидан фукаро Х.Кучкаровга “K-SAVDO” ААТ\r\nавтоматлаштирилган ахборот тизимини электрон онлайн-аукционга ер майдони куйиш\r\nтартиблари тугрисида белгиланган тартибда мутахассислар томонидан тушунтиришлар\r\nолиб борилди.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум киламиз, агарда жавобдан\r\nнорози б^лган такдирида юкори турувчи органларга мурожаат килиши мумкинлигини\r\nбилдирамиз.', '199', '2022-03-10', NULL, '2022-03-11', 346, 1, 'Х.Рўзимов', '1646973374.1095.pdf', 2, 2, '2022-03-11 09:36:14', '2022-04-05 17:24:13'),
(859, 1755, 1869, 'Атаев Хусиннинг мурожаати юзасидан тўпланган хужжатлар Ф-2-660', 'Фуқаро Х.Атаевнинг мурожаати юзасидан терговга қадар текширув ишлари олиб борилиб, жиноят иши қўзғатишни рад қилиш тўғрисида қарор қабул қилинганлиги тушунтирилди', '1258', '2022-03-09', NULL, '2022-03-11', 720, 1, 'туман ИИБ ХПБ ПИ Р.Исмоилов', '1646977163.4135.pdf', 2, 2, '2022-03-11 10:39:23', '2022-04-05 17:24:13'),
(860, 1757, 1885, 'хат ', 'Аризагўй Адамбаев Улуғбекнинг  \"кўчани асфальт қилиш, бекатни йиқитиш масаласида амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Жамбул\" маҳалласи 3-йўлак кўчаси Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармасига қарашли ички хўжалик йўллари эканлиги аниқланди.    Шунга кўра, Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармаси ва маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда  лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин  таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Адамбаев Улуғбекга тушунтирилди.    ', '10/261', '2022-03-10', NULL, '2022-03-11', 305, 1, 'Ж.Солаев', '1646977466.0386.pdf', 2, 2, '2022-03-11 10:44:26', '2022-04-05 17:24:13'),
(861, 1756, 1870, 'Бабаджанов Атабекнинг мурожаати юзасидан тўпланган хужжатлар Ф-2-660', 'Фуқаро А.Бабаджановнинг мурожаати юзасидан терговга қадар текширув ишлари олиб борилиб, жиноят иши қўзғатишни рад қилиш тўғрисида қарор қабул қилинганлиги тушунтирилди', '1239', '2022-03-09', NULL, '2022-03-11', 720, 1, 'туман ИИБ ХПБ ПИ Х.Йўлдошев', NULL, 2, 2, '2022-03-11 10:45:24', '2022-04-05 17:24:13'),
(862, 1868, 2156, 'Суҳбат баёни', 'Уй-жой таъмирлаш учун ипотека кредити зарурми деб сўралганда, кредит маблағи зарур эмаслигини, зарурият туғилса мурожаат қилишини  ва Ипотека-банк Хоразм вилоят филиалига хеч кандай эътирози йўқлигини маълум қилди.', 'рақамсиз', '2022-03-09', NULL, '2022-03-11', 542, 1, 'Х.Машарипов', '1646977627.182.pdf', 2, 2, '2022-03-11 10:47:07', '2022-04-05 17:24:13'),
(863, 1947, 2052, 'хат ', 'Аризагўй Машарипов Азимбойнинг \"яшаш манзилидаги ички йўлни таъмирлашда амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Боғот туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди.  Ўрганиш жараёнида, мурожаатда кўрсатилган \"Қулонқорабоғ\" маҳалласидаги ички йўллар Боғот тумани ҳокимлиги ва туман Ободонлаштириш бошқармасига қарашли бўлиб, 2019 йилда \"Обод қишлоқ\" дастури доирасида ички хўжалик йўлларига ШПС (қум-шағал аралашмаси)дан қоплама қуриш ишлари бажарилганлиги аниқланди. Шунга кўра, Боғот туман ҳокимлиги ва туман Ободонлаштириш бошқармаси ва \"Қулонқорабоғ\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларига асфалтобетон ётқизиш ишлари, молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Машарипов Азимбойга тушунтирилди.            ', '10/262', '2022-03-10', NULL, '2022-03-11', 305, 1, 'Б.Аллаберганов ', '1646979640.7119.pdf', 2, 2, '2022-03-11 11:20:40', '2022-04-05 17:24:13'),
(864, 1938, 2059, 'фуқаро Рахимов Шухратнинг мурожаати юзасидан', 'Urganch shahar hokimining 29.03.2016 yil 606q-sonli qaroriга\r\nasosan fuqaro S.Masharipovaga qarashli Urganch shahar A.Bahodirxon ko\'chali\r\n11/lA-uyda joylashgan umumiy yer maydoni 189,83 kv.metr shundan qurilish osti\r\nmaydoni 174,57 kv.metr bo\'lgan 1-qavatli savdo va maishiy xizmat ko\'rsatish\r\nshahobchasi 2-qavati ofis binosiga egalik huquqini tan olish, yer maydoniga doimiv\r\nfoydalanish huquqi berish hamda davlat yer daftariga kiritilgan.\r\nShuningdek, 0 ‘zbeldston Respublikasi Vazirlar Mahkamasining 2018 vil\r\n18 maydagi 370-sonli qarorning 2-ilovasining obyektni qayta ixtisoslashtirish va\r\nrekonstruksiya qilish uchun ruxsatnoma berish bo\'yicha davlat xizmatlarini\r\nko‘rsatishning ma’muriy reglamentiga asosan Urganch shahar qurilish boiimi tomonidan\r\n14.05.2019 yil №03/1201-sonli ruxsatnoma berilganligi, ushbu ruxsatnomaga asosan\r\nkadastr yig‘ma jildi shakllantirilgan.\r\nYuqoridagilardan kelib chiqib, viloyat qurilish bosh boshqarmasi ushbu ob\'ektning\r\nkadastr hujjatlarida chegara hududlari o\'rganishda murojaatda keltirilgan hududda\r\nemasligini bildiramiz.\r\nUshbularni murojaatingizga javob tariqasida ma’lum qilib, agardajavobdan norozi\r\nbo‘lgan taqdiringizda yuqori turuvchi organga^-juurojaat qilishingiz mumkinligini\r\nbildiramiz.', '205', '2022-03-10', NULL, '2022-03-11', 346, 1, 'Д.Бекчанов', '1646981147.0378.pdf', 2, 2, '2022-03-11 11:45:47', '2022-04-05 17:24:13'),
