(877, 1457, 2154, 'Суҳбат баёни', 'Фукарога балиқчилик фаолиятини амалга ошириш учун давлат рўйхатидан ўтиши, ҳисоб ракам очиши, кўл хавзаси мавжуд бўлиши, субсидия олиш масаласида Балиқсаноат уюшмасига мурожаат қилиши тушунтирилди.  ', 'рақамсиз', '2022-03-02', NULL, '2022-03-11', 542, 1, 'М.Вапаева  М.Аллаберганов', '1646998864.5601.pdf', 2, 2, '2022-03-11 16:41:04', '2022-04-05 17:24:13'),
(878, 1912, 2061, 'Қарздорлик', '“Diyorbek qovunchi” fermer xо‘jaligi foydalanilgan elektr energiyasi uchun 01.03.2022 yil holatiga 41,483,717.81 sо‘m qarzdorlik yuzaga kelganligi va shu qarzdorlikni о‘z vaqtida tо‘lamaganligi sababli elektr ta’minotidan ajratilgan. Ushbu qarzdorlikni sо‘ndirib, elektr energiyasidan foydalanish uchun oldindan tо‘lovlarni amalga oshirsa qayta elektr ta’minotiga ulab berilishi tushuntirildi.', '№694', '2022-03-10', NULL, '2022-03-11', 291, 1, 'О.Атажанов', '1646999890.0345.pdf', 2, 2, '2022-03-11 16:58:10', '2022-04-05 17:24:13'),
