(904, 1864, 2132, 'Сухбат баёни ва хат', 'Мурочаат қилувчи Гулчехра Муродовага кредит тўловларини камайтириш имконияти мавжуд эмаслиги хамда Ўзбекистон Республикаси Вазирлар Маҳкамасининг 2021 йил 24 июлдаги 459-сон “Ижтимоий ҳимояга муҳтож аҳолининг уй-жой шароитларини яхшилаш бўйича қўшимча чора-тадбирлар тўғрисида”ги қарорига асосан ипотека кредитининг муддати ўтган қарздорлигини сўндириш “Ижтимоий ҳимояга муҳтож аҳолининг ипотека кредитлари бўйича қарздорлигини сўндириш” жамғармаси маблағлари хисобидан Халқ депутатлари Янгиариқ тумани кенгаши қошидаги “Халқпарвар” комиссияси томонидан белгиланган тартибда кўриб чиқилиши тушунтирилди', '01-1151/06', '2022-03-16', NULL, '2022-03-16', 535, 1, 'Алламов Ўктам', '1647417240.9926.pdf', 2, 2, '2022-03-16 12:54:01', '2022-04-05 17:24:13'),
