(909, 2015, 2263, '', 'Марказий банк Хоразм вилояти Бош бошқармаси Сизнинг 2022 йил \r\n14 мартда Хоразм вилояти ҳокимлигининг сайёр қабулида қилган мурожаатингизда келтирилган масалалар билан танишиб чиқиб, қуйидагиларни маълум қилади.\r\nМурожаатингизда, якка тартибдаги тадбиркор cифатида рўйхатдан ўтиб, \r\nўз ҳисобрақамингизни “Агробанк” АТБ Ҳазорасп филиалида очган ҳолда тумандаги 9-сонли мактаб стадионида кредит ҳисобидан сунъий қопламали футбол майдончасини қурганлигингиз, лекин шартнома бўйича банк филиали томонидан кредитнинг бир қисми ажратилмаганлиги ва бугунги кунда кредит таъминоти учун гаровга қўйилган мулклар сотувга чиқарганлигидан норози бўлиб, гаров мулкларини сотув жараёнларини вақтинча тўҳтатиб турилишида амалий ёрдам сўрагансиз.\r\nЎзбекистон Республикасининг “Банклар ва банк фаолияти тўғрисида”ги Қонунининг 8-моддасига кўра, банклар молиявий операцияларини амалга ошириш билан боғлиқ қарорлар қабул қилишда мустақилдир. Давлат органлари ва уларнинг мансабдор шахсларига банклар фаолиятига, шу жумладан банкларнинг кредит портфелини ва активларини шакллантириш билан боғлиқ тадбиркорлик таваккалчиликларини бошқаришга аралашиши тақиқлаб қўйилган. 61-моддасида асосан банклар ва уларнинг мижозлари ўртасидаги муносабатлар шартномалар асосида амалга оширилади деб кўрсатилган.\r\nШу билан бирга, Ўзбекистон Республикаси Президентининг 2020 йил \r\n12 майдаги ПФ-5992-сонли Фармонининг 7-бандида вазирликлар, идоралар ва маҳаллий давлат ҳокимияти органлари раҳбарлари томонидан банкларнинг, \r\nшу жумладан кредит портфели ва банк активларини шакллантириш билан боғлиқ тадбиркорлик таваккалчиликларини бошқариш фаолиятига аралашиши тақиқланади деб кўрсатилган.\r\n“Агробанк” АТБ Ҳазорасп филиали билан ўртангизда 2020 йил 23 июнда тузилган 368-сонли кредит шартномасига асосан 2023 йил 22 июнгача бўлган муддатга йиллик 15 фоиз устама ҳақ тўлаш шарти билан 82 000 000 сўм миқдорида кредит маблағи ажратилиши белгиланган ва кредит таъминоти сифатида фуқаро Анязов Матчонга тегишли Ҳазорасп тумани, “Овшар” қишлоғи, “Истиқлол” маҳалласида жойлашган сартарошхона ва пойабзал устахонаси биноси ўзаро келишилган ҳолда 102 000 000 сўмга баҳоланиб, \r\n2020 йил 30 июнда Ҳазорасп туманидаги хусусий амалиёт билан шуғулланувчи З.С.Тожиев томонидан тузилган ипотека шартномасига асосан гаров мулкига нисбатан тақиқ солинган.\r\nКредит шартномаси бўйича 15021000005231098015-ссуда ҳисобрақами орқали 29.06.2020 йил куни газон ва қурилиш материаллари сотиб олиш учун \r\n“Tuft And Grass” МЧЖ ҚКга 40 000 000 сўм ва “Мухомон кимё” хусусий корхонасига 42 000 000 сўм, жами 82 000 000 сўм миқдорида маблағлар ўтказиб берилган, яъни банк филиали томонидан гаров таъминоти суммасида келиб чиққан ҳолда тузилган кредит шартномаси бўйича мажбуриятлар тўлиқ бажарилган.\r\nКредитни қайтариш графигига асосан кредитнинг асосий қисмидан 06.01.2021 йилдан бошлаб ҳар ойда 2 733 333 сўмдан қайтариб борилиши белгиланган, лекин кредит шартномаси шартларини доимий равишда бузиб келгансиз ва кредитнинг асосий қисмидан 18.06.2021 йилда 12 678 588,44 сўм миқдорида тўловни амалга оширгансиз ва бугунги кунда кредитнинг асосий қисмидан 69 321 411,56 сўм миқдорида қарздорлик қолган бўлиб, шундан 22 854 740,56 сўм қисмини график бўйича қайтариш муддати ўтган.\r\nШунингдек, кредит учун ҳисобланган фоизлардан 27.08.2020 йилда 700 000 сўм, 28.09.2020 йилда 2 467 671,23 сўм, 05.10.2020 йилда 32 328,77 сўм, 29.10.2020 йилда 1 012 328,77 сўм, 04.11.2020 йилда 203 131,48 сўм, \r\n11.11.2020 йилда 807 827,42 сўм, 03.12.2020 йилда 140 948,05 сўм, \r\n28.12.2020 йилда 903 709,49 сўм, 28.05.2021 йилда 755 859,79 сўм, \r\n18.06.2021 йилда 5 315 510,07 сўм, жами 12 339 315,07 сўм миқдоридаги тўловларни амалга оширгансиз ва шундан кейин фоиз тўловларини ҳам умуман амалга оширмагансиз, натижада 15.03.2022 йил ҳолатига кредит фоизлардан бўлган қарзингиз 7 639 033,36 сўмни ташкил қилган.\r\nБундан ташқари, кредит шартномасининг 8.3-бандига асосан кечиктирлган тўловлар учун 16405000605231098001-ҳисобрақами орқали 2 107 179,32 сўм, 16405000805231098002-ҳисобрақами орқали 58 873,83 сўм миқдорида пеня ҳисобланган ва шундан 880 806,86 сўм миқдорида тўловларни амалга оширгансиз ва ҳисобланган пенядан 1 285 246,29 сўм миқдорида қарздорлик қолган.\r\nҚарздорликни ундириш мақсадида банк томонидан фуқаролик ишлари бўйича Боғот туманлараро судига киритилган даъво аризасига асосан мазкур суднинг 20.12.2021 йилда “Агробанк” АТБ Ҳазорасп филиали биносида ўтказилган сайёр суд мажлиси натижаси бўйича қабул қилинган ҳал қилув қарорига асосан ундирув гаров мулкига қаратилган.\r\nСуд қарори бўйича 20.01.2022 йилда ижро варақаси чиқарилиб, МИБ Ҳазорасп туман бўлими томонидан 01.03.2022 йилда шерик қарздор А.Анязовга хабарнома жўнатилган ва 14.03.2022 йилда мол-мулкни электрон онлайн-аукционда сотиш учун чиқариш тўғрисида қарор қабул қилиниб, ижро ҳаракатлари бошлаб юборилган.\r\nКредит шартномасининг 8.6-бандида, мазкур шартномани ижро қилиш жараёнида юзага келадиган барча низолар тарафлар томонидан музокара қилиш йўли билан ҳал қилинади, музокара натижасида низо ҳал қилинмаган ёки келишувга эришилмаган тақдирда низоли масала суд тартибида ҳал қилинади деб кўрсатилган.\r\nЎзбекистон Республикасининг “Суд ҳужжатлари ва бошқа органлар ҳужжатларини ижро этиш тўғрисида”ги Қонунининг 37-моддасида, ундирувчи ундирувдан воз кечганда, агар воз кечиш суд томонидан қабул қилинган бўлса, шунингдек ундирувчи ва қарздор ўртасида суд томонидан тасдиқланган келишув битими тузилганда ижро иши юритиш давлат ижрочиси томонидан тугатилади деб кўрсатилган.\r\nЎзбекистон Республикаси Конституциясининг 110-моддасида, Ўзбекистон Республикаси Олий суди фуқаролик, жиноий, иқтисодий ва маъмурий суд ишларини юритиш соҳасида суд ҳокимиятининг олий органи ҳисобланади. У томонидан қабул қилинган ҳужжатлар қатъий ва Ўзбекистон Республикасининг барча ҳудудида бажарилиши мажбурийдир. Ўзбекистон Республикаси Олий суди қуйи судларнинг судлов фаолияти устидан назорат олиб бориш ҳуқуқига эга деб кўрсатилган.\r\nБу тўғрисида мурожаатингизда кўрсатилган 99.502-56-61 рақамли уяли телефонингиз орқали Бош бошқарма ходимлари томонидан Сиз билан боғланилиб, батафсил тушунтириш берилган (тегишли ҳужжатлар нусхаси илова қилинади).\r\nЮқорида қайд қилинган норматив-ҳуқуқий ҳужжатлар талабларига \r\nкўра, “Агробанк” АТБ Ҳазорасп филиали билан ўртангиздаги муносабатлар шартномавий муносабат эканлиги, Марказий банк - суд қарорлари ва уларнинг ижроси юзасидан олиб борилаётган ижро ҳаракатларини муҳокама қилишга ва уларни тўхтатиб туриш ёки қарздорликларни ундирмасдан турилиши юзасидан кўрсатмалар беришга ҳақли эмаслиги сабабли ижро ҳаракатларини тўхтатиш учун кредит тўловларини амалга оширган ҳолда бевосита хизмат кўрсатувчи банк филиали билан келишилган ҳолда амалга оширишингиз, суд қароридан норози бўлсангиз суднинг юқори инстанциясига мурожаат қилишингиз мақсадга мувофиқлиги билдирилади.\r\n', '16-19/95', '2022-03-17', NULL, '2022-03-17', 482, 1, 'А.Балтаев', '1647496876.9837.pdf', 2, 2, '2022-03-17 11:01:17', '2022-04-05 17:24:13'),
(910, 2059, 2240, 'хат ', 'Аризагўй Болтаев Қувондиқнинг \"пиёдалар йўлакчаси ҳамда светофор ўрнатиш масаласида амалий ёрдам бериш\" тўғрисида қилган мурожаатига асосан, Бош бошқарма ва Хазорасп туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан ўрганиш ишлари олиб борилди. Ўрганиш жараёнида, 4Р 156 автомобиль йўлининг 61 км.да пиёдалар учун светофор ўрнатиш зарурлиги аниқланди. Шунингдек, Хазарасп туман йўллардан фойдаланиш унитар корхонаси томонидан 2022 йил автомобиль йўлларини жорий таъмирлаш ишлари учун қўшимча ажратиладиган лимит маблағлари ҳисобидан светофор қурилмасини ўрнатиш ишларини режалаштирилиши тўғрисида аризагўй Болтаев Қувондиқга тушунтирилди.  ', '14/282', '2022-03-16', NULL, '2022-03-17', 305, 1, 'С.Бобожонов', '1647497640.9264.pdf', 2, 2, '2022-03-17 11:14:00', '2022-04-05 17:24:13'),
(911, 1937, 2038, 'хат ', ' Аризагўй фуқаро Абдуллаева Гулоранинг \"маҳалласидаги кўчани таъмирлашда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Гулзор\" маҳалласидаги йўллар  Урганч шаҳар ҳокимлиги Ободонлаштириш бошқармасига қарашли ички хўжалик йўллари эканлиги аниқланди. Ушбу мурожаатда келтирилган \"Гулзор\" маҳалласидаги Бобур кўчаси Урганч шаҳар ҳокимлиги Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармаси ва \"Гулзор\" маҳалла раиси таклифига асосан маҳалланинг ички йўллари таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Абдуллаева Гулорага тушунтирилди.      ', '08/287', '2022-03-16', NULL, '2022-03-17', 305, 1, 'Ж.Солаев', '1647499368.6557.pdf', 2, 2, '2022-03-17 11:42:48', '2022-04-05 17:24:13'),
(912, 1921, 2036, 'хат ', 'Аризачи фуқаро Саидова Жумагулнинг \"Ички йўлларни таъмирлашда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда келтирилган \"Янгиобод\" маҳалласидаги ички хўжалик йўллари  Урганч туман ҳокимлиги Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантирилишини эътиборга олиб, Урганч туман ҳокимлиги, туман Ободонлаштириш бошқармаси ва “Янгиобод” маҳалла раиси таклифига асосан лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Саидова Жумагулга тушунтирилди.     ', '08/288', '2022-03-16', NULL, '2022-03-17', 305, 1, 'Б.Аллаберганов ', '1647500512.8881.pdf', 2, 2, '2022-03-17 12:01:52', '2022-04-05 17:24:13'),
(913, 1868, 2025, 'хат ', 'Аризачи Матназаров Абдулла \"кўчасига асфальтбетон ётқизишда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Шодлик\" маҳалласи Навруз кўчасидаги йўллар Урганч туман ҳокимлиги Ободонлаштириш бошқармасига қарашли ички хўжалик йўллари эканлиги аниқланди. Ушбу мурожаатда келтирилган \"Шодлик\" маҳалласидаги Навруз кўчаси Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч туман ҳокимлиги, туман Ободонлаштириш бошқармаси ва \"Шодлик\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризачи Матназаров Абдуллага тушунтирилди.      ', '08/289', '2022-03-16', NULL, '2022-03-17', 305, 1, 'Ж.Солаев', '1647501980.3344.pdf', 2, 2, '2022-03-17 12:26:20', '2022-04-05 17:24:13'),
(914, 2013, 2223, 'Жавоб хати', '11 ва 43-сонли Умумтаълим мактабига сунъий қопламали футбол майдончаси қурганлиги эвазига ажратиладиган ер масаласида 110 млн сўм банк кредитини олиб бериш', '01/7-13-216', '2022-03-16', NULL, '2022-03-17', 394, 1, 'О.Жуманиёзов', '1647512400.6758.pdf', 2, 2, '2022-03-17 15:20:00', '2022-04-05 17:24:13'),
(915, 1936, 2063, 'Электр тармоғига қонуний уланиш', 'Urganch shahar Navrо‘z MFY Navbahor kо‘chasi 3 yо‘lak 34 uyda yashovchi fuqaro Otabek Babaniyazovning qilgan murojaati о‘rganib chiqilmoqda. Ushbu murojaatda ko‘rsatilgan masalalar qo‘shimcha o‘rganishni, tekshirishni talab etilayotganligi sababli “Jismoniy va yuridik shaxslarning murojaatlari to‘g‘risida”gi O‘zbekiston Respublikasi Qonuniga o‘zgartirish va qo‘shimchalar kiritish haqida, 2017 yil 11 sentabrdagi O‘RQ-445-sonli O‘zbekiston Respublikasi (yangi tahrir)dagi Qonunining 28-moddasiga asosan ushbu murojaatni to‘liq o‘rganib chiqish uchun qo‘shimcha muddat talab etayotganligini ma’lum qilamiz. ', '№718', '2022-03-14', NULL, '2022-03-18', 291, 1, 'О.Атажанов', '1647575650.3642.pdf', 2, 2, '2022-03-18 08:54:10', '2022-04-05 17:24:13'),
