(919, 1860, 2024, 'хат ', 'Аризачи Нурметов Хударганнинг \"кўчасини асфальт қилиш, югуриш учун йўлакча ташкил қилиб беришда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Саховат\" маҳалласи Замахшарий кўчасидаги ички йўллар Урганч шахар хокимлиги ва шахар Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастур\"га киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч шахар ҳокимлиги ва шахар Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастур\"га киритиш ваколатига эга эмас. Шунга кўра, Урганч шахар ҳокимлиги, шахар Ободонлаштириш бошқармаси ва \"Саховат\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризачи Нурметов Хударганга тушунтирилди.      \r\n\r\n', '08/300', '2022-03-17', NULL, '2022-03-18', 305, 1, 'Ж.Солаев', '1647586382.6562.pdf', 2, 2, '2022-03-18 11:53:02', '2022-04-05 17:24:13'),
(920, 1876, 2027, 'хат ', 'Аризачи Абдуллаев Алишернинг \"Махаллани ички йўлларини таъмирлаш ва тунги ёритиш чироқларини ўрнатиб беришда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Саховат\" маҳалласи Замахшарий кўчасидан ички йўллар Урганч шахар хокимлиги ва шахар Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч шахар ҳокимлиги ва шахар Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч шахар ҳокимлиги, шахар Ободонлаштириш бошқармаси ва \"Саховат\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризачи Абдуллаев Алишерга тушунтирилди.      ', '08/296', '2022-03-17', NULL, '2022-03-18', 305, 1, 'Ж.Солаев', '1647586818.8895.pdf', 2, 2, '2022-03-18 12:00:18', '2022-04-05 17:24:13'),
