(926, 2019, 2234, 'фуқаро Мадаминов Бахтиёрнинг мурожаати юзасидан', 'Фуқаро Б.Мадаминовга мазкур АРТ хужжатига асосан Ўзбекистон Республикаси\r\nВазирлар Маҳкамасининг 2018 йил 18 майдаги “Архитектура ва қурилиш соҳасида давлат\r\nхизматлари кўрсатишнинг айрим маъмурий регламентларини тасдиқлаш тўғрисида”ги\r\n370-сонли қарорининг низом талабларига мувофиқ лойиҳа пешхисоб хужжатларини\r\nишлаб чиқиш учун тегишли ташкилотларга мурожаат қилишлари ва ишлаб чиқилган\r\nлойиҳа пешхисоб хужатлари давлат экспиртизасидан ўтказилиб вилоят қурилиш бош\r\nбошқармаси хузуридаги архитектура-шаҳарсозлик кенгашининг ижабий холосасини олган\r\nхолда ер участкасини натурада кўрсатиб берилишини сўраб мурожаат қилиши хамда\r\nбелгиланган тартибда вилоят ҚСХНИ (Қурилиш соҳасида худудий назорат\r\nинспекция)сига билдирги берилгандан кейингина қурилиш ишларини амалга оширилиши\r\nмурожаатгўйга тушунтирилди.\r\nУшбуларни фуқаро Б.Мадаминовнинг мурожаатига жавоб тариқасида маълум\r\nқиламиз, агарда жавобдан норози бўлса юқори турувчи ташкилотларга мурожаат қилиши\r\nмумкинлигини билдирамиз.', '240', '2022-03-17', NULL, '2022-03-18', 346, 1, 'Х.Рўзимов', '1647589004.6948.pdf', 2, 2, '2022-03-18 12:36:44', '2022-04-05 17:24:13'),
(927, 2089, 2264, 'фуқаро У.Рўзматовнинг мурожаати юзасидан', '“Урганч лойиҳа сервис” МЧЖ томонидан ишлаб чиқилган\r\n“Ҳазорасп дехқон бозори” МЧЖнинг бош режаси(ПДП)ни ишлаб чиқилишида бозор\r\nмаъмурияти томонидан тақдим қилинган топо сурати асосида бош режа ишланган,\r\nлекин бош режада фуқаро М.Алланазаров томонидан қурилган қурилма ҳудудга\r\nкиритилмай қолдирилган, сабаби олдин “Ҳазорасп дехқон бозори” МЧЖнинг\r\nкадастр ҳужжатлари мавжуд бўлмаганлигини, шу сабабли чегара ҳудуди аниқ қилиб\r\n(қизил чизиқ билан) кўрсатилмаган.\r\nҲозирда фуқаро М.Алланазаров томонидан қурилган қурилмаси “Ҳазорасп\r\nдехқон бозори” маъсулияти чекланган жамиятига қарашли Хоразм вилоят ер тузиш\r\nва кўчмас мулк кадастри давлат корхонасининг Ҳазорасп туман филиали томонидан\r\nишлаб чиқилган кадастр ҳужжатларида кўрсатилган қизил чизиғи чегара ҳудудида\r\nқурилганлиги билдирамиз.\r\nУшбу маълумотларни аризага жавоб тариқасида маълум қиламиз агарда\r\nжавобдан нарози бўлганда юқори турувчи ташкилотларга мурожаат қилишлиги\r\nтушинтирилади.', '217', '2022-03-15', NULL, '2022-03-18', 346, 1, 'Р.Аллаберганов', '1647589177.1861.pdf', 2, 2, '2022-03-18 12:39:37', '2022-04-05 17:24:13'),
(928, 2021, 2236, 'Жуманиёзов ВаисёзНиёзматовичнинг мурожаати юзасидан', 'Фуқаро В.Жуманиёзовнинг акаси Б.Мадаминовга Хива шаҳар, “Газчи” маҳалласи\r\nҳудудидан “Савдо шаҳобчаси” биноси қурилиши учун Хива шаҳар ҳокимининг 2018 йил\r\n24-июлдаги 1274-сонли қарори билан 100 кв метр ер майдони ажратилган ва ушбу қарорга\r\nасосан “Савдо шаҳобчаси” биносини лойиҳалаштириш учун вилоят қурилиш бош\r\nбошқармаси томонидан 06.01.2020 йилда 14-20/А-сонли АРТ (Архитектура\r\nрежалаштириш топшириғи) хужжатлари ишлаб чиқилган.\r\nМазкур АРТ хужжатига асосан Ўзбекистон Республикаси Вазирлар Маҳкамасининг\r\n2018 йил 18 майдаги “Архитектура ва қурилиш соҳасида давлат хизматлари кўрсатишнинг\r\nайрим маъмурий регламентларини тасдиқлаш тўғрисида”ги 370-сонли қарорининг низом\r\nталабларига мувофиқ лойиҳа пешхисоб хужжатларини ишлаб чиқиш учун тегишли\r\nташкилотларга мурожаат қилишлари ва ишлаб чиқилган лойиҳа пешхисоб хужатлари\r\nдавлат экспиртизасидан ўтказилиб вилоят қурилиш бош бошқармаси хузуридаги\r\nархитектура-шаҳарсозлик кенгашининг ижабий холосасини олган холда ер участкасини\r\nнатурада кўрсатиб берилишини сўраб мурожаат қилиши хамда белгиланган тартибда\r\nвилоят ҚСХНИ (Қурилиш соҳасида худудий назорат инспекция)сига билдирги\r\nберилгандан кейингина қурилиш ишларини амалга оширилиши мурожаатгўйга\r\nтушунтирилди.\r\nУшбуларни фуқаро В.Жуманиёзовнинг мурожаатига жавоб тариқасида маълум\r\nқиламиз, агарда жавобдан норози бўлса юқори турувчи ташкилотларга мурожаат қилиши\r\nмумкинлигини билдирамиз.', '239', '2022-03-17', NULL, '2022-03-18', 346, 1, 'Х.Рўзимов', '1647589267.4345.pdf', 2, 2, '2022-03-18 12:41:07', '2022-04-05 17:24:13'),
(929, 2020, 2235, 'Жуманиёзов ВаисёзНиёзматовичнинг мурожаати юзасидан', 'Фуқаро В.Жуманиёзовнинг акаси Б.Мадаминовга Хива шаҳар, “Газчи” маҳалласи\r\nҳудудидан “Савдо шаҳобчаси” биноси қурилиши учун Хива шаҳар ҳокимининг 2018 йил\r\n24-июлдаги 1274-сонли қарори билан 100 кв метр ер майдони ажратилган ва ушбу қарорга\r\nасосан “Савдо шаҳобчаси” биносини лойиҳалаштириш учун вилоят қурилиш бош\r\nбошқармаси томонидан 06.01.2020 йилда 14-20/А-сонли АРТ (Архитектура\r\nрежалаштириш топшириғи) хужжатлари ишлаб чиқилган.\r\nМазкур АРТ хужжатига асосан Ўзбекистон Республикаси Вазирлар Маҳкамасининг\r\n2018 йил 18 майдаги “Архитектура ва қурилиш соҳасида давлат хизматлари кўрсатишнинг\r\nайрим маъмурий регламентларини тасдиқлаш тўғрисида”ги 370-сонли қарорининг низом\r\nталабларига мувофиқ лойиҳа пешхисоб хужжатларини ишлаб чиқиш учун тегишли\r\nташкилотларга мурожаат қилишлари ва ишлаб чиқилган лойиҳа пешхисоб хужатлари\r\nдавлат экспиртизасидан ўтказилиб вилоят қурилиш бош бошқармаси хузуридаги\r\nархитектура-шаҳарсозлик кенгашининг ижабий холосасини олган холда ер участкасини\r\nнатурада кўрсатиб берилишини сўраб мурожаат қилиши хамда белгиланган тартибда\r\nвилоят ҚСХНИ (Қурилиш соҳасида худудий назорат инспекция)сига билдирги\r\nберилгандан кейингина қурилиш ишларини амалга оширилиши мурожаатгўйга\r\nтушунтирилди.\r\nУшбуларни фуқаро В.Жуманиёзовнинг мурожаатига жавоб тариқасида маълум\r\nқиламиз, агарда жавобдан норози бўлса юқори турувчи ташкилотларга мурожаат қилиши\r\nмумкинлигини билдирамиз.', '239', '2022-03-17', NULL, '2022-03-18', 346, 1, 'Х.Рўзимов', '1647589390.7702.pdf', 2, 2, '2022-03-18 12:43:10', '2022-04-05 17:24:13'),
(930, 2022, 2238, 'фуқаро Қ.Машариповниг мурожаати юзасидан', 'ётқизилган.\r\n\"Ҳазорасп” ширкат хўжалиги вакиллар йиғилишининг 02.03.2004 йилдаги\r\n2-сонли йиғилиш баёни ва ушбу баённи тасдиқлаш ҳақидаги туман ҳокимининг\r\n16.03.2004 йилдаги 603-сонли қарори билан ажратиб берилган 0,06 гектар ер\r\nмайдони аслида, туман ҳокимининг 26.02.2014 йилдаги 209қ-сонли қарори билан\r\nСизнинг номингизга эгалик ҳуқуқи белгиланиб, у мазкур ер майдонини ҳадя\r\nшартномасига асосан қизингиз М.Машариповага ҳадя килинган лигини\r\nбилдирамиз.\r\nУшбу маълумотларни аризага жавоб тариқасида маълум қиламиз агарда\r\nжавобдан нарози бўлганда юқори турувчи ташкилотларга мурожаат қилишлиги\r\nтушинтирилади.', '218', '2022-03-15', NULL, '2022-03-18', 346, 1, 'Р.Аллаберганов', '1647589508.5069.pdf', 2, 2, '2022-03-18 12:45:08', '2022-04-05 17:24:13'),
(931, 1936, 2063, 'Электр тармоғига қонуний уланиш', 'Urganch shahar Navrо‘z MFY Navbahor kо‘chasi 3 yо‘lak 34 uyda yashovchi fuqaro Otabek Babaniyazovning qilgan murojaati о‘rganib chiqilmoqda. Ushbu murojaatda ko‘rsatilgan masalalar qo‘shimcha o‘rganishni, tekshirishni talab etilayotganligi sababli “Jismoniy va yuridik shaxslarning murojaatlari to‘g‘risida”gi O‘zbekiston Respublikasi Qonuniga o‘zgartirish va qo‘shimchalar kiritish haqida, 2017 yil 11 sentabrdagi O‘RQ-445-sonli O‘zbekiston Respublikasi (yangi tahrir)dagi Qonunining 28-moddasiga asosan ushbu murojaatni to‘liq o‘rganib chiqish uchun qo‘shimcha muddat talab etayotganligini ma’lum qilamiz.', '№718', '2022-03-14', NULL, '2022-03-18', 291, 1, 'О.Атажанов', '1647593699.0186.pdf', 2, 2, '2022-03-18 13:54:59', '2022-04-05 17:24:13'),
(932, 1876, 2115, 'Далолатнома', '           Ўрганиш натижаларидан келиб чиқиб,  Ўзбекистон Республикасининг 2007 йил                        2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқароларга тушунтиришлар берилди. \r\n      Шунингдек  корхона томонидан  2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали йўлни таъмирлаш, тунги ёриткичларни ўрнатиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '26', '2022-03-18', NULL, '2022-03-18', 315, 1, 'Н.Юсупбаев, Р.Хикметов', '1647605970.7161.pdf', 2, 2, '2022-03-18 17:19:30', '2022-04-05 17:24:13'),
(933, 1868, 2114, 'Далолатнома', 'Ўрганиш жараёнида фуқаро Матназаров Абдулло томонидан билдириб ўтилган Урганч туманидан ўтган Амударё ҳавзаси ҳимоя худудидаги (Чолиш поселкаси худудига яқин бўлган дала ҳовлига олиб борувчи ички хўжалик йўли) йўлининг  узунлиги 1000 метрни ташкил қилиши, тупроқ қопламали эканлиги аниқланди.\r\n        Ўрганиш натижаларидан келиб чиқиб,  йўлни талаб даражасига келтириш юзасидан тахминий ҳисоб-китоблар қилинганлиги, унга кўра тош қоплама ётқизилган тақдирда    220 млн сўм, тош ва асфальт қоплама ётқизилган тақдирда  эса 684 млн сўмлик маблағлар сарф қилиниши,  Ўзбекистон Республикасининг 2007 йил 2 октябрдаги  ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида  шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши, молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши,Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб қўйилганлиги,  йўлни таъмирлаш масаласи Урганч туман хокимлиги ва  Урганч туман Ободонлаштириш бошқармаси томонидан ҳал қилиниши тўғрисида фуқарога  тушунтиришлар берилди.           \r\n      Шу билан биргаликда  корхона томонидан    2022 йилнинг 15 март куни 03/146 сонли хат орқали Урганч тумани худудидаги Амударё ҳавзаси химоя худудидаги  (Чолиш поселкаси худудига яқин бўлган дала ҳовлига олиб борувчи йўл)  1000 метр узунликдаги ички хўжалик йўлини таъмирлаш дастурига киритишда ҳамда молиялаштириш манбасини аниқлаштиришда амалий ёрдам сўраб Урганч туман хокими Ф.Шариповга   мурожаат қилинганлиги, шу сабабли мурожаатдаги  масала юзасидан туман хокимлиги билан алоқада бўлиб туриш тўғрисида  билдириб ўтилди.\r\n   \r\n', '25', '2022-03-18', NULL, '2022-03-18', 315, 1, 'Н.Юсупбаев, Р.Хикметов', '1647606374.585.pdf', 2, 2, '2022-03-18 17:26:14', '2022-04-05 17:24:13'),
(934, 1877, 2117, 'Далолатнома', '           Ўрганиш натижаларидан келиб чиқиб,  Ўзбекистон Республикасининг 2007 йил                        2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқароларга тушунтиришлар берилди. \r\n      Шунингдек  корхона томонидан  2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали йўлни таъмирлаш, тунги ёриткичларни ўрнатиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '27', '2022-03-18', NULL, '2022-03-18', 315, 1, 'Н.Юсупбаев, Р.Хикметов', '1647606568.4547.pdf', 2, 2, '2022-03-18 17:29:28', '2022-04-05 17:24:13'),
