(939, 1860, 2113, 'Далолатнома', '           Ўрганиш натижаларидан келиб чиқиб,Ўзбекистон Республикасининг 2007 йил                                            2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб куйилганлиги, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқарога  тушунтиришлар берилди. \r\n     Шунингдек фуқаронинг мурожаатини инобатга олган ҳолда корхона томонидан                                             2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали  йўлни таъмирлаш, Урганч шаҳридаги 2-сон мактабнинг спорт  майдони атрофида  қариялар югуриши учун йўлакча ташкил қилиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '24', '2022-03-18', NULL, '2022-03-18', 315, 1, 'Н.Юсупбаев, Р.Хикметов', '1647608026.3312.pdf', 2, 2, '2022-03-18 17:53:46', '2022-04-05 17:24:13'),
(940, 1937, 2122, 'Далолатнома', '           Ўрганиш натижаларидан келиб чиқиб, Ўзбекистон Республикасининг  “Автомобиль йўллари тўғрисида”ги Қонунида  шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб куйилганлиги,   йўлларни таъмирлаш ишлари давлат дастурларига киритилган ҳолда босқичма-босқич  амалга оширилаётганлиги, мурожаатда кўрсатилган кўчани таъмирлаш масаласи  Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқарога тушунтиришлар берилди. Шунингдек  корхона томонидан  2022 йилнинг 15 март кунидаги 03/148 сонли   йўлни таъмирлаш  ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб   Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.', '32', '2022-03-18', NULL, '2022-03-18', 315, 1, 'Н.Юсупбаев, Р.Хикметов', '1647608435.4481.pdf', 2, 2, '2022-03-18 18:00:35', '2022-04-05 17:24:13'),
(941, 1930, 2339, 'оғзаки мурожаатга жавоб', '“Ўзсаноаткурулишбанк” АТБ Хоразм минтақавий филиали ушбу билан Сизнинг Хоразм вилояти хокими, вилоятдаги шахар ва туманларда жисмоний шахслар ва юридик шахслар вакиллари сайёр қабулларини ўтказиш чоғида, ёшлар кичик саноат зонаси ташкил қилиш мақсадида 600,0 млн сўм кредит маблағи сўраб йўллаган оғзаки мурожаатингиз ўрганилганда, Сиз тамонингиздан кредит ажратиш юзасидан “Ўзсаноаткурулишбанк” АТБ Хоразм минтақавий филиалига кредит ажратиш бўйича хужжат такдим қилинмаганлиги, шунингдек “Ўзсаноаткурулишбанк” АТБ Хоразм минтақавий филиалига ариза билан мурожаат қилганингиздан кейин тегишли тартибда кўриб чикилишини маълум қиламиз.', '04-05/696', '2022-03-18', NULL, '2022-03-18', 517, 1, 'Ш.Саидв', '1647608797.6201.pdf', 2, 2, '2022-03-18 18:06:37', '2022-04-05 17:24:13'),
