(945, 1928, 2058, 'фуқаро I.Rahmonovaнинг мурожаати юзасидан', 'Viloyat qurilish bosh boshqarmasi Sizning 2022 yil 19 martdagi 201-sonli\r\ntartib raqami bilan ro‘yxatga olingan murojaatingizda qayd qilingan masalani\r\no‘rganish jarayonida qo‘shimcha vaqt talab etilayotgani munosabati bilan,\r\nO‘zbekiston Respublikasining “Jismoniy va yuridik shaxslarning murojaatlari\r\nto‘g‘risida”gi qonunining 28-moddasiga muvofiq, murojaatning ijro muddati\r\nqo‘shimcha 15 kun muddatga uzaytirib berishingizni bildiramiz.', '248', '2022-03-18', NULL, '2022-03-18', 346, 1, 'У.Рахимов', '1647612953.4053.pdf', 2, 2, '2022-03-18 19:15:53', '2022-04-05 17:24:13'),
