(947, 1871, 2013, NULL, 'Фукаро ХДучкаров ушбу мурожаатлари оркали тадбиркорлик фаолияти билан шугулланиши учун вактинча фойдаланишга енгил типдаги савдо шахобчаси (Контейнер) урнатишга ер майдони ажратилишини сураган. Хозирги кунда Узбекистон Республикаси Президентининг “Кучма савдо фаолиятига замонавий ахборот технологияларни янада кенг жорий этиш хамда савдо автомати чакана савдо фаолиятини тартибга солиш чора тадбирлари тугрисида” 04.06.2021- йилдаги ПК-513 6-сон карори билан 2021-йил 1-декабрдан бошлаб Кучма савдо фаолияти (Контейнер) тадбиркорлик субъектлари томонидан кучма савдо объектларини электрон тарзда “K-SAVDO” ААТ автоматлаштирилган ахборот тизимида руйхатдан утказиш йули билан амалга ошириш хамда (Контейнер) жойи жойлаштириш схемалари буйича “К- SAVDO” ААТ оркали электрон аукционда сотиб олиш тартиби белгиланганлигини маълум киламиз. Мазкур масала юзасидан фукаро Х.Кучкаровга “K-SAVDO” ААТ автоматлаштирилган ахборот тизимини электрон онлайн-аукционга ер майдони куйиш тартиблари тугрисида белгиланган тартибда мутахассислар томонидан тушунтиришлар олиб борилди. Ушбуларни мурожаатингизга жавоб тарикасида маълум киламиз, агарда жавобдан норози б^лган такдирида юкори турувчи органларга мурожаат килиши мумкинлигини билдирамиз.', NULL, '2022-03-19', NULL, '2022-03-19', 1451, 0, NULL, NULL, 2, 0, '2022-03-19 12:39:18', '2022-04-05 17:24:13'),
(948, 1945, 2140, NULL, 'фуқарога дехқончилик фаолияти билан шуғилланиш учун экин ер майдони ажратилиш “E-AUKSION” электрон савдо платформаси тизимида қатнашиб дехқон хўжалиги ерларидан ютиб олиши тушинтирилди.', NULL, '2022-03-19', NULL, '2022-03-19', 1451, 0, NULL, NULL, 2, 0, '2022-03-19 12:39:35', '2022-04-05 17:24:13'),
