(951, 2037, 2239, 'Сув насосини электр тармоғига улаш', 'Urganch tumani X.Olimjon MFYda yashovchi fuqaro M.Mavlonovning    murojaati yuzasidan Urganch tuman elektr ta’minoti korxonasi xodimlari tomonidan  joyiga chiqgan holda murojaatchi M.Mavlonovning yashash hududida Davlat dasturi bо‘yicha sim yog‘ochlarni almashtirish ishlari olib borilayotganligini ma’lum qilamiz.         \r\nShuningdek, suv nasosini tarmoqga ulash tо‘g‘risidagi murojaati yuzasidan Davlat xizmatlari markaziga murojaat qilishi shartligi tо‘g‘risida muojaatchiga tushuntirish ishlari olib borildi.', '№813', '2022-03-17', NULL, '2022-03-24', 291, 1, 'О.Атажанов', '1648106769.2051.pdf', 2, 2, '2022-03-24 12:26:09', '2022-04-05 17:24:13'),
(952, 2216, 2502, 'Қарздорлик', 'Yangiariq tuman elektr ta’minoti korxonasining mutaxassislari tomonidan joyiga chiqgan holda Yangiariq tumani Pо‘rsang MFY Yangilik kо‘chasi 5 uyda yashovchi fuqaro Yuldosh Rо‘zmetov tomonidan “Diyorbek qovunchi” fermer xо‘jaligi elektr ta’minotidan ajratilganligi tо‘g‘risida o‘rganish o‘tkazildi. O‘tkazilgan o‘rganishlar natijasida “Diyorbek qovunchi” fermer xо‘jaligining elektr ta’minoti 110/35/10 kV kuchlanishli podstansiya KS-3 dan chiquvchi 10 kV kuchlanishli Karbit fideriga ulangan dispetcher raqami №TP-10325-sonli quvvati 160 kVAli transformator punkti orqali elektr energiyasi bilan ta’minlangan. \r\n“Diyorbek qovunchi” fermer xо‘jaligi foydalanilgan elektr energiyasi uchun 01.03.2022 yil holatiga 41,483,717.81 sо‘m qarzdorlik yuzaga kelganligi va shu qarzdorlikni о‘z vaqtida tо‘lamaganligi sababli elektr ta’minotidan ajratilgan. Ushbu qarzdorlikni sо‘ndirib, elektr energiyasidan foydalanish uchun oldindan tо‘lovlarni amalga oshirsa qayta elektr ta’minotiga ulab berilishini ma’lum qilamiz.\r\n', '№694', '2022-03-10', NULL, '2022-03-24', 291, 1, 'О.Атажанов', '1648107357.1387.pdf', 2, 2, '2022-03-24 12:35:57', '2022-04-05 17:24:13'),
