(960, 2262, 2470, 'Oilaga moddiy yordam', 'G\'allachilik bo\'yicha ekin yeri olishda e-auksion.uz orqali qatnashib 20 sotx yer 10 yilga yutish imkoniyati mavjudligi tushuntirildi. \"Temir daftar\" jamg\'armasidan 33 million so\'m olib bo\'lmasligi lekin 33 million so\'m 14% kredit tadbirkorlik qilish uchun olish imkoniyatt mavjudligi tushuntirildi .', '5', '2022-03-25', NULL, '2022-03-25', 1458, 0, 'R.Nurmetov', NULL, 2, 2, '2022-03-25 10:03:23', '2022-04-05 17:24:13'),
(961, 2262, 2472, 'Oilaga moddiy yordam', 'G\'allachilik bo\'yicha ekin yeri olishda e-auksion.uz orqali qatnashib 20 sotx yer 10 yilga yutish imkoniyati mavjudligi tushuntirildi. \"Temir daftar\" jamg\'armasidan 33 million so\'m olib bo\'lmasligi lekin 33 million so\'m 14% kredit tadbirkorlik qilish uchun olish imkoniyatt mavjudligi tushuntirildi .', '5', '2022-03-25', NULL, '2022-03-25', 1458, 0, 'R.Nurmetov', NULL, 2, 2, '2022-03-25 10:04:34', '2022-04-05 17:24:13'),
(962, 2016, 2237, 'Электр тармоғига уланиш', 'Saparov Orifjon Abdullayevich 2022 yil 15 mart kuni Bog‘ot tuman “Davlat xizmatlari markazi”ga Qumbodoq mahallasida joylashgan tovuqchilik fabrikasini elektr tarmog‘iga ulash uchun ariza bilan murojaat qilgan bo‘lib, tuman ETK ma’muriyati tomonidan 1-chiziqli sxema va  qilinadigan ish xajmi tayyorlanib,  Texnik shart, smeta xujjatlari tayyorlanishi uchun “Xorazm XET” AJga yuborilgan. Texnik shart, smeta xujjatlari tayyor bo‘lganidan keyin shartnomada pudratchi tomonidan bajariladigan ishlar bahosi elektr qurilmalarini tarmoqqa ulash bilan bog‘liq barcha xarajatlari  to‘liq qoplanganda va iste’molchi Texnik shartdagi talablarni bajargandan keyin tovuqchilik fabrikasini elektr tarmog‘iga ulab berilishini tо‘g‘risida murojaatchiga tushuntirish ishlari olib borildi.', '№ 841', '2022-03-24', NULL, '2022-03-25', 291, 0, 'О.Атажанов', '1648193751.26.pdf', 2, 2, '2022-03-25 12:35:51', '2022-04-05 17:24:13'),
(963, 2261, 2469, 'Tadbirkorlikni rivojlantirish', 'Istiqlol mahallasi hokim yordamchisi, tuman hokimligi masullari  va mahalla raisi o’rinbosari tamonidan fuqaroning uyiga bir necha marotaba borildi va telefon orqali suhbatlashildi. Borgan vaqtda fuqaro uyida emasligi va kuni bo’yi ishdaligi evaziga uchrashib bo’lmadi. Fuqaroning 2 ta o’g’li bo’lib bir nafari 2 gurux nogironi. Shu farzandining nomiga YTT sifatida ro’yxatdan o’tgan bo’lib, soliqlardan imtiyozlar berilgan. Yana bir nafar mehnatga layoqatli farzandi bo’lib mebelchilik bilan shug’ullanib kelmoqda. Borgan paytda o’g’li Rajapov Mirzoxid Masharip o’g’li bilan suhbatlashildi. O’g’lining aytishi bo’yicha mebelchilik qilishi uchun xom-ashyoni subsidiya asosida berilishini so’radi va bunday subsidiya mavjud emasligi sababli o’g’lining haydovchilik guvohnamasiga ehtiyoji borligi aniqlandi va  yoshlar daftariga kiritildi. Yoshlar daftari orqali xaydovchilik guvohnoma olishida 70% bo’lgan qismini davlat tamonidan subsidiya asosida to’lab berilishi tushuntirildi.', '6', '2022-03-25', NULL, '2022-03-25', 1458, 0, 'R.Nurmetov', '1648200470.3588.pdf', 2, 2, '2022-03-25 14:27:50', '2022-04-05 17:24:13'),
(964, 2261, 2471, 'Tadbirkorlikni rivojlantirish', 'Istiqlol mahallasi hokim yordamchisi, tuman hokimligi masullari  va mahalla raisi o’rinbosari tamonidan fuqaroning uyiga bir necha marotaba borildi va telefon orqali suhbatlashildi. Borgan vaqtda fuqaro uyida emasligi va kuni bo’yi ishdaligi evaziga uchrashib bo’lmadi. Fuqaroning 2 ta o’g’li bo’lib bir nafari 2 gurux nogironi. Shu farzandining nomiga YTT sifatida ro’yxatdan o’tgan bo’lib, soliqlardan imtiyozlar berilgan. Yana bir nafar mehnatga layoqatli farzandi bo’lib mebelchilik bilan shug’ullanib kelmoqda. Borgan paytda o’g’li Rajapov Mirzoxid Masharip o’g’li bilan suhbatlashildi. O’g’lining aytishi bo’yicha mebelchilik qilishi uchun xom-ashyoni subsidiya asosida berilishini so’radi va bunday subsidiya mavjud emasligi sababli o’g’lining haydovchilik guvohnamasiga ehtiyoji borligi aniqlandi va  yoshlar daftariga kiritildi. Yoshlar daftari orqali xaydovchilik guvohnoma olishida 70% bo’lgan qismini davlat tamonidan subsidiya asosida to’lab berilishi tushuntirildi.', '6', '2022-03-25', NULL, '2022-03-25', 1458, 0, 'R.Nurmetov', '1648200531.6631.pdf', 2, 2, '2022-03-25 14:28:51', '2022-04-05 17:24:13'),
(965, 2325, 2602, 'Қарздорлик', 'Yangiariq tuman elektr ta’minoti korxonasining mutaxassislari tomonidan joyiga chiqgan holda Yangiariq tumani Pо‘rsang MFY Yangilik kо‘chasi 5 uyda yashovchi fuqaro Yuldosh Rо‘zmetov tomonidan “Diyorbek qovunchi” fermer xо‘jaligi elektr ta’minotidan ajratilganligi tо‘g‘risida o‘rganish o‘tkazildi. O‘tkazilgan o‘rganishlar natijasida “Diyorbek qovunchi” fermer xо‘jaligining elektr ta’minoti 110/35/10 kV kuchlanishli podstansiya KS-3 dan chiquvchi 10 kV kuchlanishli Karbit fideriga ulangan dispetcher raqami №TP-10325-sonli quvvati 160 kVAli transformator punkti orqali elektr energiyasi bilan ta’minlangan. \r\n“Diyorbek qovunchi” fermer xо‘jaligi foydalanilgan elektr energiyasi uchun 01.03.2022 yil holatiga 41,483,717.81 sо‘m qarzdorlik yuzaga kelganligi va shu qarzdorlikni о‘z vaqtida tо‘lamaganligi sababli elektr ta’minotidan ajratilgan. Ushbu qarzdorlikni sо‘ndirib, elektr energiyasidan foydalanish uchun oldindan tо‘lovlarni amalga oshirsa qayta elektr ta’minotiga ulab berilishini ma’lum qilamiz.   \r\n', '№694', '2022-03-10', NULL, '2022-03-26', 291, 1, 'О.Атажанов', '1648273139.0186.pdf', 2, 2, '2022-03-26 10:38:59', '2022-04-05 17:24:13'),
