(294, '1361', '2021-10-28', 292, 826, NULL, 'null', 'null', 'null', 'null', NULL, 15, '2021-11-03', '2021-11-02', 1, 2, '2021-10-28 15:50:48', '2021-11-02 12:02:28', 0, 'Ўрганиб қонунлар доирасида хал қилиб, натижаси муаллифга ва Президент виртуал қабулхонасига маълум қилинсин', '2021 йил 19 октябрдаги 771198/21-рақамли мурожаатга Сизнинг Ўзбекистон Республикаси Президентига Ишонч телефони орқали ноқонуний тарзда тортиб олинган ер майдонларини қайтариб олишда ёрдам сўраб қилган мурожаатингиз туман ҳокимлиги мутахассислари томонидан ўрганилди. Ўрганиш давомида Сиз раҳбарлик қилган, ҳозирда фаолияти тугатилган “Асадбек Мохичехра” фермер хўжалиги туман ҳокимининг 2018 йил 14 феврал кунги №360қ-сонли қарорига асосан ташкил топганлиги аниқланди. Шунингдек, Ўзбекистон Республикаси Вазирлар Маҳкамасининг 2019 йил 9 январдаги “Фермер хўжаликлари ва бошқа қишлоқ хўжалиги корхоналари ер майдонларини мақбуллаштириш ҳамда қишлоқ хўжалиги экин ерларидан самарали фойдаланишга доир қўшимча чора-тадбирлар тўғрисида”ги 14-сонли қарори талабларига тўғри келмаслиги сабабли, мазкур фермер хўжалигига ажратиб берилган ер майдонлари туман ҳокимлиги захира ер фонди ҳисобига қайтарилганлигини маълумот тариқасида билдирамиз. Шу билан бирга Ўзбекистон Республикаси Президентининг 2021 йил 8 июндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга бўлган ҳуқуқларни ишончли ҳимоя қилиш ва уларни бозор активига айлантириш чора-тадбирлари тўғрисида”ги ПФ-6243-сонли Фармонига асосан Ўзбекистон Республикаси Ер кодексига тегишли ўзгартириш ва қўшимчалар киритилгунига қадар Қорақалпоғистон Республикаси Вазирлар Кенгаши, вилоятлар, Тошкент шаҳар, туманлар ва шаҳарлар маҳаллий вакиллик ва ижро ҳокимияти органлари томонидан ер участкаларини ажратиш қатъиян тўхтатилганлиги сабабли, туман ҳокимлиги томонидан фермер хўжалиги ташкил қилишингиз учун ер майдони ажратиб бериш имконияти йўқлигини билдирамиз. Сиз раҳбарлик қилган фермер хўжалигининг ер майдонларитуман ҳокимлиги захирасига ноқонуний тарзда қайтарилганлигиюзасидан хужжатлар мавжуд бўлса, тегишли тартибда ҳуқуқни мухофаза қилувчи ташкилотларга мурожаат қилишингиз мумкинлигини маълум қиламиз. Ушбуни мурожаатингизга жавоб тариқасида билдириб, жавобдан норози бўлсангиз юқори турувчи ташкилотга мурожаат қилишингиз мумкинлигини билдирамиз.', '1635836548.0986.pdf', 127, NULL, 1, 0, NULL, NULL, NULL),
