(1252, '1', '2022-01-03', 1246, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 5, '2022-01-08', '2022-01-27', 4, 2, '2022-01-27 02:19:33', '2022-01-27 02:27:55', 0, 'Qonuniy o\'rganib ijrosini ta\'minlasin. ', 'Korrutsiya to\'g\'risida tug\'ruq bo\'limida doimiy xududiy huquqni muhofaza qiluvchi organlar tomonidan tibbiyot xodimlari o\'rtasida targ\'ibot ishlari olib borilmoqda. Shu bilan birga tug\'ruq bo\'limi joriy ta\'mirlashga vaqtincha yopilganda Viloyat Sog\'liqni saqlash boshqarmasiga maxsus xat chiqarish yo\'li bilan [ududiy tumanlardagi tug\'ruq bo\'limlari tumandagi tug\'ish yoshidagi xomilador ayollarni qabul qilishi to\'g\'risida tushuntirish berildi', '1643232475.2607.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1253, '2', '2022-01-03', 1247, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-08', '2022-01-27', 4, 2, '2022-01-27 02:37:45', '2022-01-27 02:43:10', 0, 'Muallif bilan uchrashib, taklifini o\'rganish va qonuniy tartibda javob xati berilsin', 'Tibbiyot birlashmaning qabul bo\'limida Milliy gvardiya boshqarmasiga qarashli qo\'riqlash xizmatining \"Ogoh chaqiruv tugmasi\" o\'rnatilgan bo\'lib, xavf tug\'ilganda 3-5 daqiqa ichida Milliy gvardiya boshqarmasining xududiy qo\'riqlash xodimlari yetib kelishi va mavjud xavfni bartaraf qilishi to\'grisida batafsil tushuntirildi', '1643233390.8674.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1254, '3', '2022-01-03', 1248, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 2, '2022-01-05', '2022-01-27', 1, 2, '2022-01-27 02:49:36', '2022-01-27 02:52:46', 0, 'mutaxassislar o\'rtasida o\'qib eshittirilsin va ijrosi ta\'minlansin', 'mazkur minnatdorchilik xatingiz tibbiyot xodimlari o\'rtasida o\'qib eshittirildi. Sizga  tibbiyot soxasiga qaratgan va xodimlarga bildirgan ishonchingiz uchun tibbiyot birlashma rahbariyati samimiy minnatdorchilik bildirib, mustahkam sog\'lik tilaydi', '1643233966.601.pdf', 301, NULL, 1, 0, NULL, NULL, NULL),
(1255, '4', '2022-01-03', 1249, NULL, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 5, '2022-01-08', '2022-01-27', 4, 2, '2022-01-27 03:02:19', '2022-01-27 03:07:14', 0, 'Tibbiyot xodimlar o\'rtasida o\'qib eshittirilsin va ijrosi ta\'minlansin', 'Мазкур миннатдорчилик хатингиз тиббиёт ходимлаари ўртасидаа ўқиб эшиттирилди ва Сизга тиббиёт бирлаашма раҳбарияти тиббиёт соҳасига қаратган эътиборингиз учун ўз ташаккурини билдириб, мустаҳкам соғлик тилайди', '1643234834.5765.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1256, '5', '2022-01-10', 1250, NULL, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-15', '2022-01-27', 4, 2, '2022-01-27 03:11:33', '2022-01-27 03:22:08', 0, 'Murojaatchi taklifini o\'rganib, qonuniy hal qilsin', 'Tibbiyot birlashma binosi 2022 yilda manzilli dastur asosida rekonstruktsiya qilinishi rejalashtirilganligi, ta]mirlash jarayonida yoki Salomatlik-4 loyihasi va boshqa grand mablag\'lari xisobidan jarrohlik bo\'limlarini jihozlash rejalashtirilganligi to\'g\'risida tushuntirish berildi', '1643235728.3954.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1257, '6', '2022-01-10', 1251, NULL, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-25', '2022-01-27', 4, 2, '2022-01-27 03:57:41', '2022-01-27 04:00:52', 0, 'muallif bilan uchrashib, masalasini o\'rganib qonuniy hal qilsin', 'Muassasa binosi 2022 yil 3-4-choragi davomida yangidan qurilish uchun loyiha hujjatlari tayyorlanganligi va birlashma rahbariyati VSSB va SSVga o\'z takliflar loyihasini taqdim qilganligi haqida tushuntirish berildi', '1643238052.9371.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1258, '7', '2022-01-10', 1252, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-15', '2022-01-27', 4, 2, '2022-01-27 04:18:31', '2022-01-27 04:22:42', 0, 'qonuniy o\'rganib, ijrosini ta\'minlasin', 'Mazkur apparat Salomatlik-4 loyihasi yoki boshqa grand mablag\'lari xisobidan olinishi yuzasidan tushuntirish berish yo\'li orqali hal qilindi', '1643239362.0785.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1259, '8', '2022-01-10', 1253, NULL, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-15', '2022-01-27', 4, 2, '2022-01-27 04:27:38', '2022-01-27 04:29:23', 0, 'Qonuniy o\'rganib ijrosini ta\'minlasin', 'Вog\'olon mahallasida joylashgan 64-son oilaviy poliklinikasi binosini qayta qurish yuzasidan 2020-2021 yillar davomida mazkur binoni qayta qurish yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga tibbiyot birlashma raxbariyati tomonidan takliflar loyihasi kiritilgan. Yuqoridagilarga asoslanib,  Viloyat Sog\'liqni saqlash boshqarmasi tomonidan O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligiga manzilli ro\'yxatga kiritish taklifi berilgan. Tibbiyot birlashma tizimidagi 64-son oilaviy poliklinikasi binosi 2022 yilning III-IV –choragida qayta qurish – ta\'mirlash  ishlari belgilanganligi to\'g\'risida tushuntiriladi.', '1643239763.0239.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1260, '9', '2022-01-10', 1254, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-15', '2022-01-27', 3, 2, '2022-01-27 04:33:55', '2022-01-27 04:38:35', 0, 'Mazkur taklifni o\'rganib qonuniy hal qilish uchun', 'O\'zbekiston Respublikasi Prezidentining 2019 yil 7 iyun kungi “O\'zbekiston Respublikasi aholisiga axborot-kutubxona xizmati ko\'rsatishni yanada takomillashtirish to\'g\'risida”gi PQ-4354-sonli Qarori amaliyotga joriy qilinganligi va bu borada tuman Xokimligida 2021 yilda markaziy kutubxona tashkil qilinib, o\'z ish faoliyayatini yuritayotganligini, shu bilan birga tibbiyot muassasalar internet tarmog\'iga ulangan kompyuter texnikalari bilan to\'liq jihozlanganligi, O\'zbekiston Respublikasi Prezidentining 2021 yil 26 martdagi  “Ma\'naviy-ma\'rifiy ishlar tizimini tubdan takomillashtirish chora-tadbirlari to\'g\'risida”gi PQ-5040-sonli qarori asosida tuman tibbiyot birlashmaning ma\'naviy uslubiy o\'quv xonasiga ham 15 turdan ortiq kitib va qo\'llanmalar homiylar ko\'magi aosisda olib keltirildi. O\'z bilimlaringizni mustahkamlashingiz hamda oliy va o\'rta ta\'lim muassasalarining amaliyotchi mutaxassislariga ham ustoz-shogird an-analariga sodiq qolgan xolda o\'qitish va amaliyotda o\'rganitish uchun barcha sharoitlar yaratilganligini bildiramiz.', '1643240315.0523.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1261, '10', '2022-01-10', 1255, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 5, '2022-01-15', '2022-01-27', 4, 2, '2022-01-27 11:20:12', '2022-01-27 11:22:53', 0, 'Muallif tomonidan berilgan taklifni o\'rganib chiqsin va qonuniy javob xati bersin', 'tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1643264573.725.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
