(1365, '11', '2022-01-10', 1347, 390, NULL, 'null', 'null', '[\"28\"]', '[\"28\"]', NULL, 5, '2022-01-15', '2022-02-04', 4, 2, '2022-02-04 05:57:35', '2022-02-04 06:02:20', 0, 'O\'rganib qonuniy hal qilsin', 'O\'zbekiston Respublikasi Prezidentining PQ-3494-sonli qarori va SSVning 80-sonli buyruqlari asosida Birlashma rahbariyati tomonidan yuqori turuvchi tashkilotlarga zarur tibbiy uskunalar bilan ta\'miblash to\'g\'risida so\'rovnoma berilganligi va shu asosda ta\\minlanishi to\'g\'risida tushuntirilda', '1643936540.8594.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1366, '12', '2022-01-10', 1348, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 10, '2022-01-20', '2022-02-04', 4, 2, '2022-02-04 06:09:11', '2022-02-04 06:10:46', 0, 'Qonuniy o\'rganib ijrosini ta\'minlasin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1643937046.3288.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1367, '13', '2022-01-10', 1349, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 10, '2022-01-20', '2022-02-04', 4, 2, '2022-02-04 06:16:36', '2022-02-04 06:17:24', 0, 'Qonuniy o\'rganib ijrosini ta\'minlasin', 'O\'zbekiston Respublikasi Sog’liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog’iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shatat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan oilaviy shifokorlik punktlarida  faoliyat yurituvchi xodimlarning shtatlar jadvali tasdiqlangan. Mazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir oilaviy poliklinika va oilaviy shifokorlik punktlari uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan 2022 yil                    1 yanvardan boshlab, OSHP mudiri, vrach stomatolog va hamshirasi, muolaja hamshirasi shtatlaridan tashqari shtatlar ajratilishi belgilanmaganligi to\'g\'risida tushuntirildi.', '1643937444.0614.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1368, '14', '2022-01-10', 1350, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-01-25', '2022-02-04', 4, 2, '2022-02-04 06:24:47', '2022-02-04 06:25:39', 0, 'Qonuniy hal qilsin ijrosini ta\'minlasin', 'O\'zbekiston Respublikasi Sog’liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog’iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shatat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan oilaviy shifokorlik punktlarida  faoliyat yurituvchi xodimlarning shtatlar jadvali tasdiqlangan. Mazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir oilaviy poliklinika va oilaviy shifokorlik punktlari uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan 2022 yil                    1 yanvardan boshlab, OSHP mudiri, vrach stomatolog va hamshirasi, muolaja hamshirasi shtatlaridan tashqari shtatlar ajratilishi belgilanmaganligi to\'g\'risida tushuntirildi.', '1643937939.2959.pdf', 301, 1, 1, 1, NULL, NULL, NULL),
(1369, '15', '2022-01-10', 1351, NULL, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-01-25', '2022-02-04', 4, 2, '2022-02-04 06:29:59', '2022-02-04 06:33:42', 0, 'taklif o\'rganilib, ijrosi qonuniy hal qilinsin ', 'O\'zbekiston Respublikasi Sog\'liqni Saqlash vazirligining 2021 yil 31 maydagi                     №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog\'iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shatat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan oilaviy shifokorlik punktlarida  faoliyat yurituvchi xodimlarning shtatlar jadvali tasdiqlangan. Mazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir oilaviy poliklinika va oilaviy shifokorlik punktlari uchun zarur bo\'lgan shtatlarda fizioterapiya xonalarida faoliyat ko\'rsatuvchi tibbiy xodimlar shtatlari ajratilishi 2022 yilgi tasdiqlaanadigan shtatlaar jadvalida belgilanganligi to\'g\'risida to\'liq ma\'lumot berish yo\'li orqali tushintirildi.', '1643938422.9573.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1370, '16', '2022-01-10', 1352, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-25', '2022-02-04', 4, 2, '2022-02-04 06:47:23', '2022-02-04 06:48:59', 0, 'ijrosini ta\'minlab qonuniy ko\'rib chiqsin', 'O\'zbekiston Respublikasi Sog’liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog’iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shatat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan oilaviy shifokorlik punktlarida  faoliyat yurituvchi xodimlarning shtatlar jadvali tasdiqlangan. Mazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir oilaviy poliklinika va oilaviy shifokorlik punktlari uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan 2022 yil                    1 yanvardan boshlab, OSHP mudiri, vrach stomatolog va hamshirasi, muolaja hamshirasi shtatlaridan tashqari shtatlar ajratilishi belgilanmaganligi to\'g\'risida tushuntirildi.', '1643939339.4133.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1371, '17', '2022-01-11', 1353, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-26', '2022-02-04', 4, 2, '2022-02-04 06:53:12', '2022-02-04 06:55:03', 0, 'qonuniy o\'rganib ijrosini ta\'minlasin', 'Sizning yuqoridagi murojaatingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  tibbiyot birlashma tarkibidagi jarrohlik bo’limlarini yangi zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilda Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach tibbiyot birlashma tarkibidagi jarrohlik bo’limlari yangi tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1643939703.3518.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1372, '18', '2022-01-11', 1354, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 10, '2022-01-21', '2022-02-04', 4, 2, '2022-02-04 10:45:03', '2022-02-04 12:49:09', 0, 'qonuniy o\'rganib hal qilinsin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1643960949.3525.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1373, '19', '2022-01-11', 1355, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-26', '2022-02-04', 4, 2, '2022-02-04 12:54:00', '2022-02-04 12:55:41', 0, 'ijrosini ta\'minlasin', 'Yangibozor tuman tibbiyot birlashmasi Sizning mazkur taklifingizga asosan quyidagilarni ma\'lum qiladi. Tibbiyot birlashma mas\'ullari tomonidan Sizga mazkur taklifingiz yuzasidan 2022 yilning I-II- choragida tibbiyot birlashma binolarida shu jumladan, Tug’ruq kompleksi manzilli davlat dasturi asosida rekonstruktsiya ishlari olib borilishi rejalashtirilgan. \r\nQurilish-ta\'mirlash jarayonida birlashmaga qarashli tug\'ruq kompleksi  binosiga qo\'shimcha 100 shifo o\'rinli bino qurilishi va tug\'ruq kompleksi maqomi “Perinatal  markaz” maqomiga o\'zgartirilib, ishga tushirilishi rejalashtirilgan. Shu bilan birga qurilish – ta\'mirlash ishlari  jarayonida perinatal markazga yangi zamonaviy tibbiy asbob-uskunalar shu jumladan, UTT apparati ham o\'rnatilishi belgilanganligi to\'g\'risida tushuntirildi.\r\n', '1643961341.0121.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1374, '20', '2022-01-11', 1356, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-26', '2022-02-04', 4, 2, '2022-02-04 12:59:13', '2022-02-04 13:01:08', 0, 'ijrosini ta\'minlasin', 'Mazkur xolat yuzasidan tuman tiibbiyot birlashmasi tuman Xokimligiga va xududiy gazta\'minot tashkilotiga bir necha bor Bog\'olon mahallasida joylashgaan 64-son oilaviy poliklinikasini tabbiy gazga ulash yuzasidan takliflar bilan murojaat qilinganligi va O\'zbekiston Respublikasi Prezidentining             2020 yil 24 sentyabr kungi “Tabbiy gaz nazorati va xisobini avtomatlashtirgan tizimini joriy etish to\'g\'risida”gi PQ-4840-sonli qarori va O\'zbekiston Respublikasi Vazirlar Mahkamasining 2018 yil 12 yanvardagi “Tabiiy gazdan foydalanish to\'g\'risida”gi 22-sonli Qaroriga muvofiq 2021-2026 yillarda tabiiy gazdan uzilgan xududlarni qayta gazlashtirish rejalashtirilganligi to\'g\'risida batafsil tushuntirildi.', '1643961668.5251.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1375, '21', '2022-01-13', 1357, 390, 390, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-28', '2022-02-04', 4, 2, '2022-02-04 13:07:45', '2022-02-04 13:08:34', 0, 'o\'rganib qonuniy ijrosini ta\'minlasin', 'O\'zbekiston Respublikasi Sog\'liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog\'iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan tibbiyot birlashma, ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shtat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga asosan Tez tibbiy yordam bshlimida faoliyat ko’rsatuvchi dispetcherlarning shtatlar jadvali tasdiqlangan. \r\nMazkur me\'yoriy xujjatda belgilanishi bo\'yicha har bir Tez tibbiy yordam bo’limi uchun zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan mazkur me\'yoriy xujjatda ko\'rsatilgan va belgilangan shtatlar jadvalidan tashqari shtat ajratish tibbiyot birlashma vakolatiga kirmasligi va mazkur shtatlar ajratish vakolatli tashkilot hamda Sog\'liqni saqlash vazirligi tomonidan ajratilganda ichki buyrug\'i asosida joriy qilinishi to\'g\'risida tushuntirildi.\r\n', '1643962114.4804.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1376, '22', '2022-01-14', 1358, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-29', '2022-02-04', 4, 2, '2022-02-04 15:38:41', '2022-02-04 15:40:58', 0, 'ijrosini ta\'minlab qonuniy hal qilsin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga Shoshilinch tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1643971258.1233.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
