(1422, '25', '2022-01-14', 1404, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-29', '2022-02-07', 4, 2, '2022-02-07 13:01:01', '2022-02-07 13:03:03', 0, 'Qonuniy o\'rganib ijrosini ta\'minlasin', 'O\'zbekiston Respublikasi Sog\'liqni Saqlash vazirligining 2021 yil 31 maydagi №06-14-5-17/5048-3-sonli, O\'zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining 2021 yil 31 maydagi №10-18-11-sonli va O\'zbekiston Respublikasi Moliya vazirligining 2021 yil 31 maydagi №28-01-01-12/3-sonli “Qoraqalpog\'iston Respublikasi va viloyatlar tuman (qishloq)larda joylashgan tibbiyot birlashma, ko\'p tarmoqli markaziy poliklinika(filial)lar tibbiyot va boshqa xodimlarning shtat me\'yorlari to\'g\'risida”gi me\'yoriy xujjatga tibbiyot va boshqa xodimlarning shtatlar jadvali tasdiqlangan. \r\nMazkur me\'yoriy xujjatda belgilanishi bo\'yicha zarur bo\'lgan shtatlar belgilangan va ajratilgan. Yuqoridagilarga  asosan mazkur me\'yoriy xujjatda ko\'rsatilgan va belgilangan shtatlar jadvalidan tashqari shtat ajratish tibbiyot birlashma vakolatiga kirmasligi va mazkur shtatlar ajratish vakolatli tashkilot hamda Sog\'liqni saqlash vazirligi tomonidan ajratilganda ichki buyrug\'i asosida joriy qilinishi to\'g\'risida tushuntirildi.\r\n', '1644220983.014.pdf', 301, 1, 1, 1, NULL, NULL, NULL),
(1423, 'ФЭ-О-168', '2022-02-07', 1405, 2, 5, '[\"5\"]', NULL, 'null', NULL, NULL, 15, '2022-02-22', NULL, 1, 0, '2022-02-07 13:03:15', '2022-02-07 13:03:15', 0, 'Мурожаатни кўриб чиқиб, кўтарилган масалани ўрнатилган тартибда хал қилиб, натижаси ҳақида муаллифга жавоб хати тайёрлансин. ', NULL, NULL, 1, 0, 1, 0, NULL, NULL, NULL),
(1425, '26', '2022-01-14', 1407, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-29', '2022-02-07', 4, 2, '2022-02-07 13:06:05', '2022-02-07 13:07:52', 0, 'ijrosini ta\'minlab axborot kiritsin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.', '1644221272.4976.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1426, 'ФЭ-Ў-167', '2022-02-07', 1408, 2, 6, '[\"6\",\"12\"]', NULL, 'null', NULL, NULL, 15, '2022-02-22', NULL, 1, 0, '2022-02-07 13:06:55', '2022-02-07 13:06:55', 0, 'Мурожаатни кўриб чиқиб, кўтарилган масалани ўрнатилган тартибда хал қилиб, натижаси ҳақида муаллифга жавоб хати тайёрлансин. ', NULL, NULL, 1, 0, 1, 0, NULL, NULL, NULL),
(1427, '27', '2022-01-14', 1409, 390, NULL, '[\"390\"]', '[\"390\"]', 'null', 'null', NULL, 15, '2022-01-29', '2022-02-07', 4, 2, '2022-02-07 13:10:53', '2022-02-07 13:12:57', 0, 'Ijrosini ta\'minlab axborot kiritsin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\nShu bilan birga mazkur taklifingizda ko\'rsatilgan tibbiy asbob-uskunalar “Salomatlik-4” loyihasi yoki boshqa grand mablag\'lari xisobidan ta\'minlanishi natijasida Yangibozor tumanida tashkil qilish mumkinligini bildiramiz. \r\n', NULL, 301, 1, 1, 0, NULL, NULL, NULL),
(1428, '28', '2022-01-14', 1410, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-01-29', '2022-02-07', 4, 2, '2022-02-07 13:29:17', '2022-02-07 13:32:48', 0, 'ijrosini ta\'minlab axborot kiritsin', 'Sizning yuqoridagi taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan birlashmada va tizimdagi BTSYoMlarida yuqumli va yuqumsiz kasalliklarning oldini olsh va profilaktik ko’riklar shu jumladan, jarroxlik amaliyotlari, tibbiy muolajalarning sifatli o’tkazilishi yuzasidan tizimda mavjud tibbiy bikslarni yangilash yuzasidan Viloyat Sog’liqni saqlash boshqarmasiga manzilli yo’l xaritasi ishlab berilganligi, bundan tashqari Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari joriy yilda rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\nShu bilan birga mazkur taklifingizda ko\'rsatilgan tibbiy asbob-uskunalar shu jumladan tibbiy bikslar “Salomatlik-4” loyihasi yoki boshqa grand mablag\'lari xisobidan ta\'minlanishi natijasida Yangibozor tumanida tashkil qilish mumkinligini bildiramiz.\r\n', '1644222768.6969.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1429, '29', '2022-01-14', 1411, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-01-29', '2022-02-07', 4, 2, '2022-02-07 13:35:41', '2022-02-07 13:38:03', 0, 'qonuniy o\'rganib ijrosini ta\'minlasin', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi mas\'ullari tomonidan o\'rganilib, Sizga quyidagilar tushuntiriladi. Ya\'ni, O\'zbekiston Respublikasi Prezidentining          2020 yil 12 noyabrdagi  “Birlamchi tibbiy sanitariya yordami muassasalari faoliyatiga mutloqo yangi mexanizmlarini joriy qilish va sog\'liqni saqlash tizimida olib borilayotgan islohatlar samaradorligini yanada oshirish chora-tadbirlari to\'g\'risida”gi PF-5952-sonli Farmoniga asosan xududlarda tashkil qilingan tibbiy brigadalarni tibbiy asbob-uskunalar shu jumladan, plonshetlar bilan ta\'minlash tuman Xokimliklari zimmasiga yuklatilgan edi. Mazkur xolat yuzasidan tibbiyot birlashma rahbariyati tumandagi 106 nafar patronaj 30 ta tibbiy brigadalarni plonshetlar va tibbiy buyumlar bilan ta\'minlash yuzasidan tuman Xokimligiga maxsus xat orqali murojaat qilganligi, tuman Xkimligidan Byudjet parametrlari to\'g\'risidagi Qonunga muvofiq mahalliy byudjet mablag\'lari xisobidan 2021-2023 yillarda barcha tibbiy brigadar plonshet va tibbiy vositalar bilan ta\'minlanishi to\'g\'risida yozma ma\'lumot berilganligi to\'g\'risida batafsil tushuntirildi.', '1644223083.9015.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
