(1445, '30', '2022-01-15', 1427, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-01-30', '2022-02-08', 4, 2, '2022-02-08 23:37:36', '2022-02-08 23:39:38', 0, 'o\'rganib ijrosini ta\'minlasin', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi mas\'ullari tomonidan o\'rganildi va Sizga quyidagilar tushuntirildi. O\'zbekiston Respublikasi Prezidentining PF-6099-sonli Farmoni va 12.11.2020 yildagi PQ-6110-sonli Qarori asosida Viloyat Sog\'liqni saqlash boshqarmasi, Viloyat Xokimligi va Tuman Xokimligi va boshqa hamkor tashkilotlar hamkorligida aholi salomatligini mustahkamlash yuzasidan bir qator islohatlar amalga oshirilib, manzilli yo\'l xaritalar tasdiqlangan va ijroga kiritilgan. Shu bilan birga mazkur Farmon va Qaror ijrosini ta\'minlash yuzasidan mahallalarda “Salomatlik uchun 5000 qadam” shiori ostida sog\'lomlashtirish marafon (kun)lari o\'tkazilib kelinmoqda. Shu bilan birga mahalalalar xududlarida joylashgaan maktablar binolarining va tibbiyot birlashmaning fizioterapiya zallarida maxsus moslamalar (trenajor texnikalar) o\'rnatilganligi, aholi va tibbiyot xodimlari foydalanishi uchun doimiy mazkur muassasalar zallari ochiqligi to\'g\'risida tushuntirildi.', '1644345578.8056.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1446, '31', '2022-01-18', 1428, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-02', '2022-02-08', 4, 2, '2022-02-08 23:44:13', '2022-02-08 23:46:10', 0, 'Qonuniy o\'rganib ijrosini ta\'minlash uchun', 'Sizning mazkur taklifingiz Yangibozor tuman tibbiyot birlashmasi raaxbariyati tomonidan o\'rganildi va Sizga quyidagilar tushuntirildi.\r\nBugungi kunda O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligi tomonidan joriy qilingan buyruqlar va ishlab chiqilgaan Nizomlarda tibbiyot va farmatsevtika xodimlarini ish formasi bilan ta\'minlaash to\'g\'risida belgilab berilmaganligi, ammo Mehnatni muhofaza qilish to\'g\'risidagi Qonunning tegishli moddalarida mazkur taklifingizda ko\'rsatib o\'tilgan vajlar \r\nya\'ni, tibbiyot va boshqa xodimlarni maxsus kiyim bosh bilan ta\'minlash belgilangan. Ammo mahalliy byutdet tomonidan tibbiyot birlashmaning smeta xarajatlarida tibbiyot va boshqa xodimlarning ish formalari uchun qo\'shimcha mablag\'lar ajratilmaganligi va smeta xarajatlarida nazarda tutilmaganlgi sababli mazkur taklifingizda ko\'rsatilgan xolatlarni bartaraf qilib, ijobiy hal qilishning imkoni yo\'q. Shu bilan birga tibbiyot birlashmaning joriy yil smeta xarajatlarida mahalliy byudjet (tuman Xokimligi va Moliya bo\'limi) tomonidan qo\'shimcha mablag\'lar ajratilsa birlashmaning ichki imkoniyatlari xisobga olingan xolda barcha tibbiyot xodimlari shu jumladan, patronaj hamshiraalar ham qishki va yosh mavsumi uchun to\'liq ish formasi bilan byudjet xisobidan ta\'minlanishi rejalashtirilganligi tushuntirildi.\r\n', '1644345970.5395.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1447, '32', '2022-01-17', 1429, 390, NULL, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-01', '2022-02-09', 4, 2, '2022-02-09 02:12:00', '2022-02-09 02:13:40', 0, 'O\'rganib qonuniy ijrosini ta\'minlasin', 'Sizning mazkur taklifingiz yuzasidan tibbiyot birlashma mutaxassislari quyidagilarni tushuntirishdi. Ya\'ni, O\'zbekiston Respublikasi Prezidentining            2018 yil 25 yanvardagi “Shoshilinch tibbiy yordam tizimini jadal takomillashtirish chora-tadbirlari to\'g\'risida”gi PQ-3494-sonli qarori hamda O\'zbekiston Respublikasi Prezidentining 2018 yil 16 oktyabrdagi “O\'zbekiston Respublikasida tez tibbiy yordam xizmatini takomillashtirish chora-tadbirlari to\'g\'risida”gi              PQ-3973 yuzasidan O\'zbekiston Respublikasi Sog\'liqni saqlash vazirligining              105-sonli buyrug\'i ishlab chiqilganligi va shu asosida hududlar aholisiga Tez tibbiy yordam bo\'limlari tomonidan tibbiy xizmat ko\'rsatish belgilangan. Shu bilan birga tumanning “Bog\'olon” va “Yangiobod” mahallalarida Tez tibbiy yordam shahobchalari tashkil qilinib, faoliyati yo\'lga qo\'yilganligi to\'g\'risida  tushuntirildi.', '1644354820.2949.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
