(1604, 'S-1', '2022-02-14', 1038, 494, NULL, NULL, NULL, NULL, NULL, 44, 15, '2022-01-30', '2022-02-25', 1, 2, '2022-02-14 11:44:44', '2022-02-25 17:20:24', 0, 'Belgilangan tartibda ishga joylashtirish chorasini ko`rib, natijasi bo`yicha hujjat taqdim qiling ', 'Murojaati yuzasidan ishsizlik nafaqasi tayinlangan', '1645791624.3556.pdf', 406, NULL, 1, 0, NULL, NULL, NULL),
(1605, 'S-2', '2022-02-14', 1043, NULL, NULL, NULL, NULL, NULL, NULL, 50, 15, '2022-01-30', NULL, 4, 2, '2022-02-14 11:52:18', '2022-02-25 17:25:01', 0, NULL, 'Tuproqqal‘a tuman Aholi bandligiga ko‘maklashish markazi tomonidan, Sizning 2022-yil 14-fevral sanasida Ishonch telefoni orqali ishga joylashishingizda amaliy yordam so‘rab qilgan murojaatingiz o‘rganilib, quyidagilar ma‘lum qilinadi. \r\nSizning ishga joylashishingiz bo‘yicha o‘rganilganda, yuqorida ko‘rsatilgan manzilda yashashingiz, ma‘lumotingiz o‘rta ekanligi aniqlandi. Markazga tumandagi korxona va tashkilotlar tomonidan 2022-yil fevral oyi uchun berilgan ma‘lumotlaridagi bo‘sh ish o‘rinlarida mutaxassisligingiz bo‘lmaganligi sababli, mutaxassislik talab qilinmaydigan “Tuproqqal‘a global food” MCHJda ishchi, ish yurituvchi (oylik maoshi ishbay usulida) hamda “Marjona Saboxon” MCHJda ishchi (oylik maoshi ishbay usulida) vazifalari taklif qilinganda, taklif qilingan bo‘sh ish o‘rinlaridan “Tuproqqal‘a global food” MCHJda ishchi vazifasi maqbul kelganligi sababli, mart oyidan ish boshlashingiz uchun hujjatlaringizni topshirishingiz ma‘lum qilinganligi to‘g‘risida tushuntirish xati yozishdan bosh tortgansiz.                           \r\nShuningdek, Sizga O‘zbekiston Respublikasi Bandlik va mehnat munosabatlari vazirligining internetdagi ish.mehnat.uz sayti orqali yoki har oyning 5-sanasida markazda yangilanib boriladigan bo‘sh ish o‘rinlari bilan tanishib, o‘zingizga maqbul keladigan bo‘sh ish o‘rinlarini tanlab markazga belgilangan tartibda murojaat qilishingiz mumkinligi to‘g‘risida hamda Adliya vazirligidan 2020-yil 20-oktyabrda 642-son bilan ro‘yxatdan o‘tgan “Aholi bandligi to‘g‘risida”gi Qonuni talablari haqida tushuntirildi.       \r\nUshbu javob xatidan norozi bo‘lgan taqdirda O‘zbekiston Respublikasi “Jismoniy va yuridik shaxslarning murojaatlari to‘g‘risida”gi Qonunining 32-moddasiga asosan yuqori turuvchi organga yoki sudga murojaat qilish huquqiga ega ekanligingiz ma‘lum qilinadi.\r\n\r\n', '1645791901.6814.pdf', 406, 1, 1, 0, NULL, NULL, NULL),
