(1647, '34', '2022-01-22', 1598, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-06', '2022-02-15', 2, 2, '2022-02-15 01:17:58', '2022-02-15 01:23:51', 0, 'Tibbiy ko\'rik tashkil etilsin amaliy yordam ko\'rsatilib, axborot kiritsin', 'Tumanmutaxassisari tomonidan tibbiy ko\'rikdan o\'tkazilib, bemorning talabiga ko\'ra ambularor davo muolajalari tayinlanib, zarur dori vositalari berilishi ta\'minlandi', '1644870231.8646.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1648, '35', '2022-01-28', 1599, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-12', '2022-02-15', 2, 2, '2022-02-15 01:51:17', '2022-02-15 01:55:07', 0, 'ishchi gurux tashkil qilib, murojaatini o\'rganib ijrosini ta\'milasin', 'Mutaxassislar tomonidan tibbiy ko\'rikdan o\'tkazilib, zarur dori vositalari berildi. Viloyat muassasasiga ko\'z jarroxligi uchun order ham berilishi ta\'minlandi. ammo tuman mutaxassislari tomonidan ko\'rsatilgan barcha amaliy yordamni rad qildi', '1644872107.9405.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1649, '36', '2022-01-18', 1600, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-02', '2022-02-15', 2, 2, '2022-02-15 02:02:30', '2022-02-15 02:09:33', 0, 'tibbiy ko\'rik tashkil qilib amaliy yordam ko\'rsatilib, ijrosi ta\'minlansin va axborot kiritsin', 'Fuqaro va uning qizi S.Jumaniyazovaga tibbiy ko\'rikdan o\'tkazildi va stasionar sharoitda davolanish uchun zarur sharoitlar yaratib berilsada fuqaro R.Jumaniyazov o\'zining va qizining sog\'ligiga panja orasidan qarab tibbiyot birlashmani tark etdi', '1644872973.2112.pdf', 301, 1, 1, 1, NULL, NULL, NULL),
(1650, '37', '2022-01-18', 1601, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-02', '2022-02-15', 2, 2, '2022-02-15 04:11:59', '2022-02-15 04:15:17', 0, 'Qonuniy hal qilsin', 'O‘rganish kuni tuman utaxassislari Sizning xonadoningizda bo‘lishib, tibbiy ko‘rikdan o‘tkazishdi va Sizga “Yurak ishemik kasalligi zo‘riqish stenokardiyasi funksional sinf III darajasi. Yondosh kasalligi Gipertoniya kasalligi. AG-II bosqich. Xavf xatar II darajasi” tashxisi qo‘yilib, ambulator davo muolajalari tayinlangan va 64-son oilaviy poliklinikada mavjud dori vositalari berilishi ta’minlangan.\r\nShu bilan birga Sizga sog‘ligingizni tiklash uchun o‘z talablaringizdan kelib chiqib,  2022 yil aprel oyida Respublika ixtisoslashtirilgan Kardiologiya ilmiy amaliy tibbiyot markazi Xorazm filialiga order berilishi rejalashtirilib,  elekrton bazaga kiritilib mazkur murojaatingiz qanoatlantirildi.\r\n', '1644880517.1311.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1651, '38', '2022-01-27', 1602, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-11', '2022-02-15', 2, 2, '2022-02-15 04:23:14', '2022-02-15 04:29:02', 0, 'Ijrosini taminlasin qonuniy ko\'rib chiqsin', 'O\'rganish natijasida tuman mutaxasislari tomonidan Sizga “Ikki tomonlama idiopatik koksoartroz o\'ngda II-III, chapda IV darajasi, asseptik nekrozi og\'riq sindromi bilan” tashxisi qo\'yilganligi va 2021 yil avgust oyida 99-son Shovot tumanlararo TIEK tomonidan II gurux nogironligi ikki yil muddatga berilganligi aniqlandi. \r\nSizga mazkur murojaatingiz yuzasidan tibbiyot birlashma va Tibbiy ijtimoiy xizmatlarni rivojlantirish boshqarmasi Yangibozor tuman bo\'limi  mas\'ullari endoprotez vositasi O\'zbekiston Respublikasida ishlab chiqarilmasligi, bu maxsulotni olib berish tibbiyot birlashma vakolatiga kirmasligi to\'g\'risida tushuntirilib, maxsulotni xomiylar ko\'magi yoki shaxsiy jamg’armangiz asosida chet el davlatlaridan xarid qilishingiz mumkinligi va Siz bu amaliyotni amalga oshirib, endoprotez vositasini olsangiz, tibbiyot birlashmasida jarroxlik amaliyoti o\'tkazilishi va zaruriy dori-vositalar va tibbiy buyumlar bilan ta\'minlashda amaliy yordam berilishi to\'g\'risida tushuntirildi. \r\nBundan tashqari Sizning xolatingiz mutaxassislar tomonidaan e\'tiborga olingan xolda Tibbiy ijtimoiy xizmatlarni rivojlantirish boshqarmasi Yangibozor tuman bo\'limi tomonidan bugungi kunda O\'zbekiston Respublikasi Prezidentining 22-sonli Qaroriga muvofiq nogironligi va surunkali kasalligi bo\'lgan aholini xatlovdan o\'tkazish bazasiga endoprotez vositasi bilan ta\'minlash uchun ro\'yxatga olinib, navbatga qo\'yildingiz. \r\n', '1644881342.3413.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1652, '39', '2022-01-27', 1603, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-11', '2022-02-15', 2, 2, '2022-02-15 04:34:28', '2022-02-15 04:36:08', 0, 'Ijrosini taminlab qonuniy hal qilsin', 'O\'rganish natijasida bemor tuman kardiolog shifokori xonasida “Yurak ishemik kasalligi. Zo\'riqish stenokardiyasi. Funktsional sinf III darajasi. Gipertoniya kasalligi. AG-II bosqich. Xavf xatar  IV – darajasi. Yondosh kasalligi: Surunkali bronxit qo\'zish davri. Asorati: Surunkali yurak yetishmovchiligi                     II darajasi Funktsional sinf III-darajasi” tashxisi bilan dispanser xisobda turgan va doimiy ambulator hamda statsionar sharoitda davolanib kelganligi aniqlandi. \r\n2021 yil dekabr oyida RIKIATM Xorazm filialida yurak qon tomir jarroxlik amaliyoti o\'tkazilgan. Hozirda tibbiy ko\'rikdan o\'tish va davolanish uchun moddiy sharoiti og\'irligi sababli RIKIATM Xorazm filialida tibbiy ko\'rikdan o\'tish uchun order berilishi ta\'minlanib, mazkur murojaat to\'liq qanoatlantirildi.\r\n', '1644881768.5712.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1653, '40', '2022-02-07', 1604, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-22', '2022-02-15', 2, 2, '2022-02-15 04:43:22', '2022-02-15 04:50:12', 0, 'qonuniy o\'rganiib ijrosini taminlasin', 'O\'rganishda Sizning 1977 yilda tug\'ilgan turmush o\'rtog\'ingiz Jumatov Javlon Po\'latovich 2008 yildan buyon “kamqonlik og\'ir darajasi. Surunkali                   12 barmoqli ichak kasalligi bilan (2010 yil jarroxlik amaliyoti o\'tkazilgan)” tashxisi bilan dispenser xisobga olinib, muntazam davolanib kelayotganligi aniqlandi.\r\nSizga tibbiyot birlashma  mutaxassislar tomonidan moddiy yordam olish tartibi yuzasidan huquqiy maslahat berilishi ta\'minlandi. Ya\'ni, moddiy yordam ajratish tibbiyot birlashma vakolatiga kirmasligi sababli o\'zingiz yashash xududingizdagi mahalla fuqarolar yig\'iniga yoki xududiy xokimlik organlariga murojaat qilish tartibi tushuntirildi. \r\nShu bilan birga turmush o\'rtog\'ingiz Jumatov Javlon Po\'latovichni 2022 yil             8 fevral kuni tuman markaziy poliklinikasida chuqurlashtirilgan tibbiy ko\'rikdan o\'tkazilib, yuqoridagi tashxis bilan Viloyat ko\'p tarmoqli tibbiyot markazining Gematologiya bo\'limida statsionar sharoitda davolanish uchun bepul yo\'llanma (order) berilishi ta\'minlanib, Sizning mazkur murojaatingiz mutaxassislar tomonidan qanoatlantirildi.\r\n', '1644882612.9505.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
