(1666, '2', '2022-02-15', 1475, NULL, NULL, NULL, NULL, NULL, NULL, 191, 15, '2022-02-26', NULL, 4, 2, '2022-02-15 17:18:57', '2022-02-24 16:13:51', 0, NULL, 'Аризагўй Раманова Санобарнинг \"Кўча йўлини таъмирлаш\" тўғрисида қилган мурожаатига асосан Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганиш ишлари олиб борилди. Ўрганишда, маҳаллий аҳамиятига эга 4Н 1937 \"Урганч-Гурлан-Юқоридўрман-Урганч-Чолиш\" автомобил йўли таъмирталаб ҳолатда эканлиги аниқланди. Ушбу автомобиль йўлида, пудратчи корхона Урганч туман йўллардан фойдаланиш унитар корхонаси  томонидан 2022 йилнинг 2-ярим йиллигида таъмирлаш ишлари амалга ошириш режалаштирилганлиги тўғрисида аризагўй Раманова Санобарга тушунтирилди.   ', '1645701231.1028.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
(1667, '3', '2022-02-15', 1546, NULL, NULL, NULL, NULL, NULL, NULL, 263, 15, '2022-02-27', NULL, 4, 2, '2022-02-15 17:21:06', '2022-02-24 16:32:30', 0, NULL, 'Аризагўй фуқаро Саидова Жумагулнинг \"кўча йўлини таъмирлаш ва тунги ёритгичлар ўрнатишда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганишда, мурожаатда кўрсатилган  йўл  Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармасига қарашли ички хўжалик йўли эканлиги аниқланди. Ушбу мурожаатда келтирилган \"Янгиобод\" маҳалласидаги ички хўжалик йўллари  Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантирилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч туман ҳокимлиги, туман Ободонлаштириш бошқармаси ва \"Янгиобод\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Саидова Жумагулга тушунтирилди.      	', '1645702350.9474.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
(1668, '4', '2022-02-15', 1549, NULL, NULL, NULL, NULL, NULL, NULL, 266, 15, '2022-02-27', NULL, 4, 2, '2022-02-15 17:21:27', '2022-02-24 16:45:26', 0, NULL, 'Аризагўй Жуманова Дилафрузнинг \"маҳалласидаги йўлларни таъмирлаб беришда амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Урганч туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганиш ишлари олиб борилди.  Ушбу мурожаатда келтирилган Х.Олимжон маҳалласи ички хўжалик йўли туман ҳокимлиги балансида бўлиб,  уларни таъмирлаш учун ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантирилади. Агарда, Урганч тумани Ҳокими томонидан Х.Олимжон маҳалласи \"Манзилли дастурга\" киритиш бўйича таклиф берилиб, молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, белгиланган пудратчилар томонидан 2022-2023 йилларда босқичма-босқич таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Жуманова Дилафрузга тушунтирилди.       ', '1645703126.5295.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
(1669, '3-Д-97', '2022-02-15', 1557, NULL, NULL, NULL, NULL, NULL, NULL, 278, 15, '2022-02-27', NULL, 4, 2, '2022-02-15 17:45:47', '2022-02-24 16:26:49', 0, NULL, 'Мурожаат килувчи Ю.Джумабоева бугунги кунда доимий иш ва даромадга эга эмаслиги ва турар жойни куришда ёрдам масаласи буйича мурожаат килувчига банк томонидан 11.03.2021й даги ПФ 6186 карор хамда ушбу карор талаблари жумладан доимий даромадга эга булиши ва кредитни уз муддатида сундириб бориши лозимлиги тушунтирилди', '1645702009.9205.pdf', 446, 1, 1, 0, NULL, NULL, NULL),
(1670, '10', '2022-02-15', 1455, NULL, NULL, NULL, NULL, NULL, NULL, 166, 15, '2022-02-26', NULL, 4, 2, '2022-02-15 17:53:13', '2022-02-23 18:58:54', 0, NULL, '\"Асакабанк\"АЖ кредит сиёсатининг 42-бандига асосан кредит ва унга тенглаштирилган операциялар буйича сундирилмаган муддати утган карздорлик мавжуд булган такдирда янги микромолиявий хизматлар курсатишга йул куйилмаслиги тушунтирилди.', '1645624734.7074.pdf', 422, 1, 1, 0, NULL, NULL, NULL),
