(1728, '36', '2022-02-15', 1661, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-03-02', '2022-02-18', 4, 2, '2022-02-18 23:55:15', '2022-02-18 23:57:00', 0, 'Qonuniy o\'rganib, ijrosini taminlasin', 'O\'rganish natijasida Sizning mazkur taklifingizda ko\'rsatib o\'tilgan xolatlar to\'liq ko\'rib chiqildi natijada haqiqatdan ham bugungi kunda tez tibbiy yordam bo’limida mavjud tibbiy jihozlar va tibbiy asbob-uskunalarning ayrimlari yangilashga va zamonaviy tibbiy asbob-uskunalarga ehtiyoj mavjudligi aniqlandi. Shu bilan birga Sizga bo’limda yetishmaydigan dori-darmonlar RSHTYoIM Xorazm filialidan Sizning bo’lim tomonidan berilgan talabnoma asosida yetkazib berilayotganliga va o’z vaqtida  RSHTYoIM Xorazm filiali tomonidan berilgan ehtiyojga asosan to’iq ta’minlab berilayotganligi to’g’risida tushuntirildi.\r\nSizning yuqoridagi tibbiy uskunalarni yzngilash yuzasidan bergan taklifingiz yuzasidan Sizga tibbiyot birlashma raxbariyati quyidagicha izohlaydi. Ya\'ni, tibbiyot birlashma raxbariyati tomonidan tuman aholisiga tibbiy xizmat ko\'rsatish sifatini yaxshilash maqsadida  zarur zamonaviy tibbiy asbob-uskunalar va jihozlar bilan ta\'minlash yuzasidan tuman Xokimligi va Viloyat Sog\'liqni saqlash boshqarmasiga takliflar kiritilgan. Bundan tashqari 2022 yilning II-III-choragida Tibbiyot birlashma manzilli davlat dasturi asosida rekonstruktsiya-ta\'mirlash ishlari rejalashtirilganligi, ta\'mirlash jarayoni yakuniga yetkazilgach zamonaviy tibbiy asbob-uskunalar bilan jihozlash nazarda tutilganligi to\'g\'risida batafsil tushintirildi.\r\n', '1645210620.3461.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1729, '', '2022-02-02', 1662, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-02-17', '2022-02-19', 2, 2, '2022-02-19 00:11:58', '2022-02-19 00:13:16', 0, 'Tibbiy ko\'rik tashkil qilib, sog\'lomlashtirish cholasi ko\'rilsin ijrosi taminlansin', 'O\'rganish natijasida Siz tuman ko\'p tarmoqli markaziy poliklinikasi infektsionist shifokori xonasida “B-20” kasalligi bilan dispanser xisobda turishingiz, doimiy shifokor nazoratida Sizga amabulator sharoitda tibbiy xizmat ko\'rsatib kelingan.\r\nShu bilan birga tibbiyot birlashmasida o\'tkazilgan tibbiy ko\'rik natijasida Sizga “Virusli popilloma” tashxisi qo\'yilib, Viloyat ko\'p tarmoqli tibbiyot markazining Septik xirurgiya bo\'limiga statsionar sharoitda davolanish uchun order berilishi ta\'minlanib, mazkur murojaatingiz qanoatlantirildi. \r\n', '1645211596.3819.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1730, '', '2022-02-18', 1663, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-03-05', '2022-02-28', 1, 2, '2022-02-19 00:56:19', '2022-02-28 13:09:57', 0, 'Ijrosini taminlasin', 'Мазкур мурожаат қаноатлантирлди', '1646035797.5214.pdf', 301, NULL, 1, 0, NULL, NULL, NULL),
(1731, '42', '2022-02-18', 1664, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-03-05', '2022-02-19', 5, 2, '2022-02-19 01:07:24', '2022-02-19 01:09:39', 0, 'Qonuniy tartibda ko\'rib chiqsin va ijrosini taminlasin', 'O\'rganish natijasida Siz Toshkent Tibbiyot Akademiyasi Urganch filialining Pediatriya fakulteti Oliy hamshiralik yo\'nalishi bo\'yicha 3-kursda o\'qiyotganliginigiz va shu yili oliy ta\'lim muassasasini tugatishingiz aniqlandi.\r\n	Sizga hozirda Yangibozor tuman tibbiyot birlashmasida mavjud shatat birligi 450,5 shtatni tashkil qilib, ushbu shtat birligida  jami 565 nafar  xamshira ishlab kelmoqda. Shu sababli hozirgi kunda tuman Tibbiyot birlashmasida hamshiralik (Oliy yoki o\'rta) ishi bo\'yicha bo\'sh ish o\'rni mavjud emasligi sababli vazkur murojaatingiz rad qilindi.\r\n', '1645214979.954.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
(1732, '42', '2022-02-18', 1665, 390, 390, '[\"390\"]', '[\"390\"]', '[\"28\"]', '[\"28\"]', NULL, 15, '2022-03-05', '2022-02-19', 5, 2, '2022-02-19 01:16:26', '2022-02-19 01:18:02', 0, 'Qonuniy o\'rganib ijrosini taminlasin', 'Siz Toshkent Tibbiyot Akademiyasi Urganch filialining Pediatriya fakulteti Oliy hamshiralik yo\'nalishi bo\'yicha 3-kursda o\'qiyotganliginigiz va shu yili oliy ta\'lim muassasasini tugatishingiz aniqlandi.\r\n	Sizga hozirda Yangibozor tuman tibbiyot birlashmasida mavjud shatat birligi 450,5 shtatni tashkil qilib, ushbu shtat birligida  jami 565 nafar  xamshira ishlab kelmoqda. Shu sababli hozirgi kunda tuman Tibbiyot birlashmasida hamshiralik (Oliy yoki o\'rta) ishi bo\'yicha bo\'sh ish o\'rni mavjud emasligi sababli mazkur murojaatingiz rad qilindi\r\n', '1645215482.3942.pdf', 301, 1, 1, 0, NULL, NULL, NULL),
