(1864, '7', '2022-02-25', 1745, NULL, NULL, NULL, NULL, NULL, NULL, 366, 15, '2022-03-12', NULL, 4, 2, '2022-02-25 17:30:23', '2022-03-07 12:12:33', 0, NULL, 'Ушбу масала юзасидан мутахасислар томонидан урганилиб фукаро\r\nБекчанова Дилором Тахировнага Узбекистан Республикаси Президентининг\r\n“Хизматлар сохасини жадал ривожлантириш чора-тадбирлари тугрисида”\r\n2021 йил 11 майдаги ПК;-5113-сон карори хамда “Кучма савдо фаолиятига\r\nахборот технологияларини жорий этиш ва савдо автомати оркали чакана\r\nсавдо фаолияти билан шугулланувчи тадбиркорлик субъектларини куллаб-\r\nкувватлаш чора-тадбирлари тугрисида” 2021 йил 4 шондагн\r\nПК-5136-сон карори ижросини таъминлаш,ва Вазирлар Махкамасшшнг\r\n03.08.2021 йил № 485 сонли карорларига асосан кучма савдони амалга\r\nошириш “К>савдо” автоматлаштирилган ахборот тизими электрон\r\nилатформаси оркали аукционда катнашиб олиши мумкинлиги\r\nтушинтирилди.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум Kitano, аглрда\r\nжавобдан норози булган такдирингизда юкори турувчи органга мурожаат\r\nкилишингиз мумкинлигини билдирамиз.', '1646637153.9266.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(1865, '8', '2022-02-25', 1757, NULL, NULL, NULL, NULL, NULL, NULL, 392, 15, '2022-03-12', NULL, 4, 2, '2022-02-25 17:34:17', '2022-03-02 10:38:20', 0, NULL, 'Вилоят курилиш бош бошкармаси томонидан Урганч шахар, Жамбул махалласи,\r\nМустакиллик кучаси 3-йулак, 85-уйда яшовчи фукаро Адамбаев Улугбекнинг Куча\r\nкисмини асфаът килиш, нотурар курилишига тускинлик килаётган бекатни йикитишни\r\nсураган.\r\nФукаро Адамбаев Улугбекнинг мурожаатида курсатиб утилган холатларни\r\nУзбекистон Республикасининг “Жисмоний ва юридик шахсларнинг мурожаатлари\r\nтугрисида”ги Конунининг 25-моддасига биноан тегишлилиги буйича ваколат доирасида\r\nкуриб чикиб, муаллифга жавоб бериш учун юбормокда.', '1646199500.5825.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(1866, '9', '2022-02-25', 1758, NULL, NULL, NULL, NULL, NULL, NULL, 400, 15, '2022-03-12', NULL, 4, 2, '2022-02-25 17:35:33', '2022-03-07 12:01:18', 0, NULL, ' фукаро Сапаев Файзуллонинг мурожаати юзасидан', NULL, 263, 1, 1, 0, NULL, NULL, NULL),
(1867, '10', '2022-02-25', 1770, NULL, NULL, NULL, NULL, NULL, NULL, 424, 15, '2022-03-12', NULL, 4, 2, '2022-02-25 17:36:26', '2022-03-07 11:53:43', 0, NULL, 'обчаси” биноси курилиши учун Хива шахар хокимининг 2018 йил 24-июлдаги\r\n1274-сонли карори билан 100 кв метр ер майдони ажратилган ва ушбу карорга\r\nасосан “Савдо шахобчаси” биносини лойихалаштириш учун вилоят курилиш бош\r\nбошкармаси томонидан 06.01.2020 йилда 14-20/А-сонли APT (Архитектура\r\nрежалаштириш топшириги) хужжатлари ишлаб чикилган.\r\nМазкур хужжатларга асосан ер учусткаси иатурага белгилаб берилгандаы\r\n([) кейин хам курилиш ишларини амалга ошириш учун Узбекистан Республнкасн\r\nВазирлар Махкамасининг 2018 йил 18 майдаги “Архитектура ва курилиш сохасида\r\nдавлат хизматлари курсатишнинг айрим маъмурий регламентларини тасдиклаш\r\nтугрисида”ги 370-сонли карорининг низом таъалбларига мувофик лойиха пешхисоб\r\nхужжатларини ишлаб чикиш учун тегишли ташкилотларга мурожаат килишлари ва\r\nишлаб чикилган лойиха пешхисоб хужатлри давлат экспиртизасидан утказилио\r\nвилоят курилиш бош бошкармаси хузуридаги архитектура-шахарсозлнк\r\nкенгашининг ижабий холосасини олган холда, белгиланган тартибда вилоят\r\nкурилиш назорат инспекдиясига билдирги берилгаидан кейингина курилиш\r\nишларини амалга оширилиши мурожаатгуйга тушунтирилди.\r\nУшбуларни фукаро Б.Мадаминовнинг мурожаатига жавоб тарикасида маълум\r\nкиламиз, агарда жавобдан норози булса юкори турувчи ташкилотларга мурожаат\r\nкилиши мумкинлигини билдирамиз.\r\nВилоят бош', '1646636023.0198.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(1868, '11', '2022-02-25', 1771, NULL, NULL, NULL, NULL, NULL, NULL, 426, 15, '2022-03-12', NULL, 4, 2, '2022-02-25 17:37:10', '2022-03-07 11:48:39', 0, NULL, 'Фукаро В.Жуманиёзовнинг акаси Б.Мадаминовга Хива шахар, азчн\r\nмахалласи худудидан “Савдо шахобчаси” биноси курилипш учун Хива шахар\r\nхокимининг 2018 йил 24-гаолдаги 1274-сонли карори билан 100 кв метр ер майдони\r\nажраталган ва ушбу карорга асосан “Савдо шахобчаси” биносиш. лой^алапггириш\r\nучун вилоят курилиш бош бошкармаси томонидан 06.01.2020 иилда 14-20/А-сонли\r\nAPT (Архитектура режалаштириш топшириги) хужжатлари ишлаб чикилган.\r\nМазкур хужжатларга асосан ер учусткаси натурага белгилаб бернлгандан\r\nкейин хам курилиш ишларини амалга ошириш учун Узбекистон Респуолшаси\r\nВазирлар Махк амасини нг 2018 йил 18 майдаги “Архитектура ва курилиш сохасида\r\nдавлат хизматлари курсатишнинг айрим маъмурий регламентларини тасдикдаш\r\nтугрисида”ги 370-сонли карорининг низом таъапбларига мувофик лоГшха пешхисоб\r\nхужжатларини ишлаб чикиш учун тегишли ташкилотларга мурожаат кнлншлари ва\r\nишлаб чикилган лойиха пешхисоб хужатлри давлат экспиртнзасидан угказилио\r\nвилоят курилиш бош бошкармаси хузуридаги архитектура-шахарсозлик\r\nкенгашининг ижабий холосасини олган холда, белгнланган тартибда вилоят\r\nкурилиш назорат ииспекциясига билдирги бернлгандан кеПингина курилиш\r\nишларини амалга оширилиши мурожаатг^йга тушунтирилди.\r\nУшбуларии фукаро В.Жуманиезовнинг мурожаатнга жавоб тарикасида маълум\r\nкиламиз, агарда жавобдан норози булса юкори турувчи ташкилотларга мурожаат\r\nкилиши мумкинлигини билдирамиз.', '1646635719.8787.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
