(1885, '4', '2022-02-28', 1757, NULL, NULL, NULL, NULL, NULL, NULL, 396, 15, '2022-03-12', NULL, 4, 2, '2022-02-28 09:20:08', '2022-03-11 10:44:26', 0, NULL, 'Аризагўй Адамбаев Улуғбекнинг  \"кўчани асфальт қилиш, бекатни йиқитиш масаласида амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Жамбул\" маҳалласи 3-йўлак кўчаси Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармасига қарашли ички хўжалик йўллари эканлиги аниқланди.    Шунга кўра, Урганч шаҳар ҳокимлиги ва шаҳар Ободонлаштириш бошқармаси ва маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда  лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин  таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Адамбаев Улуғбекга тушунтирилди.    ', '1646977466.0386.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
(1886, '№4-А-12', '2022-02-28', 1755, 1428, NULL, NULL, NULL, NULL, NULL, 381, 15, '2022-03-12', NULL, 4, 2, '2022-02-28 11:14:40', '2022-03-11 15:23:27', 0, 'Б.Жумабаев\r\nБелгиланган тартибда кўриб чиқиб маьлумот берилсин', 'Мурожаат белгиланган тартибда каноатлантирилди', '1646994207.7362.pdf', 667, 0, 1, 0, NULL, NULL, NULL),
(1887, '№4--1311', '2022-02-28', 1756, 1428, NULL, NULL, NULL, NULL, NULL, 385, 15, '2022-03-12', NULL, 4, 2, '2022-02-28 11:17:16', '2022-03-11 15:22:08', 0, 'Б.Жумабаев\r\nБелгиланган тартибда кўриб чиқиб маьлумот берилсин', 'Мурожаат белгиланган тартибда каноатлантирилди', '1646994128.1322.pdf', 667, 0, 1, 0, NULL, NULL, NULL),
(1888, '№4-А-14', '2022-02-28', 1757, 1428, NULL, NULL, NULL, '[\"678\"]', NULL, 388, 15, '2022-03-12', NULL, 4, 2, '2022-02-28 11:19:00', '2022-03-11 15:03:37', 0, 'Б.Жумабаев\r\nБелгиланган тартибда кўриб чиқиб маьлумот берилсин', 'Мурожаат белгиланган тартибда каноатлантирилди', '1646993017.9367.pdf', 667, 0, 1, 0, NULL, NULL, NULL),
(1889, '12', '2022-02-28', 1780, NULL, NULL, NULL, NULL, NULL, NULL, 445, 15, '2022-03-12', NULL, 4, 2, '2022-02-28 11:23:07', '2022-03-04 10:23:25', 0, NULL, 'бошкармаси томонидан урганиб чикилди.\r\n30 октябрда 2776к-сонли қарорига асосан “Бекчан Уста” МЧЖга Урганч шахар, Шовот\r\n(В.Фаязов) кучаси ва Байналминалчи кучаси муюлиши худудидан биринчи кавати\r\nнотурар (савдо, маиший хизмат курсатиш шахобчалари) жойдан иборат куп каватли, куп\r\nхонадонли турар жой бинолари куриш учун 8790 кв.метр ер майдони ажритиб\r\nбери л ган лиги маълум булди.\r\nШунингдек, фукаро Рахимов Иззатбек Бахтияровичга, Урганч шахар хокимининг\r\n2019 йил 01 августда 1853к;-сонли карорига асосан Урганч шахар, Шовот (В.Фаязов)\r\nкучаси ва Байналминалчи кучаси муюлишида курилаётган куп каватли, куп хонадонли\r\nтурар жой бинолари худудидан таркибида кутубхона, хусусий уй-жой мулкдорлари\r\nширкати хоналаридан иборат махалла гузари биносини куриш учун 100 кв.метр ер\r\nмайдони ажратиб берилганлиги маълум булди.\r\nУшбу масала юзасидан, Узбекистан Республикаси Ер кодексининг 4-боб 23-\r\nмоддасининг учинчи хат бошида Эгаликдаги, фойдаланишдаги, ижарадаги ва мулк килиб\r\nберилган ер участкасини бошка шахсларга бериш (реализация килиш) факат шу участка\r\nбелгиланган тартибда олиб куйилганидан (сотиб олинганидан) кейин амалга оширилиши\r\nбелгидаб кУйилган.Шулардан келиб чикиб, Сизга Урганч шахар хокимлигига ёки юкори турувчи\r\nорганларга мурожат килишингиз максадга мувофиклигини маълум қиламиз.', '1646371405.8028.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
