(2013, '2', '2022-03-04', 1871, 1451, NULL, NULL, NULL, '[\"1249\",\"339\"]', '[\"1249\",\"339\"]', 492, 15, '2022-03-19', '2022-03-19', 1, 2, '2022-03-04 14:14:22', '2022-03-19 12:39:18', 0, 'Ш.Мадаминовга мурожаатни жойига чиқиб ўрганиши таминлансин', 'Фукаро ХДучкаров ушбу мурожаатлари оркали тадбиркорлик фаолияти билан шугулланиши учун вактинча фойдаланишга енгил типдаги савдо шахобчаси (Контейнер) урнатишга ер майдони ажратилишини сураган. Хозирги кунда Узбекистон Республикаси Президентининг “Кучма савдо фаолиятига замонавий ахборот технологияларни янада кенг жорий этиш хамда савдо автомати чакана савдо фаолиятини тартибга солиш чора тадбирлари тугрисида” 04.06.2021- йилдаги ПК-513 6-сон карори билан 2021-йил 1-декабрдан бошлаб Кучма савдо фаолияти (Контейнер) тадбиркорлик субъектлари томонидан кучма савдо объектларини электрон тарзда “K-SAVDO” ААТ автоматлаштирилган ахборот тизимида руйхатдан утказиш йули билан амалга ошириш хамда (Контейнер) жойи жойлаштириш схемалари буйича “К- SAVDO” ААТ оркали электрон аукционда сотиб олиш тартиби белгиланганлигини маълум киламиз. Мазкур масала юзасидан фукаро Х.Кучкаровга “K-SAVDO” ААТ автоматлаштирилган ахборот тизимини электрон онлайн-аукционга ер майдони куйиш тартиблари тугрисида белгиланган тартибда мутахассислар томонидан тушунтиришлар олиб борилди. Ушбуларни мурожаатингизга жавоб тарикасида маълум киламиз, агарда жавобдан норози б^лган такдирида юкори турувчи органларга мурожаат килиши мумкинлигини билдирамиз.', NULL, 1243, NULL, 1, 0, NULL, NULL, NULL),
