(2024, '5', '2022-03-04', 1860, NULL, NULL, NULL, NULL, NULL, NULL, 459, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 14:52:43', '2022-03-18 11:53:02', 0, NULL, 'Аризачи Нурметов Хударганнинг \"кўчасини асфальт қилиш, югуриш учун йўлакча ташкил қилиб беришда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Саховат\" маҳалласи Замахшарий кўчасидаги ички йўллар Урганч шахар хокимлиги ва шахар Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастур\"га киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч шахар ҳокимлиги ва шахар Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастур\"га киритиш ваколатига эга эмас. Шунга кўра, Урганч шахар ҳокимлиги, шахар Ободонлаштириш бошқармаси ва \"Саховат\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризачи Нурметов Хударганга тушунтирилди.      \r\n\r\n', '1647586382.6562.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
(2025, '6', '2022-03-04', 1868, NULL, NULL, NULL, NULL, NULL, NULL, 480, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 14:56:46', '2022-03-17 12:26:20', 0, NULL, 'Аризачи Матназаров Абдулла \"кўчасига асфальтбетон ётқизишда амалий ёрдам сўраб\"  қилган мурожаатига асосан бош бошқарма ва Урганч йўллардан мунтазам фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди. Ўрганиш жараёнида, мурожаатда кўрсатилган \"Шодлик\" маҳалласи Навруз кўчасидаги йўллар Урганч туман ҳокимлиги Ободонлаштириш бошқармасига қарашли ички хўжалик йўллари эканлиги аниқланди. Ушбу мурожаатда келтирилган \"Шодлик\" маҳалласидаги Навруз кўчаси Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси балансида бўлиб, \"Манзилли дастурга\" киритиш масаласи тегишли ишчи гуруҳ томонидан ички йўлларнинг ҳолатини жойида ўрганиш натижалари асосида шакллантрилади. Таъмирталаб кўчаларни \"Манзилли дастурга киритиш бўйича таклифлар ушбу кўчаларни ўз балансида сақловчи Урганч туман ҳокимлиги ва туман Ободонлаштириш бошқармаси томонидан тегишли ишчи гуруҳга тақдим этилишини инобатга олиб, бош бошқарма \"Манзилли дастурга\" киритиш ваколатига эга эмас. Шунга кўра, Урганч туман ҳокимлиги, туман Ободонлаштириш бошқармаси ва \"Шодлик\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларини таъмирлашда молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин \"Хоразм минтақавий йўлларга буюртмачи ҳизмати\" ДУК томонидан ўтказиладиган тендер савдоларида ғолиб бўлган корхона  ва хусусий тадбиркорлик субъектлари томонидан таъмирлаш ишлари амалга оширилиши тўғрисида аризачи Матназаров Абдуллага тушунтирилди.      ', '1647501980.3344.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
