(2052, '15', '2022-03-04', 1947, NULL, NULL, NULL, NULL, NULL, NULL, 610, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 16:41:56', '2022-03-11 11:20:40', 0, NULL, 'Аризагўй Машарипов Азимбойнинг \"яшаш манзилидаги ички йўлни таъмирлашда амалий ёрдам сўраб\" қилган мурожаатига асосан бош бошқарма ва Боғот туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан жойига чиқиб ўрганилди.  Ўрганиш жараёнида, мурожаатда кўрсатилган \"Қулонқорабоғ\" маҳалласидаги ички йўллар Боғот тумани ҳокимлиги ва туман Ободонлаштириш бошқармасига қарашли бўлиб, 2019 йилда \"Обод қишлоқ\" дастури доирасида ички хўжалик йўлларига ШПС (қум-шағал аралашмаси)дан қоплама қуриш ишлари бажарилганлиги аниқланди. Шунга кўра, Боғот туман ҳокимлиги ва туман Ободонлаштириш бошқармаси ва \"Қулонқорабоғ\" маҳалла раиси таклифига асосан маҳалланинг ички йўлларига асфалтобетон ётқизиш ишлари, молиялаштириш манбаси аниқланиб, лойиҳа-смета ҳужжатлари тайёрланиб, манзилли дастур шакллантирилгандан кейин таъмирлаш ишлари амалга оширилиши тўғрисида аризагўй Машарипов Азимбойга тушунтирилди.            ', '1646979640.7119.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
