(2056, '14', '2022-03-04', 1871, NULL, NULL, NULL, NULL, NULL, NULL, 490, 15, '2022-03-19', '2022-03-19', 4, 2, '2022-03-04 17:38:51', '2022-03-19 12:39:18', 0, NULL, 'Фукаро ХДучкаров ушбу мурожаатлари оркали тадбиркорлик фаолияти билан\r\nшугулланиши учун вактинча фойдаланишга енгил типдаги савдо шахобчаси (Контейнер)\r\nурнатишга ер майдони ажратилишини сураган.\r\nХозирги кунда Узбекистон Республикаси Президентининг “Кучма савдо\r\nфаолиятига замонавий ахборот технологияларни янада кенг жорий этиш хамда савдо\r\nавтомати чакана савдо фаолиятини тартибга солиш чора тадбирлари тугрисида” 04.06.2021-\r\nйилдаги ПК-513 6-сон карори билан 2021-йил 1-декабрдан бошлаб Кучма савдо фаолияти\r\n(Контейнер) тадбиркорлик субъектлари томонидан кучма савдо объектларини электрон\r\nтарзда “K-SAVDO” ААТ автоматлаштирилган ахборот тизимида руйхатдан утказиш йули\r\nбилан амалга ошириш хамда (Контейнер) жойи жойлаштириш схемалари буйича “К-\r\nSAVDO” ААТ оркали электрон аукционда сотиб олиш тартиби белгиланганлигини маълум\r\nкиламиз.\r\nМазкур масала юзасидан фукаро Х.Кучкаровга “K-SAVDO” ААТ\r\nавтоматлаштирилган ахборот тизимини электрон онлайн-аукционга ер майдони куйиш\r\nтартиблари тугрисида белгиланган тартибда мутахассислар томонидан тушунтиришлар\r\nолиб борилди.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум киламиз, агарда жавобдан\r\nнорози б^лган такдирида юкори турувчи органларга мурожаат килиши мумкинлигини\r\nбилдирамиз.', '1646973374.1095.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2057, '15', '2022-03-04', 1926, NULL, NULL, NULL, NULL, NULL, NULL, 563, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:39:22', '2022-03-10 15:44:28', 0, NULL, 'Урганиш жараёнида, куйидагилар анщланди, Урганч шахар, Олимпия махалласи,\r\nФаязов кучаси 29/16-уйнинг ён томонида тегишли ташкилотларнинг рухсатини олмасдан\r\nфукаро Садуллаев Мухаммад томонидан узбошимчалик билан 30,0 кв.метр ер маыдонки\r\nэгаллаб олиб енгил конструкцияли акфадан дукон урнатиб куйилганлиги аникланди.\r\nУшбу аникланган холат буйича, Узбекистон Республикаси Президентининг 2021\r\nйил 8 юндаги “Ер муносабатларида тенглик ва шаффофликни таъминлаш, ерга булган\r\nхукукларни ишончли химоя килиш ва уларни бозор активига анлантнрнш чора\r\nтадбирлари тугрисида”ги ПФ-6243-сонли фармоннинг 10-банди 2-хатбошисига асосан\r\nДавлат солик кумитаси хузуридаги Кадастр агентлиги органларига ер участкаларидан\r\nмаксадсиз фойдаланиш холатлари аникланганда Узбекистон Республикаси Ер\r\nкодексининг 36-моддасига мувофик ушбу ер участкаларига булган хукукини бекор\r\nкилиш, узбошимчалик билан эгаллаиган ер майдонида ноконуний курилган иморатларнн\r\nбартараф этиш юзасидан тугрида-т^гри судга мурожаат килиш хукуки берилганлигнни\r\nмаълум киламиз.\r\nШулардан келиб чикиб, Давлат солик кумигаси хузуридаги Кадастр агентлиги\r\nУрганч шахар булими томонидан 2022 йил 4 мартда Фукаролик ишлари буйича Урганч\r\nтуманлараро судига 78-сонли даъво аризаси киртилганлигини маълум киламиз.\r\nУшбуларни мурожаатингизга жавоб тарикасида маълум киламиз, жавобдаи иорози\r\nбулган такдирида юкори турувчи органга мурожаат килишингиз мумкннлигини билдирамиз.', '1646909068.7416.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2058, '16', '2022-03-04', 1928, NULL, NULL, NULL, NULL, NULL, NULL, 569, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:39:43', '2022-03-18 19:15:53', 0, NULL, 'Viloyat qurilish bosh boshqarmasi Sizning 2022 yil 19 martdagi 201-sonli\r\ntartib raqami bilan ro‘yxatga olingan murojaatingizda qayd qilingan masalani\r\no‘rganish jarayonida qo‘shimcha vaqt talab etilayotgani munosabati bilan,\r\nO‘zbekiston Respublikasining “Jismoniy va yuridik shaxslarning murojaatlari\r\nto‘g‘risida”gi qonunining 28-moddasiga muvofiq, murojaatning ijro muddati\r\nqo‘shimcha 15 kun muddatga uzaytirib berishingizni bildiramiz.', '1647612953.4053.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2059, '17', '2022-03-04', 1938, NULL, NULL, NULL, NULL, NULL, NULL, 588, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:40:13', '2022-03-11 11:54:11', 0, NULL, 'Urganch shahar hokimining 29.03.2016 yil 606q-sonli qarori°a\r\nasosan fuqaro S.Masharipovaga qarashli Urganch shahar A.Bahodirxon ko\'chali\r\n11/lA-uyda joylashgan umumiy yer maydoni 189,83 kv.metr shundan qurilish osti\r\nmaydoni 174,57 kv.metr bo\'lgan 1-qavatli savdo va maishiy xizmat ko\'rsatish\r\nshahobchasi 2-qavati ofis binosiga egalik huquqini tan olish, yer maydoniga doimiv\r\nfoydalanish huquqi berish hamda davlat yer daftariga kiritilgan.\r\nShuningdek, 0 ‘zbeldston Respublikasi Vazirlar Mahkamasining 2018 vil\r\n18 maydagi 370-sonli qarorning 2-ilovasining obyektni qayta ixtisoslashtirish va\r\nrekonstruksiya qilish uchun ruxsatnoma berish bo\'yicha davlat xizmatlarini\r\nko‘rsatishning ma’muriy reglamentiga asosan Urganch shahar qurilish boiimi tomonidan\r\n14.05.2019 yil №03/1201-sonli ruxsatnoma berilganligi, ushbu ruxsatnomaga asosan\r\nkadastr yig‘ma jildi shakllantirilgan.\r\nYuqoridagilardan kelib chiqib, viloyat qurilish bosh boshqarmasi ushbu ob\'ektning\r\nkadastr hujjatlarida chegara hududlari o\'rganishda murojaatda keltirilgan hududda\r\nemasligini bildiramiz.\r\nUshbularni murojaatingizga javob tariqasida ma’lum qilib, agardajavobdan norozi\r\nbo‘lgan taqdiringizda yuqori turuvchi organga^-juurojaat qilishingiz mumkinligini\r\nbildiramiz.', '1646981651.7094.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2060, '18', '2022-03-04', 1950, NULL, NULL, NULL, NULL, NULL, NULL, 617, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:40:35', '2022-03-10 17:40:40', 0, NULL, 'Фукаро А.Лллаберганов уз мурожаатида, Хива тумани хокими\r\nфармоиишига асосан Хива тумани, “Гандимён” махалласи худудидан\r\nвактипча фойдаланиш учун ажратилган ер майдонида курилган енгил типдаги\r\nНонвоихона” биносига табий газ уланишида ва кадастр хужжати\r\nрасмийлаштирилишида амалий ёрдам сураган.\r\nХолат юзасидан урганиш жараёнида фукаро А.Аллабергановга, Хива\r\nтумани хокимининг 16.03.2019 йилдаги 58ф-сонли фармойншига асосан енгнл\r\nтипдаги ‘Нонвойхона” курилмаси жойлаштириб вактинча фойдаланнш учун\r\n40 кв метр ер майдони ажратилганлиги ва хозирги кунда “Нонвоихона”\r\nбиносини куриб битказганлиги аникланди.\r\nЭндиликда мазкур “Нонвойхона” курилмасида тадбиркорлик фаолняти\r\nюритиши мумкинлиги ва табий газга уланиш учун хужжатлари билан туман\r\nгаз идорасига мурожаат килиши хамда кадастр хужжатлари расмнйлаштириш\r\nучун туман кадастр булимига мурожаат кнлишн мурожаатфЧга\r\nтушунтирилди.\r\nУшбуларни фукаро А.Аллабергановнинг мурожаатига жавоб тарикасида\r\nмаълум киламиз, агарда жавобдан норози б^лган такдирида юкори турувчи\r\nорганга мурожаат килиши мумкинлигиии билдирамиз.', '1646916040.1089.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2061, '№5', '2022-03-04', 1912, NULL, NULL, NULL, NULL, NULL, NULL, 542, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:40:37', '2022-03-11 16:58:10', 0, NULL, '“Diyorbek qovunchi” fermer xо‘jaligi foydalanilgan elektr energiyasi uchun 01.03.2022 yil holatiga 41,483,717.81 sо‘m qarzdorlik yuzaga kelganligi va shu qarzdorlikni о‘z vaqtida tо‘lamaganligi sababli elektr ta’minotidan ajratilgan. Ushbu qarzdorlikni sо‘ndirib, elektr energiyasidan foydalanish uchun oldindan tо‘lovlarni amalga oshirsa qayta elektr ta’minotiga ulab berilishi tushuntirildi.', '1646999890.0345.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
(2062, '№6', '2022-03-04', 1930, NULL, NULL, NULL, NULL, NULL, NULL, 572, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:41:42', '2022-03-14 17:36:05', 0, NULL, 'O‘zbekiston Respublikasi Vazirlar Mahkamasining 2018 yil 12 yanvardagi №22-sonli qarorining 4-bob 30-bandida “Iste’molchilarning yuklamalarini ulash bilan bog‘liq yangi elektr qurilmalarini va elektr tarmog‘i xo‘jaligining obektlarini loyihalash va qurish, ishlab turganlarini kengaytirish va rekonstruksiya qilish ist’molchilarning mablag‘lari xisobidan amalga oshirilishi” belgilab qo‘yilganligini inobatga olgan holda, elektr qurilmalarini qurish ishlari iste’molchilarning mablag‘lari xisobidan bajarilishi to‘g‘risida fuqaro Ravshanbek Ibragimovga tushuntirish ishlari olib borildi.', '1647261365.8446.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
(2063, '№7', '2022-03-04', 1936, NULL, NULL, NULL, NULL, NULL, NULL, 583, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:42:27', '2022-03-18 13:54:59', 0, NULL, 'Urganch shahar Navrо‘z MFY Navbahor kо‘chasi 3 yо‘lak 34 uyda yashovchi fuqaro Otabek Babaniyazovning qilgan murojaati о‘rganib chiqilmoqda. Ushbu murojaatda ko‘rsatilgan masalalar qo‘shimcha o‘rganishni, tekshirishni talab etilayotganligi sababli “Jismoniy va yuridik shaxslarning murojaatlari to‘g‘risida”gi O‘zbekiston Respublikasi Qonuniga o‘zgartirish va qo‘shimchalar kiritish haqida, 2017 yil 11 sentabrdagi O‘RQ-445-sonli O‘zbekiston Respublikasi (yangi tahrir)dagi Qonunining 28-moddasiga asosan ushbu murojaatni to‘liq o‘rganib chiqish uchun qo‘shimcha muddat talab etayotganligini ma’lum qilamiz.', '1647593699.0186.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
(2064, '№8', '2022-03-04', 1952, NULL, NULL, NULL, NULL, NULL, NULL, 619, 15, '2022-03-19', NULL, 4, 2, '2022-03-04 17:43:10', '2022-03-11 17:02:43', 0, NULL, 'О‘zbekiston Respublikasi Vazirlar Mahkamasining 2018 yil 26 dekabrdagi №1050-son qaroriga asosan Davlat tomonidan belgilab berilgan muhofaza zonasini saqlagan holda qurilish ishlarini olib borishi to’g’risida ogohlantirish xatlari berilgan.', '1647000163.6982.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
