(2111, '20', '2022-03-03', 1757, 315, 315, '[\"315\"]', '[\"315\"]', NULL, NULL, 397, 15, '2022-03-12', '2022-03-10', 1, 2, '2022-03-09 09:31:56', '2022-03-10 14:20:15', 0, 'Н.Юсупбаев.Р.Хикметов ларга -Ўрганиб,қонуний ижросини таъминланг.', '           Урганч шахар Жамбул маҳалласи Мустақиллик кўчаси 3пр 85д-уй  яшовчи Адамбаев Улуғбек 2022 йил 28 феврал   куни Хоразм вилояти хокимининг Сайёр қабулида қилган  мурожаати  Урганч йўллардан мунтазам фойдаланиш унитар корхонаси ходимлари томонидан   масала ўрганиб чиқилди.        \r\n          Ўрганиш жараёнида  мурожаатда кўрсатилган  Урганч шахар Жамбул маҳалласи Мустақиллик кўчаси  3-йўлак  худуди шаҳар аҳоли пункти кўчалари тоифасига кириши,  мазкур худуддан ўтган ички хўжалик йўлининг узунлиги 600 метр эканлиги, йўлнинг  асфальт қопламаси йўқолиб кетиб, таъмир талаб аҳволга   келиб қолганлигиги, бу эса ўз навбатида шу худудда яшовчи аҳолининг қириб чиқишида қийинчиликларни келтириб чиқараётганлиги аниқланди ва   1 масала юзасидан    Ўзбекистон Республикасининг 2007 йил 2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунининг 7,10,13 моддадаларида  шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб қуйилганлиги, йўлларни таъмирлаш ишлари босқичма босқич  давлат дастурларига киритилиб  амалга оширилаётганлиги, ички хўжалик йўлини таъмирлаш масаласи Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармаси томонидан ҳал қилиниши тўғрисида, 2 масаладаги  нотурар қурилиши билан боғлиқ қўшнилар орасидаги тушунмовчиликларни ўрганиш корхона ваколатига кирмаслиги, ушбу масала тегишли ташкилотлар ўрганилиши тўғрисида фуқарога тушунтиришлар берилди.\r\n            Шунингдек 3 масалада кўрсатиб ўтилган   худуд 4Р161 “Урганч ш.-Чолиш п-Беруний шаҳри” автомобил йўли билан боғлиқ эканлиги сабабли,    ушбу масалага дахлдор бўлган яьни йўлда таъмирлаш ишларини олиб бораётган Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси ходими жалб қилинди ва бекат жойини  ўзгартириш масаласи буюртмачи ташкилот  томонидан кўриб чиқилиши,  фуқаронинг муаммосини ҳал қилиш мақсадида Хоразм йўллардан мунтазам фойдаланиш унитар корхонаси томонидан буюртмачи ташкилотга мурожаат қилиниши ва унинг натижалари бўйича  қўшимча маълумот берилиши тўғрисида фуқарога тушунтиришлар берилди.  \r\n', '1646904015.8977.pdf', 231, NULL, 1, 0, NULL, NULL, NULL),
(2112, 'Х1', '2022-03-09', 1863, NULL, NULL, NULL, NULL, NULL, NULL, 468, 15, '2022-03-19', NULL, 3, 2, '2022-03-09 09:43:56', '2022-03-11 18:20:46', 0, NULL, 'Марказий банк Хоразм вилояти Бош бошқармаси ушбу билан Сизга Янгиариқ тумани, Вакиллар МФЙ, Хайраобод кўчаси д-40-уйда яшовчи фуқаро Эсаматова Назиранинг уй-жой масаласи ва кредит масаласида амалий ёрдам беришни сўраб вилоят хокимлиги сайёр қабулидаги мурожаатини Ўзбекистон Республикасининг “Жисмоний ва юридик шахсларнинг мурожаатлари тўғрисида”ги Қонунининг 25-моддасига асосан тегишлилиги бўйича иловага мувофиқ юбормоқда.\r\nШу муносабат билан, фуқаро Н.Эсаматованинг ушбу мурожаатида кўрсатилган масалаларни Ўзбекистон Республикасининг “Жисмоний ва юридик шахсларнинг мурожаатлари тўғрисида”ги Қонуни талаблари асосида ўрганиб чиқиб, натижаси тўғрисида тегишли ҳужжатларни илова қилган ҳолда белгиланган муддатда муаллифга ва Бош бошқармага маълум қилинишини таъминлашингиз сўралади.\r\n', NULL, 393, 1, 1, 0, NULL, NULL, NULL),
(2113, '24', '2022-03-07', 1860, 315, 315, '[\"315\"]', NULL, NULL, NULL, 460, 15, '2022-03-19', NULL, 4, 2, '2022-03-09 09:45:21', '2022-03-18 17:53:46', 0, 'Н.Юсупбаев, Р. Хикметовларга - Ўрганиб Хоразм вилоят АЙХББга маълумот қиритинг', '           Ўрганиш натижаларидан келиб чиқиб,Ўзбекистон Республикасининг 2007 йил                                            2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб куйилганлиги, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқарога  тушунтиришлар берилди. \r\n     Шунингдек фуқаронинг мурожаатини инобатга олган ҳолда корхона томонидан                                             2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали  йўлни таъмирлаш, Урганч шаҳридаги 2-сон мактабнинг спорт  майдони атрофида  қариялар югуриши учун йўлакча ташкил қилиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '1647608026.3312.pdf', 231, 1, 1, 0, NULL, NULL, NULL),
(2114, '25', '2022-03-07', 1868, 315, 315, '[\"315\"]', NULL, NULL, NULL, 481, 15, '2022-03-19', NULL, 4, 2, '2022-03-09 09:47:47', '2022-03-18 17:26:14', 0, 'Н.Юсупбаев, Р.Хикметовларга- Ўрганиб, Хоразм вилоят АЙХББга маълумот қиритинг.', 'Ўрганиш жараёнида фуқаро Матназаров Абдулло томонидан билдириб ўтилган Урганч туманидан ўтган Амударё ҳавзаси ҳимоя худудидаги (Чолиш поселкаси худудига яқин бўлган дала ҳовлига олиб борувчи ички хўжалик йўли) йўлининг  узунлиги 1000 метрни ташкил қилиши, тупроқ қопламали эканлиги аниқланди.\r\n        Ўрганиш натижаларидан келиб чиқиб,  йўлни талаб даражасига келтириш юзасидан тахминий ҳисоб-китоблар қилинганлиги, унга кўра тош қоплама ётқизилган тақдирда    220 млн сўм, тош ва асфальт қоплама ётқизилган тақдирда  эса 684 млн сўмлик маблағлар сарф қилиниши,  Ўзбекистон Республикасининг 2007 йил 2 октябрдаги  ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида  шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши, молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши,Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгилаб қўйилганлиги,  йўлни таъмирлаш масаласи Урганч туман хокимлиги ва  Урганч туман Ободонлаштириш бошқармаси томонидан ҳал қилиниши тўғрисида фуқарога  тушунтиришлар берилди.           \r\n      Шу билан биргаликда  корхона томонидан    2022 йилнинг 15 март куни 03/146 сонли хат орқали Урганч тумани худудидаги Амударё ҳавзаси химоя худудидаги  (Чолиш поселкаси худудига яқин бўлган дала ҳовлига олиб борувчи йўл)  1000 метр узунликдаги ички хўжалик йўлини таъмирлаш дастурига киритишда ҳамда молиялаштириш манбасини аниқлаштиришда амалий ёрдам сўраб Урганч туман хокими Ф.Шариповга   мурожаат қилинганлиги, шу сабабли мурожаатдаги  масала юзасидан туман хокимлиги билан алоқада бўлиб туриш тўғрисида  билдириб ўтилди.\r\n   \r\n', '1647606374.585.pdf', 231, 1, 1, 0, NULL, NULL, NULL),
(2115, '26', '2022-03-07', 1876, 315, 315, '[\"315\"]', NULL, NULL, NULL, 504, 15, '2022-03-19', NULL, 4, 2, '2022-03-09 09:49:11', '2022-03-18 17:19:30', 0, 'Н.Юсупбаев, Р.Хикметовларга- Ўрганиб, Хоразм вилоят АЙХББга маълумот қиритинг.', '           Ўрганиш натижаларидан келиб чиқиб,  Ўзбекистон Республикасининг 2007 йил                        2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқароларга тушунтиришлар берилди. \r\n      Шунингдек  корхона томонидан  2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали йўлни таъмирлаш, тунги ёриткичларни ўрнатиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '1647605970.7161.pdf', 231, 1, 1, 0, NULL, NULL, NULL),
(2116, 'Х2', '2022-03-09', 1931, NULL, NULL, NULL, NULL, NULL, NULL, 575, 15, '2022-03-19', NULL, 4, 2, '2022-03-09 09:50:04', '2022-03-11 18:26:02', 0, NULL, 'Марказий банк Хоразм вилояти Бош бошқармаси Сизнинг 2022 йил \r\n9 мартда Хоразм вилояти ҳокимлигига сайёр қабулда қилган мурожаатингизда келтирилган ҳолатлар билан танишиб чиқиб, қуйидагиларни маълум қилади.\r\nМурожаатингизда, “Ипотека-банк” АТИБ Хоразм вилоят филиалидан \r\nуй-жой сотиб олиш учун кредит маблағларини олганлигингиз, кейинчалик қамалиб қолганлигингиз туфайли кредит тўловлари тўланмай қолганлиги сабабали банк томонидан судга берилганлигидан норози бўлиб, бугунги кунда ижро ҳаракатларини тўхтатишни ва кредит тўловларини узайтириб беришда амалий ёрдам сўрагансиз.\r\nЎзбекистон Республикасининг “Банклар ва банк фаолияти тўғрисида”ги Қонунининг 8-моддасига кўра, банклар молиявий операцияларини амалга ошириш билан боғлиқ қарорлар қабул қилишда мустақилдир. Давлат органлари ва уларнинг мансабдор шахсларига банклар фаолиятига, шу жумладан банкларнинг кредит портфелини ва активларини шакллантириш билан боғлиқ тадбиркорлик таваккалчиликларини бошқаришга аралашиши тақиқлаб қўйилган. 61-моддасида асосан банклар ва уларнинг мижозлари ўртасидаги муносабатлар шартномалар асосида амалга оширилади деб кўрсатилган.\r\nШу билан бирга, Ўзбекистон Республикаси Президентининг 2020 йил \r\n12 майдаги ПФ-5992-сонли Фармонининг 7-бандида вазирликлар, идоралар ва маҳаллий давлат ҳокимияти органлари раҳбарлари томонидан банкларнинг, \r\nшу жумладан кредит портфели ва банк активларини шакллантириш билан боғлиқ тадбиркорлик таваккалчиликларини бошқариш фаолиятига аралашиши тақиқланган.\r\n“Ипотека-банк” АТИБ Хоразм вилоят филиали билан ўртангизда 2018 йил \r\n11 июлда тузилган “Иккиламчи уй-жой бозоридан уй-жой сотиб олиш учун ипотека кредити бериш тўғрисида”ги ИП-2018-1963-сонли шартномага асосан сизга Урганч тумани, “Ғойбу” қишлоғи, “Оқ мактаб” маҳалласи, Проектная кўчаси, 10-йўлак, 4 тор йўлакда жойлашган 2а-уйни сотиб олиш учун 15 йил муддатга асосий қисми учун 36 ойлик имтиёзли давр билан 14 фоиз устама ҳақ тўлаш шарти билан 75,0 млн. сўм миқдорида кредит ажратилган.\r\nКредит таъминоти сифатида кредит ҳисобига сотиб олинган турар-жой биноси ўзаро келишилган ҳолда 93,8 млн. сўмга баҳоланган ҳолда нотариал тартибда гаровга қўйилган ҳамда шерик жавобгарлар Э.Ходжаев ва С.Атабоевларнинг кафиллик мажбуриятлари қабул қилинган.\r\nКредит шартномасининг 4.4-бандида, ипотека кредити бўйича тўловлар (асосий қарз ва фоизи) ҳар ойнинг 25 санасига қадар тўлаб борилиши, кредитни қайтариш графигига асосан кредитнинг асосий қисмидан 25.08.2021 йилдан бошлаб тўловлар амалга оширилиши белгиланган, лекин 01.03.2020 йилдан бошлаб кейинги даврдаги тўловларда сурункали равишда тўловларни амалга оширмасдан келгансиз, яъни охирги марта 27.01.2022 йилда 1 000 000 сўм миқдорида тўлов амалга оширгансиз ва кечиктирилган тўловлар тўғрисида банк томонидан доимий равишда огоҳлантириб келгансиз.\r\nКредит шартномасининг 17.1-бандида, шартнома бўйича келишмовчилик ва/ёки ушбу шартномада назарда тутилмаган низоли вазиятлар пайдо бўлган ҳолларда томонлар Ўзбекистон Республикасининг амалдаги қонун ҳужжатларига мувофиқ уларни музокара йўли билан ҳал этадилар, томонлар келишувга эришмаган тақдирда низо Ўзбекистон Республикасининг амалдаги қонун ҳужжатларига мувофиқ кўриб чиқиш учун суд органларига берилади деб кўрсатилган.\r\nШунга кўра, Ўзбекистон Республикаси Савдо-саноат палатаси Хоразм вилоят ҳудудий бошқармаси томонидан банк манфаатларини кўзлаб, кредит шартномаси бўйича кредит ва фоизларидан қарзларни муддатидан олдин гаров мулки ҳисобидан ундириш мақсадида 2021 йил 19 январда фуқаролик ишлари бўйича Урганч туманлараро судига даъво аризаси киритилиб, мазкур суднинг \r\n2021 йил 4 мартдаги ҳал қилув қарорига асосан ундирув гаров мулкига қаратилган ва кейиинчалик ҳужжатлар ижро қилиш учун Мажбурий ижро бюроси Урганч тумани бўлимига юборилган ва бугунги кунда “е аукцион” орқали аукционга чиқариш ишлари олиб борилмоқда.\r\nБанк филиали томонидан тақдим қилинган маълумотларга кўра жорий йилнинг 10 март ҳолатига кредитнинг асосий қисмидан бўлган қарзингиз \r\n75,0 млн. сўм, шундан муддати ўтган қисми 1 349,0 минг сўм, ҳисобланган фоизлардан бўлган қарзингиз 20 732,4 минг сўм жами қарзингиз 95 732,4 минг сўмни ташкил қилади.\r\nМазкур ҳолатлар юзасидан банк ходимлари томонидан 2022 йил \r\n17 февраль куни сиз билан учрашиб батафсил тушунтиришлар берилган ҳамда ўхшаш мазмундаги аризаларингиз бўйича “Ипотека-банк” АТИБ Бошқаруви томонидан бир неча бор кўриб чиқилиб, Ўзбекистон Республикасининг “Жисмоний ва юридик шахсларнинг мурожаатлари тўғрисида”ги Қонунининг 30-моддасига асосан кўриб чиқишдан тўхтатилиб, бу ҳақда 02.03.2022 йилда \r\n17-4/400-ф-сонли хат орқали сизга маълум қилинган.\r\nЎзбекистон Республикасининг “Суд ҳужжатлари ва бошқа органлар ҳужжатларини ижро этиш тўғрисида”ги Қонунининг 37-моддасида, ундирувчи ундирувдан воз кечганда, агар воз кечиш суд томонидан қабул қилинган бўлса, шунингдек ундирувчи ва қарздор ўртасида суд томонидан тасдиқланган келишув битими тузилганда ижро иши юритиш давлат ижрочиси томонидан тугатилади деб кўрсатилган.\r\nЎзбекистон Республикаси Конституциясининг 110-моддасида, Ўзбекистон Республикаси Олий суди фуқаролик, жиноий, иқтисодий ва маъмурий суд ишларини юритиш соҳасида суд ҳокимиятининг олий органи ҳисобланади. У томонидан қабул қилинган ҳужжатлар қатъий ва Ўзбекистон Республикасининг барча ҳудудида бажарилиши мажбурийдир. Ўзбекистон Республикаси Олий суди қуйи судларнинг судлов фаолияти устидан назорат олиб бориш ҳуқуқига эга деб кўрсатилган.\r\nЮқорида қайд қилинган норматив-ҳуқуқий ҳужжатлар талабларига \r\nкўра, “Ипотека-банк” АТИБ Хоразм вилоят филиали билан ўртангиздаги муносабатлар шартномавий муносабат эканлиги, Марказий банк - суд қарорлари ва уларнинг ижроси юзасидан олиб борилаётган ижро ҳаракатларини муҳокама қилиш ва уларни тўхтатиш, шу жумладан кредит муддатларини узайтириб бериш ҳамда қарздорликларни ундирмасдан турилиши юзасидан кўрсатмалар беришга ҳақли эмаслиги сабабли ижро ҳаракатларини тўхтатиш учун кредит тўловларини амалга оширган ҳолда бевосита хизмат кўрсатувчи банк филиали билан келишилган ҳолда амалга оширишингиз, суд қароридан норози бўлсангиз суднинг юқори инстанциясига мурожаат қилишингиз мақсадга мувофиқлиги билдирилади.\r\n', '1647005162.6578.doc', 393, 1, 1, 0, NULL, NULL, NULL),
(2117, '27', '2022-03-07', 1877, 315, 315, '[\"315\"]', NULL, NULL, NULL, 507, 15, '2022-03-19', NULL, 4, 2, '2022-03-09 09:50:50', '2022-03-18 17:29:28', 0, 'Н.Юсупбаев, Р.Хикметовларга- Ўрганиб, Хоразм вилоят АЙХББга маълумот қиритинг.', '           Ўрганиш натижаларидан келиб чиқиб,  Ўзбекистон Республикасининг 2007 йил                        2 октябрдаги ЎРҚ-117-сонли “Автомобиль йўллари тўғрисида”ги Қонунида   шаҳарлар ва бошқа аҳоли пунктларининг кўчалари  маҳаллий давлат ҳокимияти органлари ихтиёрида бўлиши ҳамда молиялаштириш маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши, Ўзбекистон Республикаси Президентининг 2017 йил 14 февралдаги ПҚ-2776 сонли қарорида шаҳарлар, шаҳар поселкалари, қишлоқ ва овуллар кўчаларини сақлаш, ободонлаштириш ва ёритиш ишлари тегишли шаҳар, туман хокимликларининг ободонлаштириш бошқармалари томонидан маҳаллий бюджет маблағлари ҳисобидан амалга оширилиши белгиланганлиги, кўтарилган масалалар Урганч шаҳар хокимлиги, шаҳар Ободонлаштириш бошқармаси томонидан кўриб чиқилиши ва ҳал қилиниши тўғрисида фуқароларга тушунтиришлар берилди. \r\n      Шунингдек  корхона томонидан  2022 йилнинг 15 март кунидаги 03/148 сонли хат орқали йўлни таъмирлаш, тунги ёриткичларни ўрнатиш ишларини давлат дастурларига киритилишида, молиялаштириш манбасини аниқлаштиришда  амалий ёрдам сўраб Урганч шаҳар хокимлиги, Урганч шаҳар Ободонлаштириш бошқармасига мурожаат қилинганлиги маълум қилиниб, муаммоларни ҳал қилиш борасида улар билан доимий алоқада бўлиб туриш зарурлиги билдириб ўтилди.\r\n', '1647606568.4547.pdf', 231, 1, 1, 0, NULL, NULL, NULL),
