(2237, '№9', '2022-03-11', 2016, NULL, NULL, NULL, NULL, NULL, NULL, 637, 15, '2022-03-26', NULL, 4, 2, '2022-03-11 15:54:28', '2022-03-25 12:35:51', 0, NULL, 'Saparov Orifjon Abdullayevich 2022 yil 15 mart kuni Bog‘ot tuman “Davlat xizmatlari markazi”ga Qumbodoq mahallasida joylashgan tovuqchilik fabrikasini elektr tarmog‘iga ulash uchun ariza bilan murojaat qilgan bo‘lib, tuman ETK ma’muriyati tomonidan 1-chiziqli sxema va  qilinadigan ish xajmi tayyorlanib,  Texnik shart, smeta xujjatlari tayyorlanishi uchun “Xorazm XET” AJga yuborilgan. Texnik shart, smeta xujjatlari tayyor bo‘lganidan keyin shartnomada pudratchi tomonidan bajariladigan ishlar bahosi elektr qurilmalarini tarmoqqa ulash bilan bog‘liq barcha xarajatlari  to‘liq qoplanganda va iste’molchi Texnik shartdagi talablarni bajargandan keyin tovuqchilik fabrikasini elektr tarmog‘iga ulab berilishini tо‘g‘risida murojaatchiga tushuntirish ishlari olib borildi.', '1648193751.26.pdf', 206, 0, 1, 0, NULL, NULL, NULL),
(2238, '23', '2022-03-11', 2022, NULL, NULL, NULL, NULL, NULL, NULL, 659, 15, '2022-03-26', NULL, 4, 2, '2022-03-11 15:55:04', '2022-03-18 12:45:08', 0, NULL, 'ётқизилган.\r\n\"Ҳазорасп” ширкат хўжалиги вакиллар йиғилишининг 02.03.2004 йилдаги\r\n2-сонли йиғилиш баёни ва ушбу баённи тасдиқлаш ҳақидаги туман ҳокимининг\r\n16.03.2004 йилдаги 603-сонли қарори билан ажратиб берилган 0,06 гектар ер\r\nмайдони аслида, туман ҳокимининг 26.02.2014 йилдаги 209қ-сонли қарори билан\r\nСизнинг номингизга эгалик ҳуқуқи белгиланиб, у мазкур ер майдонини ҳадя\r\nшартномасига асосан қизингиз М.Машариповага ҳадя килинган лигини\r\nбилдирамиз.\r\nУшбу маълумотларни аризага жавоб тариқасида маълум қиламиз агарда\r\nжавобдан нарози бўлганда юқори турувчи ташкилотларга мурожаат қилишлиги\r\nтушинтирилади.', '1647589508.5069.pdf', 263, 1, 1, 0, NULL, NULL, NULL),
(2239, '№10', '2022-03-11', 2037, NULL, NULL, NULL, NULL, NULL, NULL, 669, 15, '2022-03-26', NULL, 4, 2, '2022-03-11 15:55:13', '2022-03-24 12:26:09', 0, NULL, 'Urganch tumani X.Olimjon MFYda yashovchi fuqaro M.Mavlonovning    murojaati yuzasidan Urganch tuman elektr ta’minoti korxonasi xodimlari tomonidan  joyiga chiqgan holda murojaatchi M.Mavlonovning yashash hududida Davlat dasturi bо‘yicha sim yog‘ochlarni almashtirish ishlari olib borilayotganligini ma’lum qilamiz.         \r\nShuningdek, suv nasosini tarmoqga ulash tо‘g‘risidagi murojaati yuzasidan Davlat xizmatlari markaziga murojaat qilishi shartligi tо‘g‘risida muojaatchiga tushuntirish ishlari olib borildi.', '1648106769.2051.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
(2240, '16', '2022-03-11', 2059, NULL, NULL, NULL, NULL, NULL, NULL, 679, 15, '2022-03-26', NULL, 4, 2, '2022-03-11 17:11:48', '2022-03-17 11:14:00', 0, NULL, 'Аризагўй Болтаев Қувондиқнинг \"пиёдалар йўлакчаси ҳамда светофор ўрнатиш масаласида амалий ёрдам бериш\" тўғрисида қилган мурожаатига асосан, Бош бошқарма ва Хазорасп туман йўллардан фойдаланиш унитар корхонаси мутахассислари томонидан ўрганиш ишлари олиб борилди. Ўрганиш жараёнида, 4Р 156 автомобиль йўлининг 61 км.да пиёдалар учун светофор ўрнатиш зарурлиги аниқланди. Шунингдек, Хазарасп туман йўллардан фойдаланиш унитар корхонаси томонидан 2022 йил автомобиль йўлларини жорий таъмирлаш ишлари учун қўшимча ажратиладиган лимит маблағлари ҳисобидан светофор қурилмасини ўрнатиш ишларини режалаштирилиши тўғрисида аризагўй Болтаев Қувондиқга тушунтирилди.  ', '1647497640.9264.pdf', 220, 1, 1, 0, NULL, NULL, NULL),
