(2469, '5', '2022-03-23', 2261, NULL, NULL, NULL, NULL, NULL, NULL, 831, 15, '2022-04-02', NULL, 3, 2, '2022-03-23 12:11:11', '2022-03-25 14:27:50', 0, NULL, 'Istiqlol mahallasi hokim yordamchisi, tuman hokimligi masullari  va mahalla raisi o’rinbosari tamonidan fuqaroning uyiga bir necha marotaba borildi va telefon orqali suhbatlashildi. Borgan vaqtda fuqaro uyida emasligi va kuni bo’yi ishdaligi evaziga uchrashib bo’lmadi. Fuqaroning 2 ta o’g’li bo’lib bir nafari 2 gurux nogironi. Shu farzandining nomiga YTT sifatida ro’yxatdan o’tgan bo’lib, soliqlardan imtiyozlar berilgan. Yana bir nafar mehnatga layoqatli farzandi bo’lib mebelchilik bilan shug’ullanib kelmoqda. Borgan paytda o’g’li Rajapov Mirzoxid Masharip o’g’li bilan suhbatlashildi. O’g’lining aytishi bo’yicha mebelchilik qilishi uchun xom-ashyoni subsidiya asosida berilishini so’radi va bunday subsidiya mavjud emasligi sababli o’g’lining haydovchilik guvohnamasiga ehtiyoji borligi aniqlandi va  yoshlar daftariga kiritildi. Yoshlar daftari orqali xaydovchilik guvohnoma olishida 70% bo’lgan qismini davlat tamonidan subsidiya asosida to’lab berilishi tushuntirildi.', '1648200470.3588.pdf', 1250, 0, 1, 0, NULL, NULL, NULL),
(2470, '6', '2022-03-23', 2262, NULL, NULL, NULL, NULL, NULL, NULL, 834, 15, '2022-04-02', NULL, 4, 2, '2022-03-23 12:11:50', '2022-03-25 10:03:23', 0, NULL, 'G\'allachilik bo\'yicha ekin yeri olishda e-auksion.uz orqali qatnashib 20 sotx yer 10 yilga yutish imkoniyati mavjudligi tushuntirildi. \"Temir daftar\" jamg\'armasidan 33 million so\'m olib bo\'lmasligi lekin 33 million so\'m 14% kredit tadbirkorlik qilish uchun olish imkoniyatt mavjudligi tushuntirildi .', NULL, 1250, 0, 1, 0, NULL, NULL, NULL),
