(2472, '8', '2022-03-23', 2262, NULL, NULL, NULL, NULL, NULL, NULL, 839, 15, '2022-04-02', NULL, 4, 2, '2022-03-23 12:13:07', '2022-03-25 10:04:34', 0, NULL, 'G\'allachilik bo\'yicha ekin yeri olishda e-auksion.uz orqali qatnashib 20 sotx yer 10 yilga yutish imkoniyati mavjudligi tushuntirildi. \"Temir daftar\" jamg\'armasidan 33 million so\'m olib bo\'lmasligi lekin 33 million so\'m 14% kredit tadbirkorlik qilish uchun olish imkoniyatt mavjudligi tushuntirildi .', NULL, 1250, 0, 1, 0, NULL, NULL, NULL),
(2473, '2', '2022-03-23', 1871, NULL, NULL, NULL, NULL, NULL, NULL, 493, 15, '2022-03-19', NULL, 4, 2, '2022-03-23 14:46:21', '2022-03-24 22:57:05', 0, NULL, 'Фукаро ХДучкаров ушбу мурожаатлари оркали тадбиркорлик фаолияти билан шугулланиши учун вактинча фойдаланишга енгил типдаги савдо шахобчаси (Контейнер) урнатишга ер майдони ажратилишини сураган. Хозирги кунда Узбекистон Республикаси Президентининг “Кучма савдо фаолиятига замонавий ахборот технологияларни янада кенг жорий этиш хамда савдо автомати чакана савдо фаолиятини тартибга солиш чора тадбирлари тугрисида” 04.06.2021- йилдаги ПК-513 6-сон карори билан 2021-йил 1-декабрдан бошлаб Кучма савдо фаолияти (Контейнер) тадбиркорлик субъектлари томонидан кучма савдо объектларини электрон тарзда “K-SAVDO” ААТ автоматлаштирилган ахборот тизимида руйхатдан утказиш йули билан амалга ошириш хамда (Контейнер) жойи жойлаштириш схемалари буйича “К- SAVDO” ААТ оркали электрон аукционда сотиб олиш тартиби белгиланганлигини маълум киламиз. Мазкур масала юзасидан фукаро Х.Кучкаровга “K-SAVDO” ААТ автоматлаштирилган ахборот тизимини электрон онлайн-аукционга ер майдони куйиш тартиблари тугрисида белгиланган тартибда мутахассислар томонидан тушунтиришлар олиб борилди. Ушбуларни мурожаатингизга жавоб тарикасида маълум киламиз, агарда жавобдан норози б^лган такдирида юкори турувчи органларга мурожаат килиши мумкинлигини билдирамиз.', '1648144625.1734.pdf', 1249, 0, 1, 0, NULL, NULL, NULL),
