(2502, '№14', '2022-03-24', 2216, NULL, NULL, NULL, NULL, NULL, NULL, 783, 15, '2022-04-02', NULL, 4, 2, '2022-03-24 12:33:16', '2022-03-24 12:35:57', 0, NULL, 'Yangiariq tuman elektr ta’minoti korxonasining mutaxassislari tomonidan joyiga chiqgan holda Yangiariq tumani Pо‘rsang MFY Yangilik kо‘chasi 5 uyda yashovchi fuqaro Yuldosh Rо‘zmetov tomonidan “Diyorbek qovunchi” fermer xо‘jaligi elektr ta’minotidan ajratilganligi tо‘g‘risida o‘rganish o‘tkazildi. O‘tkazilgan o‘rganishlar natijasida “Diyorbek qovunchi” fermer xо‘jaligining elektr ta’minoti 110/35/10 kV kuchlanishli podstansiya KS-3 dan chiquvchi 10 kV kuchlanishli Karbit fideriga ulangan dispetcher raqami №TP-10325-sonli quvvati 160 kVAli transformator punkti orqali elektr energiyasi bilan ta’minlangan. \r\n“Diyorbek qovunchi” fermer xо‘jaligi foydalanilgan elektr energiyasi uchun 01.03.2022 yil holatiga 41,483,717.81 sо‘m qarzdorlik yuzaga kelganligi va shu qarzdorlikni о‘z vaqtida tо‘lamaganligi sababli elektr ta’minotidan ajratilgan. Ushbu qarzdorlikni sо‘ndirib, elektr energiyasidan foydalanish uchun oldindan tо‘lovlarni amalga oshirsa qayta elektr ta’minotiga ulab berilishini ma’lum qilamiz.\r\n', '1648107357.1387.pdf', 206, 1, 1, 0, NULL, NULL, NULL),
